INSERT INTO `service_prop` VALUES (1,1,'welcome','به سرویس \"سیگنال موجود است\" خوش اومدی! با من باش میخوام یه جایی ببرمت که توش پر از جایزه های خوب و نفیسه! اگر هم چشمت رو میخوای رو این همه جایزه ببندی و سیگنالت رو قطع کنی،  خاموش رو به 30568 ارسال کن. هر پیام 100 تومان!'),(3,1,'before activated','دکل آنتن ها سر جاشونه و شما هم سیگنال مارو دارید! اما اگه میخوای ما رو با رفتنت غمگین کنی، خاموش رو به 30568 بفرست!'),(5,1,'no question has remained','تا اينجاى بازى خيلى خوب پيش اومدى،منتظر ادامه سوالات ما باشيد.'),(6,1,'de-activation','چرا رفتی چرا من بیقرارم؟! چرا از تو دیگه سیگنال ندارم؟! با ارسال عدد ۳۰ به ۳۰۵۶۸ میتونی با سیگنال قویتری پیش ما برگردی!'),(7,1,'before de-activation','شما پیش از این از سرویس «سیگنال موجود است» خارج شده اید، برای عضویت در این سرویس 30 را به 30568 ارسال نمایید'),(21,1,'should be subscriber','والا ما که آنتن رو هر طرفی چرخوندیم از شما سیگنالی نگرفتیم! قدرت سیگنالت رو با ارسال عدد 30 به 30568 زیاد کن ! هر پیامک 100 تومان!'),(112,1,'wrong-motivation','عیب نداره. میدونی که اشتباه کردن از امتحان نکردن بهتره! ادامه بده و شانست رو امتحان کن.'),(113,1,'wrong-motivation','من میدونم گزینه رو اشتباه فرستادی! عجله نکن و با آرامش ادامه بده.'),(114,1,'wrong-motivation',' اشتباه بود. اما میدونی که هیچ چیزی تا زمانی که تو بهش اجازه ندی نمیتونه جلوت رو بگیره. پس ادامه بده!'),(115,1,'wrong-motivation','ای وای نه! اون یکی گزینه درست بود. تو بعدی جبران کن!'),(116,1,'wrong-motivation','آخ نه! جایزه ها اومد جلو چشمات باز هول شدی....دقت کن! برنده تویی!'),(117,1,'wrong-motivation','گزینه درست اون یکی بود. الان یکی از شاه کلید های یه موفقیت شیرین تو دستته! دقت کن!'),(118,1,'wrong-motivation','نه. میدونم که تو میتونی برنده بشی. ادامه بده!'),(119,1,'wrong-motivation','ای وای نه! تو بهترینی. بهترینها هم لایق برنده شدنن!'),(120,1,'wrong-motivation','مهم نیست! تو سوال بعدی امتیازت رو جبران کن.'),(121,1,'wrong-motivation','عیب نداره! خنده تو، تصمیم ماست. ادامه بده تا همیشه بخندی!'),(122,1,'wrong-motivation','نه! من باهاتم. نترس! خنده برنده شدنت رو میبینم!'),(123,1,'wrong-motivation','عیب نداره. میدونم باز هول شدی. '),(124,1,'wrong-motivation','آخ نه! عیب نداره. هر اشتباه پلی برای موفقیته. ادامه بده...'),(125,1,'wrong-motivation','نه. شانس داره در میزنه! ادامه بده!'),(126,1,'wrong-motivation','نه! قبول داری هیچی اتفاقی نیست؟ من که میگم جای درستی اومدی، ادامه بده.'),(127,1,'wrong-motivation','نه! با تمرکز بیشتر ادامه بده. میخوای بگم دور و بریهات ساکت باشن؟'),(128,1,'wrong-motivation','عیب نداره رفیق! بازم میتونی امتیازت رو زیاد کنی!'),(129,1,'wrong-motivation','مهم نیست! میدونی که هر جواب درست یه قدم تو رو به جایزه نزدیکتر میکنه.'),(130,1,'wrong-motivation','نه! یه دقیقه صبر کن! یه نفس عمیق بکش! حالا ادامه بده.'),(131,1,'wrong-motivation','ای وای نه! عجله کردی باز. عیب نداره. تو برنده ای!'),(132,1,'wrong-motivation','اشکال نداره. مدام با خودت تکرار کن که برنده ای و سوالها رو جواب بده. روز برنده شدن میبینمت!'),(133,1,'wrong-motivation','ای وای نه! امان از این گوشی های لمسی. اشتباه فرستادی!'),(134,1,'wrong-motivation','مهم نیست. نگران نشو. سوال بعدی رو جواب بده!'),(135,1,'wrong-motivation','اشکال نداره دوستم. باز سوال برات میفرستم تا جبران کنی!'),(136,1,'wrong-motivation','نگران نباش. رقیب هات هم چند تایی اشتباه کردن. اوضاعت خوبه ادامه بده!'),(137,1,'wrong-motivation','چرا هستی ناراحت؟ جبران میشه خسارت. من باهاتم. ادامه بده!'),(138,1,'wrong-motivation','آخ!  اشتباه فرستادی دوستم. تمرکزت رو بیشتر کن!'),(139,1,'wrong-motivation','نه دوستم! هر جواب درست برابر با شانس بیشتر!'),(140,1,'wrong-motivation','مهم نیست! رقابتت خیلی نزدیکه. ادامه بده!'),(141,1,'wrong-motivation','اشکال نداره! بازم برات سوال میفرستم تا بیشترین امتیاز رو بگیری!'),(142,1,'wrong-motivation','نه! باورم نمیشد اشتباه جواب بدی. حتما سر وصدا حواست رو پرت کرد!'),(143,1,'wrong-motivation','بی خیال دوست جون! عیب نداره که! بازم فرصت داری'),(144,1,'wrong-motivation','اشکال نداره نازنین! تو سوال بعدی جبران کن!'),(145,1,'wrong-motivation','عیب نداره. همه گاهی اشتباه میکنن! مهم ادامه دادن و موفق شدنه!'),(146,1,'wrong-motivation','ای واااای! اون یکی گزینه درست بود.'),(147,1,'wrong-motivation','اشکال نداره. ادامه بده تا خنده بیاد رو لبهات!'),(148,1,'wrong-motivation','عیب نداره. تو موفقی. چون اگه قرار بود موفق نشی، پیش ما نمی اومدی!'),(149,1,'wrong-motivation','مهم نیست! جایزه ها مال خودته.. کسایی بودن که تو دور پیش دو بار برنده شدن ها!'),(150,1,'wrong-motivation','نه! تو که بهترینی و با صبر و دقت جوابهای درست میفرستی!'),(151,1,'wrong-motivation','نه! اما نگران نباش! آن آب باز می آید به جو...'),(152,1,'wrong-motivation','مهم نیست. ادامه بده! تو قهرمانی!'),(153,1,'correct-motivation','آفرین. زدی تو هدف.'),(154,1,'correct-motivation','همینجوری با دقت جواب بدی برنده میشی!'),(155,1,'correct-motivation','خیلی خوب بود. آفرین به اطلاعاتت....'),(156,1,'correct-motivation','ای جووووونم...دمت گرم. همه چی بلدی ها!!'),(157,1,'correct-motivation','آفرین. هول نشو و ادامه بده. موفقیت، تو ادامه دادنه!'),(158,1,'correct-motivation','درست بود. آفرین!'),(159,1,'correct-motivation','باریکلا...اصلا بودن در کنار تو آرامش بخشه. ادامه بده!'),(160,1,'correct-motivation','بسیار عالی. تو بهترینی. ادامه بده'),(161,1,'correct-motivation','آفرین. میبینم که عزمت رو برا بردن جایزه ها جزم کردی!'),(162,1,'correct-motivation','بابا همه چی بلد! ادامه بده.'),(163,1,'correct-motivation','داری از کسی کمک میگیری!؟ به هر حال تو معرکه ای!'),(164,1,'correct-motivation','آخ که جواب درستت خستگی رو از تن آدم دور میکنه! کاش موقع جایزه گرفتن، خنده ات رو ببینم!'),(165,1,'correct-motivation','ببین همینجوری ادامه بدی موفقیتت تضمین شده است. آفرین!'),(166,1,'correct-motivation','با این همه اطلاعاتت حتما برنده میشی!'),(167,1,'correct-motivation','آفرین. فکر کنم تو از اینایی هستی که چند تا جایزه می بری! '),(168,1,'correct-motivation','جواب درست همین بود و یه قدم دیگه به جایزه نزدیک تر شدی'),(169,1,'correct-motivation','آفرین....تو بهترینی. ادامه بده تا جایزه بزرگ رو ببری!'),(170,1,'correct-motivation','برای جایزه بزرگه شرکت کردی؟ آفرین ادامه بده'),(171,1,'correct-motivation',' زکوی جواب درست می آید نسیم خوش برنده شدن تو!'),(172,1,'correct-motivation','دایره المعارف جلوت کم میاره! آفرین. ادامه بده!'),(173,1,'correct-motivation','اینجوری که بوش میاد جایزه صد میلیونی رو میخوای'),(174,1,'correct-motivation','بزرگترین دایره المعارف دنیا بریتانیکاس. نه! ظاهرا بود. چون تو بیشتر میدونی! ادامه بده .تو قهرمانی!'),(175,1,'correct-motivation','آفرین...تو برنده ای! مطمئنم!'),(176,1,'correct-motivation','.خود خودشه. ادامه بده'),(177,1,'correct-motivation','ای زنده باد. کاش ببینم که موقع جایزه گرفتن چه شکلی هستی!'),(178,1,'correct-motivation','آفرین! داری همه رقبا رو کنار میزنی ها!'),(179,1,'correct-motivation','آفرین... من و جایزه ها منتظرتیم. ادامه بده!'),(182,1,'correct-motivation','آفرین آفرین. خیلی خوب پیش میری ...ادامه بده!'),(183,1,'correct-motivation','تو معرکه ایی...ماشین رو بردی شیرینی چی میدی؟'),(184,1,'correct-motivation','عالی بود. داری نزدیک تر میشی به جایزه ها! ادامه بده!'),(185,1,'correct-motivation','گل گفتی آی گل گفتی...خیلی خوبی تو. ادامه بده!'),(186,1,'correct-motivation','آفرین. میبینم که حواست به رقبات هم هست. ادامه بده.'),(187,1,'correct-motivation','درسته! هم جوابت هم این که میگم: تو بهترینی!'),(188,1,'correct-motivation','عالی بود. یه پیامک بده ببینیم چی بلد نیستی! شوخی کردم. ادامه بده!'),(189,1,'correct-motivation','آفرین. راستی اگه جایی گیر کردی به اینترنت هم یه سر بزن. البته بعید میدونم تو گیر کنی!'),(190,1,'correct-motivation','آفرین! انقدر حس خوبیه، آدم میبینه هموطناش انقدر اطلاعات عمومیشون خوبه!'),(191,1,'correct-motivation','بسیار خوب...شک ندارم تو یکی از برنده هایی!'),(193,1,'correct-motivation',' دمت گرم دوستم. رو سفیدم کردی'),(194,1,'selection','1|2|۱|۲'),(195,1,'wrong-selection','دوست جون همه شرایط برای برنده شدنت آماده است و سیگنالی که ازت میگیریم حسابی قویه! فقط عددی که ارسال کردی اشتباهه! لطفا فقط عدد گزینه صحیح رو ارسال کن! مثال: 1 اگه میخوای از پیشمون بری هم خاموش رو به 30568 بفرست!'),(197,1,'question-1','\nامان از خط قرمز های جدید آدمها! یه سری خط قرمزشون شده موی سرشون، یه سری هم ابروشون! خط قرمز تهمورث خانجانی در سریال \"سیگنال موجود است\" که نقشش رو جواد رضویان بازی میکنه و اول سریال خودش رو با اون نام معرفی کرد، چی بود؟\n1- دروغ\n2- دزدی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(198,1,'answer-1','1|۱'),(199,1,'question-2','نه مثل اینکه پرویز غیر از سرپا گرفتن مرغ هاش از کمک های اولیه هم سر درمیاره! وقتی آرش خودش رو زد به غش کردن، پرویز چه جوری میخواست آرش رو به هوش بیاره؟\n1- تنفس دهان به دهان \n2- با شوک الکتریکی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(200,1,'answer-2','1|۱'),(201,1,'question-3','من که میگم اگه مهران غفوریان بازیگر نمیشد، میرفت خواننده میشد! اونجا که تست صدا میگرفتن و آرش میکروفونو گرفت، خودش رو کی معرفی کرد؟\n1- جانشین نفر سوم\n2- بهترین صدایاب استان\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(202,1,'answer-3','2|۲'),(203,1,'question-4','شاعر میگه: اگر هم در نگشایی ز ره بام بر آیم! وقتی پرویز، آرش رو از خونه بیرون کرد آرش چه جوری دوباره وارد خونه شد؟\n1- زنگ خونه رو زد\n2- با طناب از پنجره\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(204,1,'answer-4','2|۲'),(205,1,'question-5','میگن نیمرو بهترین و مقوی ترین غذای دنیاست! البته تا آدم ازدواج نکرده! قسمت اول سریال که پرهام نیمرو درست کرده بود رو یادته؟ وقتی اومد پیش پدرش که صحبت کنن، پرویز خان داشت چیکار میکرد؟\n1- میل میزد\n2- روی تردمیل راه میرفت\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(206,1,'answer-5','1|۱'),(207,1,'question-6','بازپرس که از دست سروش که از همه چی تعریف میکرد به جز اصل ماجرا، به تنگ اومده بود، از سروش خواست که از چی تعریف بکنه؟\n1- از شبکه\n2- از مدرسه\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(208,1,'answer-6','1|۱'),(209,1,'question-7','از دست این آرش و مشاوره هاش! تو قسمت اول سریال، آرش بعد از اینکه پرهام تست صدا داد، گفت که مشکل انتخاب نشدنش چی بوده؟\n1- اخلاق پرهام\n2- لوزه های پرهام\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(210,1,'answer-7','2|۲'),(211,1,'question-8','تو قسمت اول که داشتن از سروش باز جویی میکردن عجب استرسی داشت بیچاره! سروش جلوی بازجو ها ادعا کرد که چه جوری پاش به شبکه باز شده؟\n1- به پیشنهاد یکی از دوستاش\n2- از طریق کار توی پیتزا فروشی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(212,1,'answer-8','2|۲'),(213,1,'question-9','این فالگوش وایسادن های مستخدم شبکه ظاهرا جزء شغلشه! کارمندای شرکت بابت اطلاعاتی که از مستخدم میخواستن بگیرن، چی بهش دادن؟\n1- غذا\n2- پول\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(214,1,'answer-9','2|۲'),(215,1,'question-10','یاد صحنه منفجر شدن اکبر عبدی تو فیلم اجاره نشینها به خیر! اجاره خونه آرش دوست پرهام، چند وقت عقب افتاده بود؟\n1- 8 ماه\n2- 1 ماه\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(216,1,'answer-10','1|۱'),(217,1,'question-11','طفلکی این سروش قبل از اینکه پاش به شبکه باز شه چه داستانهایی داشت! تو رویاهاش شاید بنز سوار بود اما تو واقعیت....هه! یادته با چی پیتزا ها رو به دست مشتری میرسوند؟\n1- دوچرخه\n2- موتور\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(218,1,'answer-11','2|۲'),(219,1,'question-12','این آقا سروش قصه ما، برای اینکه بتونه هزینه ادامه تحصیلش رو بپردازه، کارش رو از کجا شروع کرد؟ البته اونم شاید به هوای دکتر شدن رفته بود خارجه! اما...\n1- لباس فروشی\n2- پیتزا فروشی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(220,1,'answer-12','2|۲'),(221,1,'question-13','دیدی یه سری آدم همیشه نتونستن هاشون رو میندازن گردن بقیه!؟ پرهام تو قسمت اول سریال به بازجو گفت که مسبب همه بد بختی هاش چی بوده؟\n1- لجاجت و خساست پدرش\n2- خودش\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(222,1,'answer-13','1|۱'),(223,1,'question-14','مثل پت و مت می مونن این آرش و پرهام! اونجا که آرش رفته بود دستشویی و پرهام نمیخواست پدرش متوجه شه، پرویز فکر میکرد کی توی دستشوییه؟\n1- دایی پرهام\n2- مادر پرهام\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(224,1,'answer-14','1|۱'),(225,1,'question-15','ارث و میراث هم داستانی برای خودش تو سریال داره ها! طبق گفته ی پدر سروش تو قسمت اول سریال، چند دنگ خونه ی پرویز خان، سهم الارث مادر فوت شده ی سروشه؟\n1- دو \n2- چهار\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(226,1,'answer-15','1|۱'),(227,1,'question-16',' تهمورث خانجانی که نقشش رو جواد رضویان بازی میکرد رو از بچه گی با چه اسمی صدا میزدن؟\n1- پرهام\n2- سروش\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(228,1,'answer-16','2|۲'),(229,1,'question-17','سروش توی گوشی موبایلش اسم کی رو \" فیل عمودی\" ذخیره کرده بود!؟ آخی! بیچاره فیل!!!!\n1- نگهبان سر کوچه ی خونه آقای صبور که توی دکه میشینه\n2- یکی از همکارای قدیمی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(230,1,'answer-17','1|۱'),(231,1,'question-18','پرهام تو قسمت اول سریال به مامانش گفت تو چند سال زندگیش نتونسته خودش برای خودش تصمیم بگیره؟ \n1- 35 سال\n2- 22 سال\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(232,1,'answer-18','2|۲'),(233,1,'question-19','دم این پرویز خان گرم که تا ته یه ماجرایی رو در نیاره ول کن نیست! اونجا که رفتن توی اتاق پرهام که صبحونه رو با هم بخورن، کی رو تخت خوابیده بود؟\n1- برادر خانومش \n2- آرش \nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(234,1,'answer-19','2|۲'),(235,1,'question-20','جناب فرمون و بادیگارداش تو قسمت اول رو یادته؟ فرمون چند روز مهلت داد تا صبور و سروش پول جور کنن؟\n1- 4-5 روز\n2- 2 هفته\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(236,1,'answer-20','1|۱'),(237,1,'question-21','نقش منصوری برادر زن دوم پرویز رو تو سریال سیگنال موجود است کی بازی کرد؟\n1- علی ابوالحسنی\n2- اصغر حیدری\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(238,1,'answer-21','1|۱'),(239,1,'question-22','یکی نیست بگه که آفتاب که همیشه پشت ابر نمیمونه پرویز خان! توی سکانسی که پرویز داشت با همسر دومش تلفنی صحبت میکرد، در جوابش که پرسید، کی منو به خانوادت معرفی میکنی چی گفت؟\n1- برنامه ای برای این کار نداشت\n2- گفت توی وصیتنامه ش نوشته که زن دوم گرفته\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(240,1,'answer-22','2|۲'),(241,1,'question-23','نقش مستخدم شرکت آقای صبور رو در سریال سیگنال موجود است کی بازی میکرد؟ نقش فال گوش وایساندن رو معرکه بازی میکنه!! از آرایشگاه زیبا بگیر تا بدون شرح و الانم که سیگنال...\n1- مهران غفوریان\n2- محمود بصیری\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(242,1,'answer-23','2|۲'),(243,1,'question-24','اولین فیلم سینمایی بلند مهدی مظلومی با نام \"سه بیگانه در سرزمین ناشناخته\" سال 93 کلید خورد و امین حیایی و محمد رضا شریف نیا هم توش بازی میکنن! سریال \"سیگنال موجود است\" هم از کارهای این کارگردانه!  میتونی بگی کدوم یکی از سریالهای زیر رو مهدی مظلومی کارگردانی کرده؟\n1- ستایش\n2- بدون شرح\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(244,1,'answer-24','2|۲'),(245,1,'question-25','اون خانوم با شخصیتی که لباس آبی تنش بود، همون لیلی صبور که نقشش رو سحر ولد بیگی بازی میکرد چه نسبتی با آقای صبور داشت؟\n1- خواهر آقای صبور بود\n2- دختر آقای صبور بود\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(246,1,'answer-25','2|۲'),(247,1,'question-26','کلا ایشون هم یا معلم تاریخه یا یهو تو یه باغ نخود سر در میاره و همیشه بهت زده ست! نقش آقای صبور مدیر کل شبکه رو هم بازی کرد. میدونی کی رو میگم؟\n1- سیامک انصاری\n2- مهران غفوریان\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(248,1,'answer-26','1|۱'),(249,1,'question-27','قدیم ترها میگفتن هرکی از خونه قهر میکنه میره خواننده میشه!  آرش تو قسمت اول سریال برای دلداری دادن به پرهام که تو تست رد شده بود، چی گفت؟\n1- گفت پرهام مثل جوجه اردک زشته که یه روز غاز شد\n2- گفت باید نقاش میشدی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(250,1,'answer-27','1|۱'),(251,1,'question-28','سروش هم مثل بعضی ها با رویای زیادی رفت خارجه که کسی بشه واسه خودش. اما دست تقدیر اونرو به یه پیتزا فروشی انداخت... میدونی کدوم پیتزا فروشی؟\n1- ناساکو\n2- ژوان\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(252,1,'answer-28','1|۱'),(253,1,'question-29','همیشه تو نقشهاش دنبال بهونه ست!!! مهران غفوریان رو میگم! اینبار بهونه اش برای این که میخواست خونه ی پرهام اینا بمونه چی بود؟\n1- خونه خودشون رو دارن تعمیر میکنن\n2- اجاره اش عقب افتاده بود و از دست صاحبخونه در رفته بود\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(254,1,'answer-29','2|۲'),(255,1,'question-30','پرهام (پسر دایی سروش)، شغلش چی بود؟\n1- بازیگر\n2- خواننده\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(256,1,'answer-30','2|۲'),(257,1,'question-31','میدونی نقش پرویز پدر پرهام رو تو سریال سیگنال موجود است، کی بازی میکرد؟\n1- اصغر حیدری\n2- حامد وکیلی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(258,1,'answer-31','2|۲'),(259,1,'question-32','یاد مجله ماشینهایی که لای کتابهای درسی میذاشتیم و جای درس خوندن میخوندیم به خیر! راستی توی قسمت اول که مثلا سروش داشت درس میخوند، پدرش براش چی اورد که بخوره؟\n1- آب هویج\n2- شیر موز\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(260,1,'answer-32','1|۱'),(261,1,'question-33','نه! مثل اینکه اینجا پای یک خانم در میونه! نقش نیلوفر همسر آقای صبور رو کی باز میکرد؟\n1- لاله صبوری\n2- مرضیه صدرایی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(262,1,'answer-33','2|۲'),(263,1,'question-34','نقش سوسن خانم، مادر پرهام که عمه ی سروش هم هست، رو کی بازی میکرد؟\n1- لاله صبوری\n2- لیلی رشیدی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(264,1,'answer-34','1|۱'),(265,1,'question-35','خدا نکنه که رفیق آدم پیش خانواده، آدم موجه ای نباشه! تو سریال سیگنال موجود است اسم دوست صمیمی و تپل پرهام که نقشش رو مهران غفوریان بازی کرده بود و پدر پرهام ازش خوشش نمی اومد، چی بود؟\n1- آرش\n2- پرویز\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(266,1,'answer-35','1|۱'),(267,1,'question-36','امان از دست این حس کنجکاوی مودبانه که این بار هم کار دست سروش داد! اولین باری که سروش پیتزا ها رو برد به شبکه، پشت اتاق کی فالگوش وایساده بود؟\n1- مدیر کل شبکه\n2- یکی از کارمندها\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(268,1,'answer-36','1|۱'),(269,1,'question-37','بالاخره زبل بازیهای آقا سروش به سیاستهای کارمندهای قدیمی چربید! یادت هست تو قسمت اول، سروش بعد از استخدام توی شبکه چه سمتی پیدا کرد؟\n1- مشاور شبکه\n2- منشی شبکه\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(270,1,'answer-37','1|۱'),(271,1,'question-38','جیک، جیک، جیک! شغل پرویزخان پدر پرهام تو سریال سیگنال موجود است، چی بود؟\n1- خواننده\n2- صاحب مرغداری\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(272,1,'answer-38','2|۲'),(273,1,'question-39','به نظر من که بیچاره خیلی هم بد آهنگ نخوند! نفر اولی که ازش تست صدا گرفتن رو میگم! یادته آهنگ معروف کدوم برنامه رو خوند؟\n1- جشن رمضان، محمد علیزاده\n2- ماه عسل، مهدی یراحی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(274,1,'answer-39','1|۱'),(275,1,'question-40','این آرش تپل هم از هر فرصتی استفاده میکنه تا همه چی به نفع خودش باشه! اون سکانسی که پرویز بهش گفت نمیشه توی خونه من بمونی و میخواست بیرونش کنه، آرش چه بهونه ای اورد برای موندن؟\n1- راه دور خونه اش رو بهونه کرد!\n2- برای رژیم غذایی پرهام میخواست بهش کمک کنه!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(276,1,'answer-40','2|۲'),(277,1,'question-41','منم کاملا با نظر داور موافقم! تو قسمت اول که تست صدا میگرفتن، بعد از اینکه نفر دوم آواز خوند، داور بهش چی گفت؟\n1- پیشنهاد کرد شغلش رو عوض کنه\n2- توی موسیقی آینده داره بعدا باهاش تماس میگیرن\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(278,1,'answer-41','2|۲'),(279,1,'question-42','امان از شیطنت های بچگی! نکنه تو هم مثل سروش خان درس خون بودی! تو قسمت اول رفقای سروش، موقعی که پدرش اومد تو اتاق، کجا قایم شده بودن؟\n1- زیر تخت\n2- تو کمد\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(280,1,'answer-42','2|۲'),(281,1,'question-43','نقش پرهام رو تو سریال سیگنال موجود است کی بازی کرد؟\n1- رضا نامی\n2- علی ابوالحسنی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(282,1,'answer-43','1|۱'),(283,1,'question-44','اسم نامزد پرهام تو سریال سیگنال موجود است، چی بود؟\n1- عسل\n2- لیلی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(284,1,'answer-44','1|۱'),(285,1,'question-45','پرهام با چند تا تخم مرغ نیمرو درست کرده بود؟\n1- 8 تا\n2- 2 تا\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(286,1,'answer-45','1|۱'),(287,1,'question-46','آخی! امان از دوران عاشقی! آدم رو به چه کارهایی وادار میکنه! مثلا یادت هست توی قسمت دوم سریال که صبور با خانواده اش توی دفتر  باهم صحبت میکردن کی براشون چای اورد؟\n1- مجدی\n2- سروش\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(288,1,'answer-46','2|۲'),(289,1,'question-47','شاعر میگه : از فراق مرغ بشقابم شکست/ قاشق و چنگال من در غم نشست! راستی منصوری هر مرغ رو برای وام گرفتن چی معرفی کرده بود؟\n1- بنگاه زود بازده\n2- کارخونه تولیدی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(290,1,'answer-47','1|۱'),(291,1,'question-48','صبور موقع ظرف شستن گفت تنها کسی که میتونه خودش و شبکه رو از مخمصه نجات بده کیه؟\n1- سروش\n2- یکی از شرکای قدیمیش\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(292,1,'answer-48','1|۱'),(293,1,'question-49','یکی هم بود که میگفت: ته دیگ طلایی رنگ خوشمزه هم نشدیم تا دو نفر سرمون دعوا کنن! راستی تو \"سریال سیگنال موجود است\" تو خونه مدیر شبکه موقعی که غذاشون ته دیگ زعفرونی داره کی باید ظرف بشوره؟\n1- لیلی\n2- آقای صبور\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(294,1,'answer-49','2|۲'),(295,1,'question-50','کارمندای شبکه برای اعتراض به حقوق عقب افتادشون میخواستن چیکار کنن؟\n1- اعتصاب کنن\n2- به صبور نامه بنویسن\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(296,1,'answer-50','1|۱'),(297,1,'question-51','مورد داشتیم طرف فقط وقتی میره خونه دوست و اقوامش، یادش میفته که برا گوشیش یا لپ تاپش برنامه و بازی دانلود کنه! والا چی بگم... آخه عزیز من نکن ! زشته! میدونی قبض تلفن پرهام چقدر اومده بود؟\n1- دو میلیون و 600 هزار تومان\n2- 1 میلیون\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(298,1,'answer-51','1|۱'),(299,1,'question-52','عسل نامزد پرهام تو چه مسابقاتی شرکت کرده بود؟\n1- مسابقه جهانی دارت\n2- بولینگ\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(300,1,'answer-52','1|۱'),(301,1,'question-53',' امان از دست این \"توجه\" که همه بلا ها زیر سر این کلمه ست و عامل به وجود اومدن همه مشکلاته!!! مثلا سوسن میترسید که بی توجهی پرویز به پرهام، باعث چی بشه؟؟\n1- خونه رو ترک کنه\n2- معتاد شدن پرهام\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(302,1,'answer-53','2|۲'),(303,1,'question-54','قدیمها با کلی شرمندگی و خجالت آدمها ده دقیقه خونه دوستهاشون میموندن اما حالا طرف به هوای یه کار کوچیک، چهار روز خونه رفیقش میمونه و بیرون کردنش از خونه پرتاب سه امتیازی محسوب میشه! آرش هم از همین آدمهاست که بالاخره یکی به پلیس معرفیش کرد! اون کی بود؟\n1- پرویز\n2- دکتر\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(304,1,'answer-54','1|۱'),(305,1,'question-55','دلم برای پرهام میسوزه! بیچاره احتمالا با خودش میگه تو زندگیش آهنگ هم نشدیم که دو نفر بهمون گوش کنن! راستی میدونی تیتراژ ابتدایی سریال سیگنال موجود است رو کی خوند؟\n1- امیر برادران\n2- علی بیگی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(306,1,'answer-55','2|۲'),(307,1,'question-56','نظر مجدی درباره ازدواج لیلی و سروش چی بود؟\n1- سروش راه داماد صبور شدن رو بلده!\n2- به نظر مجدی سروش لیاقت لیلی رو نداره\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(308,1,'answer-56','1|۱'),(309,1,'question-57','فکر کنم که سروش دوست داشت انگشتهای ایکیو سان رو داشته باشه تا به سرش بماله و همه مشکلات یه هو حل بشن! یادته بابای سروش در مورد هوش بچه اش به بازپرس چی گفت؟\n1- آدم کند ذهنیه!\n2- آی کی یو ش اندازه جلبکه!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(310,1,'answer-57','2|۲'),(311,1,'question-58','توی قسمت دوم سریال وقتی آرش از بازداشتگاه آزاد شد، پرهام پشت تلفن چی بهش گفت؟\n1- میخواست قبل از اینکه عسل بیاد ایران آلبومش رو جمع کنه\n2- گفت که دیگه حق نداره بیاد خونه ی پرویز\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(312,1,'answer-58','1|۱'),(313,1,'question-59','امان از دست این دایره زنگی....پرویز که از آرش و برنامه های ماهواره شاکی بود تو دعوای تلفنی به مجری تلویزیون گفت به جای مجری این برنامه ها شدن، بره چی کار کنه؟\n1- خودش رو اصلاح کنه\n2- بینی اش رو عمل کنه\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(314,1,'answer-59','2|۲'),(315,1,'question-60','توی قسمت دوم سریال به اعتقاد صبور مشکل اصلی شبکه چی بود؟\n1- پایین بودن سطح فرهنگی برنامه ها\n2- برنامه آشپزی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(316,1,'answer-60','1|۱'),(317,1,'question-61','همیشه حق با خانوماس! وقتی دختر پرویز دید که باباش فهمیده قبض موبایلش یک میلیون تومن اومده ، چه توجیهی کرد؟\n1-  در راه علم و دانش هزینه میکنم\n2-  پرهام و آرش از موبایلش استفاده کردن!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(318,1,'answer-61','1|۱'),(319,1,'question-62','تو قسمت دوم سریال\" سیگنال موجود است\" بازپرس گفت که مغز متفکر ماجرا کیه؟\n1- سروش\n2- آرش\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(320,1,'answer-62','1|۱'),(321,1,'question-63','یاد کبری و تصمیمش تو کتابهای درسی به خیر! سروش هم احتمالا کلی تصمیم تو زندان گرفته بود! میتونی بگی سروش رو در و دیوار سلول چی نوشته بود؟\n1- اسم لیلی \n2- چوب خط روزهای اسارتش رو\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(322,1,'answer-63','1|۱'),(323,1,'question-64',' راست میگن که آدم های درشت هیکل قلب مهربونی دارن ها! مثلا همین آرش گفت اولین چیزی که تو زندگیش اهمیت داره، چیه؟\n1- پول\n2- انسانیت\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(324,1,'answer-64','2|۲'),(325,1,'question-65','بار اولی که پلیس اومد دم خونه پرویز اینا، آرش چه کارتی رو به پلیس نشون داد؟\n1- کارت پایان خدمت\n2- گواهینامه رانندگی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(326,1,'answer-65','1|۱'),(327,1,'question-66','زمانی که پرویز هنوز رو سرش مو داشت به منصوری چه قولی داده بود؟\n1- ده درصد از فروش رو بهش بده!\n2- نصف مرغداری رو به نامش کنه!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(328,1,'answer-66','2|۲'),(329,1,'question-67','گاهی وقتها استعداد ها به چشم نمیان! مثل مقایسه گل آفتابگردون که دونه هاش با نظم و ترتیب بهتری نسبت به انار یه جا نشستن! اما انار برای شعر انتخاب شد! اینهم آرش و استعدادهاش! اسم آهنگی که آرش برای شبکه میخواست بخونه، چی بود؟\n1- 4.4.2\n2- هپروته\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(330,1,'answer-67','2|۲'),(331,1,'question-68','بابا دم این سیامک انصاری گرمه ها! تو برره که امتیاز روزنامه رو به خانومش داد، اینجا هم که شبکه رو! میدونی چند دنگ شبکه مال همسر صبوره؟\n1- سه دنگ\n2- شش دنگ\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(332,1,'answer-68','1|۱'),(333,1,'question-69','به نظر پرویز که از دست پسر و رفیقاش و خصوصا قبض تلفن به تنگ اومده بود، پرهام رو باید به کجا بدن تا بزرگ کنن؟\n1- مهد کودک\n2- بهزیستی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(334,1,'answer-69','2|۲'),(335,1,'question-70','اینم یه راه برای خوشبختی! تو برنامه ای که از شبکه صبور پخش شده بود، گفته بود که خانومهایی که میخوان خوشبخت بشن چه چیزهایی رو به سر شوهرشون بمالن؟\n1- کاکوتی و شاه تره با ساقه خارشتر\n2- تخم مرغ و عسل و نخود\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(336,1,'answer-70','1|۱'),(337,1,'question-71','\" من یک سرخپوست هستم با نام مستعار پسر کوه که در دل کوه متولد شدم و در طبیعت بزرگ شدم به صورت یک جنگنده! \" این تعریف کی از خودش بود؟\n1- پرویز\n2-آرش\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(338,1,'answer-71','1|۱'),(339,1,'question-72',' تو قسمت دوم سریال، شغل پدر سروش که حسابی از خجالت پسرش جلوی بازپرس دراومد، چیه؟\n1- دکتر\n2- تو مرغداری کار میکنه\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(340,1,'answer-72','1|۱'),(341,1,'question-73','من که عاشق گریه کردن وخندیدنشم! محمود بصیری رو میگم. همون که نقش مستخدم شبکه رو بازی میکنه! نقش کی رو بازی میکنه؟ \n1- مجدی\n2- ناصری\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(342,1,'answer-73','1|۱'),(343,1,'question-74','پرویز که ادعا میکرد جیک جیک همسردومش به روحش صفا میده، اونرو میخواست تو کجا ثبت کنه؟\n1- گینس\n2- روزنامه\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(344,1,'answer-74','1|۱'),(345,1,'question-75','توی قسمت دوم سریال که پرویز پشت در خونه تلفنی با همسر دومش صحبت میکرد، چه چیزی باعث وحشتش شد؟ \n1- شنیدن حرفهاش توسط سوسن\n2- قبض آب و برق و تلفن\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(346,1,'answer-75','2|۲'),(347,1,'question-76','هه ...زهی خیال باطل! پرویز از همه جا بی خبر به همسایه ش گفت چرا پول تلفن براشون نمیاد؟\n1- چون ما همه تو خونه موبایل داریم کسی از تلفن ثابت استفاده نمیکنه\n2- چون ما تلفن ثابت نداریم\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(348,1,'answer-76','1|۱'),(349,1,'question-77','پرهام که برای جور کردن پول آلبومش ماشین پدرش پرویز رو بی لاستیک کرده بود چه مبلغی رو برای تولید آلبومش لازم داشت؟\n1- 8 میلیون تومان\n2- 1 میلیون تومان\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(350,1,'answer-77','1|۱'),(351,1,'question-78','یه آقایی اومد گفت که تنها یادگاری ای که تو دوران نامزدیش از نامزدش دریافت کرده، یه جفت دستکش آشپزخونه بود! چی بگم والا ! راستی اولین یادگاری که سروش از لیلی داشت، چی بود؟\n1- کتاب\n2- شاخه درخت\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(352,1,'answer-78','2|۲'),(353,1,'question-79','پدر سروش راجع به شغل پسرش در خارج چه فکری میکرد؟\n1- فکر میکرد سروش درسش رو تموم کرده و توی سازمان فضایی ناسا کار میکنه\n2- فکر میکرد سروش داره دکتری میخونه!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(354,1,'answer-79','1|۱'),(355,1,'question-80','آخه رفیق از این با معرفت تر؟ یادته مبلغ وامی که ناصر برای مرغداری جور کرده بود چقدر بود؟\n1- دو میلیارد\n2- 1 میلیارد\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(356,1,'answer-80','1|۱'),(357,1,'question-81','من که میگم پرویز هم از اون دسته از کوهنوردهایی که میرن کوه که وزن کم کنن اما تا یه قدم میرن زود بر میگردن و میرن کله پزی! یادته برای همسر دومش چه جوری لاف کوهنورد بودنش رو میزد؟\n1- تا تو یه چای دم کنی منم ناشتا میرم قله رو فتح میکنم\n2- من هیمالیا رو فتح کردم\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(358,1,'answer-81','1|۱'),(359,1,'question-82','پرویز برای منصوری چقدر چک به عنوان مساعده نوشت؟\n1- پونصد هزار تومن\n2- یک میلیون و پونصد هزار تومن\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(360,1,'answer-82','2|۲'),(361,1,'question-83','اونجا که پرهام به آرش گفت برو وسایل رو بیار و ماهواره رو نصب کن، آرش گفت وسایل کجاست؟\n1- پشت ماشین توی صندوق عقب\n2- توی انباری خونه آرش\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(362,1,'answer-83','1|۱'),(363,1,'question-84','یکی نیست که بگه نخوردیم نون گندم، دیدیم دست مردم آقا پرویز! ما که مردیم از دست لاف زدنهاش. مثلا یادته پرویز میخواست کدوم قله رو یک ساعته فتح کنه؟\n1- توچال\n2- دماوند\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(364,1,'answer-84','2|۲'),(365,1,'question-85','توی تیتر روزنامه چی نوشته بود که باعث شد پرویز از پسرش پرهام بترسه؟\n1- پسری معتاد پدر پولدار خود را به طرز فجیعی خفه کرد\n2- چند تا از مرغداری های شهر پلمپ شد\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(366,1,'answer-85','1|۱'),(367,1,'question-86','راههای رسیدن به شهرت زیاده! میگی نه؟! مثلا یکی خدمت به خلق میکنه و مشهور میشه اون یکی هم برای شهرت مثل پرهام برای خودش یه اسم عجیب غریب میذاره! چی بگم والا ! تو قسمت دوم سریال گفت به شهرت رسیدن یه سری افراد از روی چه چیزی بوده؟\n1- سوءتفاهم\n2- بی خیالی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(368,1,'answer-86','1|۱'),(369,1,'question-87','مورد داشتیم که میگفت یه زمانی برای کسی الگو شدم، طرف زندگیش نابود شد.دیگه تصمیم گرفتم همون درس عبرت باقی بمونم! به گفته ی سروش، الگوی تلاش و خانواده دوستیش توی زندگی کی بوده؟\n1- دایی پرویز\n2- آقای صبور \nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(370,1,'answer-87','1|۱'),(371,1,'question-88','امان از دست سادگی مامان پرهام! بیچاره برای خوشبختی بچه هاش دیگه داشت میزد تو کار نوستر آداموس! برگشتن عسل از خارج، با چه روزی تقارن پیدا کرده بود؟\n1- روز مجوز گرفتن پرهام\n2- سالگرد ازدواج پرویز و سوسن\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(372,1,'answer-88','1|۱'),(373,1,'question-89','اگر مدتهاست از مادر خود قهر کرده اید، اگر مدتهاست شمارو نادیده میگیرند به مطب آرش برید تا صدای شما رو برای خواننده شدن پرورش بده!!! آرش برای بهتر شدن صدای پرهام چی بهش داده بود بخوره؟\n1- دمنوش گیاهی\n2- پودر تقویت کننده صدا\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(374,1,'answer-89','2|۲'),(375,1,'question-90','این هم یه نکته آموزنده: برای خلاصی از سر و صدای دست فروشها و مطالعه کردن در مترو میشه از پنبه استفاده کرد! پدر سروش چرا پنبه توی گوشش گذاشته بود؟\n1- عادت داشت که موقع مطالعه پنبه تو گوشش بذاره\n2- برای اینکه صدای پرویز رو نشنوه\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(376,1,'answer-90','1|۱'),(377,1,'question-91','جدا اگه آدم هم عاشق باشه و هم کارمند تو این دوره زمونه مرررررده! به عقیده سروش تو قسمت سوم سریال، ویژگی یه مدیر خوب چیه؟\n1- حقوق کارمندا رو به موقع بده و یه ذره هم بهشون محبت کنه\n2- اجازه دخالت توی امور شرکت رو به کارمندها نده\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(378,1,'answer-91','1|۱'),(379,1,'question-92','پرهام تو قسمت سوم سریال چه خبر سورپرایز کننده ای برای خانواده اش داشت؟\n1- مجوز آلبومش رو گرفته بود!\n2- میخواست برای تحصیل و زندگی یه مدت بره خارج!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(380,1,'answer-92','2|۲'),(381,1,'question-93','اسم حس غریب همسر صبور که از همه اتفاقهای شرکت با خبرش میکرد، چی بود؟\n1- مجدی\n2- حس ششم\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(382,1,'answer-93','1|۱'),(383,1,'question-94','تو قسمت سوم اسم دوست سروش که قاچاق انسان میکنه، چیه؟\n1- اسی\n2- گرگیج\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(384,1,'answer-94','2|۲'),(385,1,'question-95','سروش به پرهام گفت موقع اومدن به خارج از کشور چی با خودش بیاره؟\n1- پول نقد\n2- سوغاتی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(386,1,'answer-95','1|۱'),(387,1,'question-96','پلیس فرودگاه برای چی پرهام رو گرفته بود؟\n1- دعوا کرده بود\n2- جعل ویزا\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(388,1,'answer-96','2|۲'),(389,1,'question-97','به عقیده سروش توی ایران برای خواننده شدن چه شرایطی لازمه؟ \n1- همین که پول داشته باشی کافیه\n2- یا صدات درجه 1 باشه یا مجوز داشته باشی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(390,1,'answer-97','2|۲'),(391,1,'question-98','آخی که این بچه شاید نشنیده آواز دهل شنیدن از دور خوش است!پرهام که بارش رو برای رفتن بسته بود، چه جوری میخواست از پرویز تشکر و خداحافظی کنه؟\n1- پرویز رو بغل کرد\n2- دست پرویز رو ببوسه\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(392,1,'answer-98','2|۲'),(393,1,'question-99','من که میگم اگه سروش بذاره با احساساتش بازی کنن، ده به هیچ می بازه! اما چه کنیم که اون ظاهرا حسابی عاشق لیلی شده! سروش گفت که تو بچگی چه بازی ای میکرده؟ \n1- لی لی حوضک\n2- بالا بلندی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(394,1,'answer-99','1|۱'),(395,1,'question-100','طرف آگهی داده اگر هیچ هنری ندارید و هیچی بلد نیستید و هدفی ندارید برای مهاجرت با ما تماس بگیرید!  قاچاقچی معتبر انسان!!! \"اسی\"چقدر پول از پرهام میخواست تا ویزا براش بگیره؟\n1- 1 میلیون\n2- 8 میلیون\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(396,1,'answer-100','2|۲'),(397,1,'question-101','اسم دختر پرویز ( خواهر پرهام) چیه؟\n1- رعنا\n2- پرگل\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(398,1,'answer-101','2|۲'),(399,1,'question-102','تو قسمت سوم که  آرش فهمید پرهام میخواد قاچاقی با کمک دوست سروش بره خارج، به پرهام چی گفت؟\n1-گفت اگه منو نبری همه چی رو به پلیس لو میدم\n2- گفت که بهتره که قانونی بره\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(400,1,'answer-102','1|۱'),(401,1,'question-103','میخوای مدیرت یا مدیریتت رو بسنجی؟ پس به این سوال جواب بده! یکی از روش های مدیریتی برجسته از نظر صبور چی بود؟ \n1- مدیر خوب باید انتقاد پذیر باشه\n2- کارمندها توی هر شرایطی هستن باید به همون شرایط راضی باشن\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(402,1,'answer-103','2|۲'),(403,1,'question-104','دلیل اصلی پرویز برای زودتر پختن آش پشت پا چی بود؟\n1- پرهام هم از اون آش بخوره\n2- به زن دومش قول آش داده بود\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(404,1,'answer-104','2|۲'),(405,1,'question-105','آخ یادش به خیر! کارتون مزرعه سبزیجات رو میگم! صبور برای اخراج کردن دوبلر شبکه، چه بهونه ای آورد؟\n1-  به جای دوبلری صدای کلم بروکلی و پیازچه و سیر در میاره\n2- دل به کار نمیده\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(406,1,'answer-105','1|۱'),(407,1,'question-106','دوبلر شبکه فکر میکنه با کی وجه اشتراک داره؟\n1- سروش\n2- صبور\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(408,1,'answer-106','2|۲'),(409,1,'question-107','توی قسمت سوم سریال، \"اسی\" رفیق آرش، قرار شد سهم آرش رو چه جوری بهش بده؟\n1- براش کارت به کارت کنه\n2- نقدی همون جا داد\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(410,1,'answer-107','1|۱'),(411,1,'question-108','صبور برای راه اندازی شبکه از کی پول گرفته بود؟\n1- سروش\n2- فرمان\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(412,1,'answer-108','2|۲'),(413,1,'question-109','اول فیلم فکر میکردم جیک جیکو اسمشه! همسر دوم پرویز رو میگم! میدونی اسم همسر دوم پرویز چیه؟\n1- عسل یساری\n2- مژگان نقدینی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(414,1,'answer-109','2|۲'),(415,1,'question-110','دیگه خب چه کنیم؟! یه سری هم هستن که فکر می‌کنن مرغ خارجی ها، مرغ سوخاریه و تن به هرکاری برای رفتن به اون ور آب میدن! نقشه راهی کردن پرهام به خارج از کشور رو کی طراحی کرده بود؟\n1- سروش\n2- سوسن (مادر سروش)\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(416,1,'answer-110','1|۱'),(417,1,'question-111','قبلا ها میگفتن که ورزش برای سلامتی خوبه اما حالا ظاهرا باید گفت اگه میخوای با دارو ورزش کنی بهتره بی خیال شی! نمونه اش همین ژان کلفت اندام که آبروی شبکه رو برده با این دارو های تقلبیش! صبور به خاطر کی آقای کلفت اندام رو اخراج نکرد؟\n1- آقای یساری \n2- مجدی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(418,1,'answer-111','1|۱'),(419,1,'question-112','دنیا پر از صداهای جور واجوره. از قار قار کلاغ گرفته تا بوق های عجیب غریب ماشین ها که آدم رو منفجر میکنه! یادته تو اتاق صدور مجوز بعد از خوندن پرهام چه اتفاقی افتاد؟\n1- قناری غش کرد\n2- سقف اتاق ریخت\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(420,1,'answer-112','1|۱'),(421,1,'question-113','ظاهرا خورشت کنگری که دکتر خورده خیلی اثر گذاشته و لنگر دکتر حسابی گیر کرده! پرویز به سوسن گفت اگه برادرت از خونه ما بره، چیکار میکنه؟\n1- کل محل رو چلو گوشت میده\n2- مانع این کارش میشه\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(422,1,'answer-113','1|۱'),(423,1,'question-114','سروش چجوری زیرآب مسئول کافی شاپ رو پیش صبور زد؟\n1-  مواد غذایی تاریخ گذشته مصرف میکنه\n2- تو فنجونش سیبیل بوده\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(424,1,'answer-114','2|۲'),(425,1,'question-115','پرویز که حسابی از دست پرهام عصبانیه، تو قسمت سوم سریال به سوسن گفت چی رو درخت زندگیش نشسته؟\n1- همای سعادت\n2- کلاغ\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(426,1,'answer-115','2|۲'),(427,1,'question-116','پرویز به سوسن گفت که سی دی پرهام آمار چه چیزی رو بالا میبره؟ همینه که پرویز دست پرهام رو تو مرغداری بند نمیکنه دیگه! بیچاره از بحران تخم مرغ میترسه!\n1- طلاق\n2- نفوس و مسکن\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(428,1,'answer-116','1|۱'),(429,1,'question-117','برای اینکه پرهام رو سورپرایز کنن، عسل رو کجا قایم کردن؟ \n1- پشت مبل\n2- توی کمد\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(430,1,'answer-117','1|۱'),(431,1,'question-118','پرهام به پرویز گفت که چه مبلغی بابت گرفتن ویزا پرداخت کرده؟\n1- 2 میلیون\n2- 4 میلیون\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(432,1,'answer-118','2|۲'),(433,1,'question-119','پرویز که جلوی سروش آبروش داشت میرفت به بازپرس گفت چی رو جو جو صدا میکنه؟\n1- مرغ پا شکسته مرغداریش\n2- همسر دومش رو\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(434,1,'answer-119','1|۱'),(435,1,'question-120','بین خودمون باشه ها اما فکر کنم لیلی بهونه است تا سروش یادی از عشق های دوران کوکیش مثل بلفی و فلرتیشیا بکنه! اسم شهر مورد علاقه سروش تو کارتون های بچگیش چی بود؟\n1- اوز\n2- لی لی پوت\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(436,1,'answer-120','2|۲'),(437,1,'question-121','این سوال هم مخصوص اونایی که فیلم های کابویی رو دنبال میکردن! خبر اعتصاب کارمندا رو مجدی میخواست مثل کی به صبور بده؟\n1- جان وین\n2- بلوندی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(438,1,'answer-121','1|۱'),(439,1,'question-122','توجه کردی با اومدن این عابر بانکها پولها به جای چرک کف دست شبیه صابون شده که از دست آدم راحت تر سر میخوره! یادته پرهام بقیه پول دوست آرش، بابت تهیه ویزا رو چطوری پرداخت کرد؟\n1- نقد پرداخت کرد\n2- به وسیله دستگاه پز پرداخت کرد\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(440,1,'answer-122','2|۲'),(441,1,'question-123','کارمندای شبکه چرا اعتصاب کرده بودن؟\n1- از مشاور شبکه ناراضی بودن\n2- حقوقشون عقب افتاده بود\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(442,1,'answer-123','2|۲'),(443,1,'question-124','یکی بود میگفت طرف چهارم ابتدایی رو با تک ماده قبول شده حالا پا گذاشته رو گلو باباش که منو فرار مغزها کنید! اینم از پرهام خان ما! یادته میخواست بره چه مدرکی بگیره؟\n1-  دکترای موسیقی فولکورولیک\n2- دکترای دندونپزشکی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(444,1,'answer-124','1|۱'),(445,1,'question-125','به نظر پرویز سی دی پرهام چه تاثیری روی سوسن میذاره؟\n1- افسرده اش میکنه\n2- لاغرش میکنه\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(446,1,'answer-125','1|۱'),(447,1,'question-126','سروش تو قسمت سوم گفت نقش اصلی زندگیش از دوران طفولیت تا حالا رو کی بازی کرده؟\n1- لیلی\n2- پدرش\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(448,1,'answer-126','1|۱'),(449,1,'question-127','عسل تو مسابقه، دارت رو کجا زده بود که خبرساز شد؟\n1- وسط هدف\n2- توی چشم داور\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(450,1,'answer-127','2|۲'),(451,1,'help4subscribe','دوست عزیز شما عضو  سرویس هستید. برای غیر فعالسازی سرویس عطسه عدد10 خاموش رو به 30568 ارسال کنید و برای غیر فعالسازی سرویس سیگنال موجود است عدد 30 خاموش رو به 30568 ارسال کنید. هر پیامک 100 تومان'),(452,1,'help4unsubscribe','هنوز اینجا جات خالیه ها! برای عضویت در سرویس عطسه عدد10 رو به 30568 ارسال کن و برای عضویت در سرویس سیگنال موجود است عدد 30 را به 30568 ارسال کنید. جایزه ها منتظر تونن! هر پیامک 100 تومان!'),(453,1,'reactivation welcome','خوش اومدی !آره خود خودشه! ما که سیگنالی که فرستادی رو گرفتیم اما اگه تو میگی اشتباهه و میخوای ارتباطمون رو قطع کنی، خاموش رو به 30568 ارسال کن! هر پیامک ۱۰۰ تومان!'),(454,5,'welcome','به سرویس \"سیگنال موجود است\" خوش اومدی! با من باش میخوام یه جایی ببرمت که توش پر از جایزه های خوب و نفیسه! اگر هم چشمت رو میخوای رو این همه جایزه ببندی و سیگنالت رو قطع کنی،  خاموش رو به 30568 ارسال کن. هر پیام 100 تومان!'),(455,5,'before activated','دکل آنتن ها سر جاشونه و شما هم سیگنال مارو دارید! اما اگه میخوای ما رو با رفتنت غمگین کنی، خاموش رو به 30568 بفرست!'),(456,5,'no question has remained','تا اينجاى بازى خيلى خوب پيش اومدى،منتظر ادامه سوالات ما باشيد.'),(457,5,'de-activation','چرا رفتی چرا من بیقرارم؟! چرا از تو دیگه سیگنال ندارم؟! با ارسال عدد 30 میتونی با سیگنال قویتری پیش ما برگردی!'),(458,5,'before de-activation','شما پیش از این از سرویس «سیگنال موجود است» خارج شده اید، برای عضویت در این سرویس 30 را به 30568 ارسال نمایید'),(459,5,'should be subscriber','والا ما که آنتن رو هر طرفی چرخوندیم از شما سیگنالی نگرفتیم! قدرت سیگنالت رو با ارسال عدد 30 به 30568 زیاد کن ! هر پیامک 100 تومان!'),(460,5,'selection','1|2|۱|۲'),(461,5,'wrong-selection','دوست جون همه شرایط برای برنده شدنت آماده است و سیگنالی که ازت میگیریم حسابی قویه! فقط عددی که ارسال کردی اشتباهه! لطفا فقط عدد گزینه صحیح رو ارسال کن! مثال: 1 اگه میخوای از پیشمون بری هم 30خاموش رو به 30568 بفرست!'),(462,5,'help4subscribe','دوست عزیز، شما عضو سرویس \"سیگنال موجود است\"هستید. جهت غیر فعالسازی کلید واژه 30خاموش را به 30568 ارسال نمایید. هر پیامک 100 تومان!'),(463,5,'help4unsubscribe','والا ما که آنتن رو هر طرفی چرخوندیم از شما سیگنالی نگرفتیم! قدرت سیگنالت رو با ارسال عدد 30 به 30568 زیاد کن ! هر پیامک 100 تومان!'),(464,5,'reactivation welcome','خوش اومدی !آره خود خودشه! ما که سیگنالی که فرستادی رو گرفتیم اما اگه تو میگی اشتباهه و میخوای ارتباطمون رو قطع کنی، خاموش رو به 30568 ارسال کن! هر پیامک 100 تومان!'),(469,1,'question-128','یکی از مشاغل در دنیا فروشه! اما یه شغل کاذب هم بعضی ها دارن که توش همدیگر رو میفروشن! که هیچ در آمدی نداره الا دلخوری و کارشون خراب کردن و نیش و کنایه زدن  به بقیه، در مقابل دیگرانه! مثل همین پرویز و دکتر که جدالشون تمومی نداره! یادته دکتر  به مامور نیرو انتظامی برای خراب کردن پرویز گفت که مهمترین چیز در زندگی چیه؟\n1- پدر با کفایت\n2- پدر پولدار\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(470,1,'question-129','نه! واقعا دیگه این سروش خان نمیدونه از عشق لیلی چی کار کنه! فقط یکی نیست بهش بگه باباجون، اگه این لیلی خانم داشت به تو میلی/ یه دفعه هم که شده یه کاسه ای رو سرت میشکوند!!! خدا به خیر بگذرونه! اصلا بگو ببینم یادته تو قسمت چهارم سریال برای دیدن لیلی خانم چه کار کرد؟\n1- دسته گل خرید و رفت در خونشون\n2- خرید خونه صبور رو انجام داد و برد در خونشون\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(471,1,'question-130','میگم این دکترها خیلی باکلاسن ها! از قدیم خط شون شهره عام و خاصه. مثلا چیزی که تو دفترچه می بینی اینه: \" ₪￦₮￡ \" اما  داروخونه چی بهت یه آسپرین با چسب زخم میده! یه سری دست خط هم هست که بهش میگفتن خرچنگ قورباغه که از تو آفتاب گذاشتنش باید خود داری کرد! راستی از زور دست خط بد پرهام یادته پرویز چه چیزی رو آلو داغ خوند؟!\n1- الوداع\n2- تولیدات\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(472,1,'question-131','موندم تو کار اینایی که میرن خارج و تا دو روز میگذره ادعاهاشون شروع میشه و اگه بهشون فضا بدی میگن همه پیچ و مهره های برج ایفل رو خودشون دو روزه بستن!...نمونه سروش تو قسمت چهارم سریال که به همه گفته بود که تو ناسا کار میکنه! یادته با دیدن پرهام گفت برای چی از ناسا اومده بیرون؟\n1- فضای ناسا تکراری و برخوردشون عذاب آور شده بود\n2- حقوق خوبی نمی دادن!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(473,1,'question-132','مورد داشتیم طرف یه سفر سه روزه رفته دوبی بعد که میبینیش تو حرفهاش از هر سه کلمه دو تاش انگلیسیه! مثلا معمولا اینجوری شروع میشه:اااام! یادم رفت! شما به تراولینگ چی میگفتین؟!!!.. این آرش هم که حتما تو قسمت چهارم سریال دیدین! یادته به محض دیدن سروش به جای سلام چی گفت؟\n1- هاو  آر یو!\n2- های فیلتر\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(474,1,'question-133','مورد داشتیم طرف سایه کسی رو با تیر میزده، از صبح تا شب میگه ببینمش برای همیشه با هاش رابطه ام رو تموم میکنم و چنین و چنان، اما همین که از قضا شخص مورد نظر جلوش سبز میشه اونچنان قربون صدقه اش میره که آدم میمونه چی بگه! مثل همین منصوری! یادته قبل از اومدن پرویز به شرکت چی کار داشت میکرد؟\n1- داشت ناهار میخورد\n2- عکس پرویز رو با دارت میزد!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(475,1,'question-134','مورد داشتیم طرف رو شیشه ماشینش خطاب به آقا دزده نوشته: درب عقب سمت شاگرد خرابه! برای انجام کارت از اون استفاده کن! درب داشبورد باز گذاشتم ببینی توش چیزی نیست، زاپاس هم ندارم و....!!! راستی پرویز که از دست دزدیده شدن لاستیک های ماشینش خسته شده بود، گفت میخواد چی کار کنه؟\n1-  مثل پلنگ صورتی بره بالن بخره و سوارش شه!\n2- دوچرخه بخره!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(476,1,'question-135','مورد داشتیم طرف انواع و اقسام دزدی ها، قاچاق و کلا هرچی جرم بود انجام داده، بعد وقتی توسط قانون دستگیر شد، داد میزده: من مجرم نیستم، مریضم! من رو درک کنید! راستی تو قسمت چهارم سریال سیگنال موجود است، آرش که میخواست یک کلمه حرف نزنه، چه جوری اعتراف کرد؟ \n1- تو زندان اعتراف کرد!\n2- همه زندگی نامه اش رو که از 6 سالگی نوشته بود، به بازپرس داد! \nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(477,1,'question-136','مورد داشتیم طرف 18سال از ازدواجش میگذشته و به خاطر ازدواج فامیلی و ترس از ناقص شدن بچه، بچه دار نشده. ازش پرسیدن نسبت فامیلی تو و خانمت چی بوده؟ میگه زن و شوهریم دیگه! از این نسبت نزدیک تر؟! راستی تو قسمت چهارم سریال سیگنال موجود است سروش گفت که عمه اش چه نسبت دیگه ای باهاش داره؟\n1- خانم پسر داییش بود\n2- زن داییش بود\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(478,1,'question-137','مورد داشتیم به طرف میگن برای چی میخوای بری خارج، جواب داده: اونجا همه با هوشن! مثلا همشون میتونن انگلیسی صحبت کنن!! من که میگم همون بهتر که ایشون فرار مغزها کنن! راستی یادته تو قسمت چهارم سریال سیگنال موجود است، باز پرس مقصر اصلی فرار پرهام از ایران رو کی میدونست؟\n1- آرش\n2- خانواده پرهام\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(479,1,'question-138','من موندم اگه به جای دامداری مثلا ما نارگیل تولید میکردیم بعضی ها که قاچاقی تو پوست گوسفند به قول خودشون فرار مغزی میکردن، چی کار میکردن! طرف تو پوست میش قاچاقی از کشور خارج میشه توقع داره اون طرف براش قالیچه قرمز پهن کنن! یادته تو قسمت چهارم سریال، گرگیج، چطوری آرش و پرهام رو به سروش رسوند؟\n1- تو بشکه\n2- تو صندوق عقب ماشین \nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(480,1,'question-139','قدیم تر ها یکی با اسب سفید می اومد خواستگاری، قدش بلند بود و ...بعضی ها هم پاشنه در رو درمیوردن تا \"بله\" رو از خانواده عروس خانوم بگیرن! اخیرا مورد داشتیم طرف رفته خواستگاری میگه عروس خانوم خونه دارن؟ ماشین چی؟ ...چی بگم...! مثلا همین دکتر میدونی چند روز پشت در خونه پرویز اینا نشسته بود تا بله رو از خواهر پرویز بگیره؟\n1- دو روز\n2- یه هفته\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(481,1,'question-140','فکر کنم روش های زندگی سروش رو باید تو کتاب صد و یک راه برای ذله کردن پدر و مادر ثبت کرد! مثلا یادته آقا سروش برای خشک کردن صابون حمام اون رو عادت داشت کجا بذاره؟\n1- رو رادیاتور حمام\n2- رو کف حمام\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(482,1,'question-141','طرف میگه بزرگترین شکست زندگیم زمانی بود که توی دانشگاه سر جلسه امتحان استاد اومد بالاسرم بهش گفتم استاد تو رو خدا یه کمکی کنید! استادی لبخند زد بعد دست کرد توی جیب شلوارش یه پونصد تومنی گذاشت روی برگه ام!! راستی یادته از نظر پرویز تو قسمت چهارم سریال بزرگترین شکست زندگی پرهام چی بوده؟\n1- عسل\n2- خوانندگی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(483,1,'question-142','طرف عینک دودی میزنه تو خیابون پسرشو میبینه میزنه تو گوشش.میگه چرا میزنی؟ میگه تو این وقت شب بیرون چی کار میکنی؟ پسره میگه بابا شب نیست عینکتو بردار. عینکشو بر میداره باز میزنه زیر گوشش و میگه تو از دیشب تا حالا اینجا چه کار میکردی؟ راستی همراه نداشتن عینک مطالعه برای آرش چه مشکلی درست کرد؟\n1- اعترافاتش رو پس و پیش نوشت!\n2- تصادف کرد!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(484,1,'question-143','طرف اومده تو دادگاه خانواده در خواست طلاق داده! ازش پرسیدم برای چی میخوای جدا شی؟ میگه همسرم اونجوری که به قناریش میگه عزیزم، تا حالا به من نگفته! احساس میکنم جام دیگه تو اون خونه نیست!! راستی یادته آرش تو قسمت چهارم سریال سیگنال موجود است، گفت چه حسی نسبت به گوسفندی که در کنارش از اول راه با اون بود، پیدا کرده؟\n1- حس دشمنی\n2- حس مادرانه\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(485,1,'question-144','زمانى که ما مدرسه مى رفتیم یک نوع دیکته بود به اسم “دیکته پاتخته اى”! در نوع خودش عذابى بود براى کسى که پاى تخته مى رفت، یه حسى داشت تو مایه های کارنامه با معدل زیر ده! بگذریم! راستی گفتم دیکته! یادته پرهام که انگار دیکته اش هم مثل آواز خونیشه تو نامه ای که نوشته بود چی رو غلط نوشته بود؟ \n1- سلام رو با صاد نوشته بود\n2- آغاز رو با قاف نوشته بود\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(486,1,'question-145','دقت کردی غیر از داروخانه که داروهای مشابه میده یه سری هم هستن تا کسی رو میبینن سریع ذهنشون دنبال یه نفر مشابه آدم میگرده! اینا استعداد خوبی برای داروخانه چی شدن دارن! مثلا همین آرش تو قسمت چهارم سریال\" سیگنال موجود است\" به گرگیج گفت کارمندش شبیه کیه؟\n1- ترمیناتور\n2- راکی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(487,1,'question-146','حتما این رو شنیدی که کلاغه چه طوری قربون صدقه دست و پای بلوری بچه اش میره! اینجا هم یکی رو داریم اونم کسی نیست جز سوسن خانوم...تو قسمت چهارم سریال \"سیگنال موجود است\" سوسن که دنبال پرهام میگشت قد پسر با استعدادش رو به چی تشبیه کرد؟\n1- برج میلاد\n2- سرو\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(488,1,'question-147','بعضی ها هم که کلا عاشق نظر دادنن! آقا دو دقیقه اومدی تا ببینیمت و کنار هم باشیم ! آخه عزیز دل تو چی کار داری که من تو خونه ام گلدون رو به سقف آویزون کردم یا گذاشتم رو میز! اصلا دوست دارم گلدون رو بذارم تو یخچال!...مثلا آرش یادته به محض دیدن خونه سروش چه ایرادی گرفت؟\n1- گرمه\n2- تاریکه!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(489,1,'question-148','بعضی ها هم کلا برای کندن ساخته شدن! البته کندن برچسب هایی که رو دیوار خونه میچسبونن و کاغذ دیواری رو نمیگم ها! اینها کلا در حال پول کندنن! از خانواده شروع میکنن و بعد هم رفقا و آخرش هم هر جا که بشه! مثلا همین سروش! یادته تو قسمت چهارم سریال \"سیگنال موجود است\"  به صبور گفت به محض رسیدن پرهام چقدر از داییش پول میکنه؟\n1- 50 هزار تا\n2- 300-400 هزارتا\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(490,1,'question-149','بزرگی میگفت: در رفتن، دردیست که فرد را نمیکشد، اما پدر، مادر، همسر و همکاران و وابستگان رو.... را دق‌مرگ می کند! راستی تو قسمت چهارم سریال سیگنال موجود است، یادته جمله \"زندگی حس شاد زیستنه\" که پرهام تو اول نامه دلایل فرارش از خونه، نوشته بود مال کی بود؟\n1- کانت\n2- کنفوسیوس\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(491,1,'question-150','آخ از این روحیه انتقادی بعضی ها! میگی سلام، میگه سلام موهات کو؟ میگی احوالت چطوره، میگه چقدر چاق شدی!!! و .... یادته پرهام با دیدن خونه سروش تو قسمت چهارم سریال از چی خونه شکایت کرد؟\n1- کوچیک بودن خونه\n2- سرد بودن خونه\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(492,1,'question-151','اینم یه نکته کارا برای جلوگیری از ریزش مو! اگر موهای حساسی دارید، برایشان موسیقی \" همه چی آرومه/ من چه‌قدر خوشحالم!\" رو پخش کنید. تحقیقات نشون داده موهایی که روزی دو تا سه ساعت این موسیقی براشون پخش شده، حساسیتشون برطرف شده! راستی میدونی برای چی موهای پرویز ریخته بود؟\n1- خوردن داروهای تاریخ گذشته و تقلبی\n2- تجویز دکتر\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(493,1,'question-152','اینایی که کلا تو کار فرار کردنن رو دیدی؟ طرف خیلی پشتکار داره! از مهد کودک شروع میکنه، میرسه به مدرسه، بعد خونه، بعد کشور و بعد هم زندان و آخرش هم که از فرار خسته میشن، میدن رو تی شرتشون بنویسنن \"عاقبت فرار از مدرسه\"!!! تو قسمت چهارم سریال سیگنال موجود است، پرهام گفت گم کردن چه چیزی دلیل فرارش از خونه بوده؟\n1- شادی\n2- پول لاستیک های ماشین\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(494,1,'question-153','امان از دست کسایی که هیچ محدوده ای برای لوازم شخصی آدم قائل نمیشن! آقا موبایل هم مثل حوله و مسواک و خیلی چیزای دیگه شخصیه! لطفا تو مترو نگاه محترمت رو از موبایل افراد بکشید بیرون! یکی دیگه از این لوازم که منصوری تو قسمت چهارم سریال به پرویز گفت کاملا شخصیه، چی بود؟\n1- دسته چک\n2- عینک\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(495,1,'question-154','امان از دست اینایی که برای به دست اوردن ترحم دیگران همه خانواده شون رو یکی یکی یا روی تخت بیمارستان میبرن یا تو زندان! نمونه هاشون تو مترو هستن! آخه عزیز جان این راه زندگی کردن که نیست! اصلا چرا راه دور بریم همین آقا پرهام برای اینکه از دوستهای پدرش پول بگیره چی گفته بود؟\n1- پدرم بدهی بالا اورده و تو زندانه!\n2- پدرم سکته کرده و تو بیمارستانه!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(496,1,'question-155','اساسا بعضی ها رو باید از بدو تولد تا انتهای زندگیشون، زیر بال و پرشون رو بگیری! همیشه محتاجن و منتظرن بقیه یا بجاشون امتحان بدن یا براشون همسر انتخاب کنن و یا تو امورات زندگی کمکشون کنن و ....بیچاره سروش که دو تا از اینها گیرش افتاده بودن! سروش تو قسمت چهارم میخواست از کجا برای آرش و پرهام لباس بگیره؟\n1- شنبه بازار \n2- بوتیک پشت خونه\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(497,1,'question-156',' درسته مهمون حبیب خداست اما یه وقتهایی هم هست که شاعر مجبور میشه بگه: الا مهمان نگه بر ساعتت کن/ برو فکری برای عادتت کن/ نشستی همچنان مشغول خوردن/ بکن رحمی به جیب خالی من... راستی یادته تو قسمت چهارم سریال سیگنال موجود است، پرویز دکترکه تو خونه اش مهمونه رو مثل چی میدونه؟\n1- دوست خوب\n2- روح سرگردانی که همه جا جلوشه!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(498,1,'question-157',' اینایی که عصبانی میشن و درجا شروع به خود زنی میکنن رو دیدی؟ طرف تا عصبانی میشه، شروع میکنه خودش رو میزنه! آخه یه خورده صبر کن برادر من! مثلا تو همین قسمت چهارم سریال \"سیگنال موجود است\" پرویز که از گم شدن پرهام و کارهاش حسابی عصبانی بود، گفت که برای پیدا کردنش کجا رو باید بگردن؟ خب اینم یه نوع خودزنیه دیگه!\n1- بیمارستان\n2- باغ وحش\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(499,1,'question-158',' اکثر مادر بزرگهای قدیمی دایره المعارف مثل ها و ضرب المثلها بودن! اما یه سری هم هستن که کلا کارشون ساختن ضرب المثل تو مواقع لزومه! مثلا همین آرش خان تو قسمت چهارم سریال برای اینکه کار خودش رو بزرگ جلوه بده، چه ضرب المثلی رو جلوی صبور ساخت؟\n1- آب که بالا بره قورباغه ابو عطا میخونه!\n2- تا خواننده تاپ شود، دل ایجنت اش آب شود!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(500,1,'answer-128','1|۱'),(501,1,'answer-129','۲|2'),(502,1,'answer-130','1|۱'),(503,1,'answer-131','1|۱'),(504,1,'answer-132','۲|2'),(505,1,'answer-133','۲|2'),(506,1,'answer-134','1|۱'),(507,1,'answer-135','۲|2'),(508,1,'answer-136','۲|2'),(509,1,'answer-137','1|۱'),(510,1,'answer-138','1|۱'),(511,1,'answer-139','1|۱'),(512,1,'answer-140','۲|2'),(513,1,'answer-141','1|۱'),(514,1,'answer-142','1|۱'),(515,1,'answer-143','۲|2'),(516,1,'answer-144','۲|2'),(517,1,'answer-145','1|۱'),(518,1,'answer-146','۲|2'),(519,1,'answer-147','۲|2'),(520,1,'answer-148','۲|2'),(521,1,'answer-149','۲|2'),(522,1,'answer-150','1|۱'),(523,1,'answer-151','1|۱'),(524,1,'answer-152','1|۱'),(525,1,'answer-153','1|۱'),(526,1,'answer-154','۲|2'),(527,1,'answer-155','1|۱'),(528,1,'answer-156','۲|2'),(529,1,'answer-157','۲|2'),(530,1,'answer-158','۲|2'),(535,9,'welcome','به سرویس عطسه خوش اومدی! این عطسه ای که ما اینجا داریم یخورده فرق میکنه و وقتی میگیره یه عالمه هدیه بهت میده! اگر از این دسته هستی که با هرعطسه ای که میگیره، کلا اون کار رو بی خیال میشن، خاموش رو به 30568 ارسال کن! هر پیام100 تومن'),(536,9,'before activated','دوست عزیزم تو پیش ما و تو دل ما و سرویس عطسه عضو هستی ! اما اگه میخوای ما رو با رفتنت غمگین کنی،خاموش رو به30568 ارسال کن!'),(537,9,'no question has remained','تا اينجاى بازى خيلى خوب پيش اومدى،منتظر ادامه سوالات ما باشيد.'),(538,9,'de-activation','ای وای! چرا رفتی؟ طاقت عطسه زدن نداشتی؟ باشه! اگه میخوای بری برو اما عطسه رو از یادت نبر! میگن برای بدن خوبه! اگه خواستی برگردی پیش ما عدد 10 به 30568 ارسال کن!'),(539,9,'before de-activation','شما پیش از این از سرویس «عطسه» خارج شده اید، برای عضویت در این سرویس 10 را به 30568 ارسال نمایید'),(540,9,'should be subscriber','دوست عزیز شما در سرویس  سریال \"عطسه\" عضو نیستید.برای عضویت 10 رو به 30568 ارسال کنید، هر پیامک 100 تومان.'),(541,9,'wrong-motivation','عیب نداره. میدونی که اشتباه کردن از امتحان نکردن بهتره! ادامه بده و شانست رو