 یه هنر نمایی عطسه ای! تو آیتم \"جون\" قسمت اول سریال عطسه آقای مددی مربی تیم، وسط بازی سرپرست تیم رو کجا فرستاده بود؟\n1-پیش ناظر داوری\n2-غذا ها رو تحویل بگیره\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1467,9,'answer-9','2|۲'),(1468,9,'question-10','بتهوون: من جز خوبی نشان دیگری كه نمودار برتری باشد، نمی شناسم! تو قسمت اول سریال عطسه، اسم پیجی که کمپین بچه های آفریقا و جملات کسایی مثل کافکا و هیچکاک رو تو خودش داشت چی بود؟\n1- انتهای کبوتر\n2- نیم کلاج\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1469,9,'answer-10','1|۱'),(1470,9,'question-11','بیل گیتس: بهترین كاری كه می كنم این است كه اشتیاقم را با دیگران قسمت می كنم! بریم سراغ اشتیاق خرید صفحه مجازی تو عطسه! یادته تو قسمت اول سریال، قیمت پیج نیم کلاج که آخرین پستش جمله\"یه دنده نباش! دنده یک باش ولی سنگین\"چقدر بود؟\n1- 500هزار تومان\n2- 2میلیون\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1471,9,'answer-11','2|۲'),(1472,9,'question-12','ابن سینا: تجربه بالاتر از علم است! اما امان از تجربه دکتر درفشی عطسه! به گفته دکتر درفشی سریال عطسه جمله \"دلم شیشه دلت سنگه واسه سنگه دلم تنگه\" رو کسی که گوشش گرفته  3 بار تو کدوم گوشش باید بخونه؟\n1- گوش چپش\n2- گوش راستش \nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1473,9,'answer-12','1|۱'),(1474,9,'question-13','فرانسوا ولتر: زر اندوزانی كه برای مال دنیا كیسه دوخته اند، بدانند كه لباس آخرت جیب ندارد! تو بیمارستان قسمت اول سریال عطسه، انداختن بیمار فوت شده تو جوب پشت بیمارستان چقدر هزینه داره؟ \n1- چهارصد هزار تومن\n2- پنجاه هزار تومن\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1475,9,'answer-13','2|۲'),(1476,9,'question-14','لو هولتز: به نظر من همه باید برای یک بار هم که شده طعم شکست را بچشند چون شکست درس های زیادی را به ما می آموزد! بعضی ها هم موفق شدن رو در تعویض کشور میبینن! راستی اسم کارشناس مهاجرتی که دکتر درفشی سریال عطسه معرفی کرد، چی بود؟\n1- آزاده دلیر\n2- کامران دلیر\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1477,9,'answer-14','1|۱'),(1478,9,'question-15','پرمودا باترا:خنده، بزرگترین تقویت کننده‌ی وجود است! دکتر درفشی سریال عطسه برای درمان سنگ کلیه تجویز کرد بیمار از چی استفاده کنه؟ خوبه رفیقش دستگاه \"فرز\" تولید نمیکرد وگرنه تجویز میکرد با اون به جون سنگ بیفته!\n1- روغن کرچک\n2- آب معدنی کامران\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1479,9,'answer-15','2|۲'),(1480,9,'question-16','هوندا: بسیاری از افراد خوب موفقیت را میبینند. برای من موفقیت با تکرار خطا و درون بینی آن بدست می آید! پیج موفق وسط کبوترکه صد تا لایک خورده و آخرین پستش جمله\" باتو که حرف میزنم صدامو صاف میکنم\"، بوده، تو بنگاه سریال عطسه چند بود؟\n1- 5 میلیون\n2- 7 میلیون\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1481,9,'answer-16','2|۲'),(1482,9,'question-17','استفان لیکاک: من بسیار به شانس و اقبال عقیده دارم و متوجه شده ام هرچه بیشتر پشتکار و تلاش کنم، بیشتر شانس می آورم! متقاضی خوانندگی قسمت اول سریال عطسه که پشتکار زیادی داشته، از صدای پرو پیمونش چه موقع استفاده میکرد؟ \n1- تو صحبت با خانومها\n2- تو صحبت با رفقا\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1483,9,'answer-17','2|۲'),(1484,9,'question-18','کریستوفر مارلو: سعادتمند کسی است که به مشکلات و مصیبتهای زندگی لبخند بزند! انشالا که همیشه سلامتی باشه. یادته پلاتین بیست هزار تومانی که تو بیمارستان سریال عطسه میفروختن، ساخت کجا بود؟\n1- تیمور شرقی\n2- ایتالیا\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1485,9,'answer-18','1|۱'),(1486,9,'question-19','کرایسلر: حتی تصمیم درست اگر خیلی دیر گرفته شود، غلط از آب در می آید! نتیجه اخلاقی اینکه پیشگیری بهتر از درمانه! یادته تو قسمت اول سریال عطسه، بیماری که سنگ کیسه صفرا داشت، به تشخیص دکتر درفشی سنگش کجا الان گیر کرده بود؟\n1- زیر پل ورسک\n2- زیر پل کبد\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1487,9,'answer-19','2|۲'),(1488,9,'question-20','دیل کارنگی: روزانه یک کار نیک انجام دهید و پس از انجام دادن یک کار خوب لبخند بزنید و شاهد لبخند دیگران باشید! فضای گل و بلبل، جک داره و کلا تو کار بچه هاییه که میخندنه! اسم این پیج که تو بنگاه سریال عطسه میفروختن، چی بود؟ \n1- نیم کلاج\n2- اول کبوتر\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1489,9,'answer-20','1|۱'),(1490,9,'question-21',' فرانسوا ولتر:عملی اگر كاشتید، عادتی درو خواهید كرد. عادتی اگر كاشتید، اخلاقی درو خواهید كرد. اخلاقی اگر كاشتید، سرنوشتی درو خواهید كرد!  میدونی تهیه کننده سریال عطسه کیه؟ \n1- مهران مدیری\n2- مهدی داوری\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1491,9,'answer-21','2|۲'),(1492,9,'question-22','گراهام بل: هرگز در مسیر پیموده شده گام بر ندارید، زیرا این راه شما را به جایی هدایت می کند که دیگران قبلا رسیده اند! راستی متخصص راهها و مجاری سریال عطسه برای باز کردن مجاری پوسیده و زنگ زده پدر 98 ساله ی کسی که تلفن کرده  بود چه کاری رو تجویز کرد؟ \n1- لوله باز کن بریزه\n2- فنر بزنه\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1493,9,'answer-22','2|۲'),(1494,9,'question-23','فرانسوا ولتر: از روی سوالهای فرد، بهتر از جوابهای او می توانید درباره اش قضاوت كنید! متقاضی استعداد یابی سریال عطسه چرا موسسه مهران مدیری اینا رو انتخاب کرده بود؟ بیچاره چقدر هم با استعداد بود!\n1- چون مادرش گفته بود بره یه چیزی بشه\n2- چون اسم در کرده بود\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1495,9,'answer-23','1|۱'),(1496,9,'question-24','فرانسوا ولتر:اگر بر ناتوان خشمگین شوی، دلیلش این است كه قوی نیستی! داور بازی ای که آقای مددی تو سریال عطسه مربی یکی از تیم ها بود چه سرنوشتی پیدا کرد؟ قابل توجه داورهای زحمت کش...\n1-  تو زمین کشته شد\n2- محروم شد\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1497,9,'answer-24','1|۱'),(1498,9,'question-25','آنتونی رابینز: در جستجوی قهرمان نباشید، یکی از آنها باشید! یادته چشمهای مسافر سریال عطسه که میخواست به کنسرت بره و با خواننده ارتباط چشمی برقرار کنه به گفته خودش غیر از غم دیگه چی داشت؟\n1- عینک\n2- سگ\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1499,9,'answer-25','2|۲'),(1500,9,'question-26','آنتونی رابینز: در دنیایی که پر از افراد تبلیغات چی است، یا خودمان به زندگی خود خط بدهیم، یا دیگران خط خواهند داد! سحر ولد بیگی برای چی تو قسمت اول سریال عطسه اونجوری ضجه میزد؟\n1- بچه فاطما گل سقط شده بود\n2- بچه همسایه شون مرده بود\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1501,9,'answer-26','2|۲'),(1502,9,'question-27','لویی پاستور: آنگه به حقیقت انتقاد می رسی که از خودت انتقاد کنی! سرپرست نویسندگان سریال عطسه کی بود؟ خوب مینویسه خووووووووب!\n1- امیر مهدی ژوله\n2- سیامک انصاری\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1503,9,'answer-27','1|۱'),(1504,9,'question-28','برایان تریسی: اینکه چه کسی باشید و در چه موقعیتی قرار داشته باشید، بر عهده شما و نتیجه انتخابها و تصمیم گیری های خودتان است! صفحه مجازی\" با کمر بپر رو لایک\" رو تو بنگاه سریال عطسه چقدر با بلیط مترو می فروختن؟ \n1- 50 هزار تومان\n2-  100 هزار تومان\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1505,9,'answer-28','1|۱'),(1506,9,'question-29','آنتونی رابینز: آنچه سرنوشت ما را مشخص می کند، شرایط زندگی نیست، بلکه تصمیم های ما است! تو قسمت اول سریال عطسه پیجی که توش از دمنوش های گیاهی و خواص گیاهان و جملات لورکا نوشته که به درد پز دادن تو مهمونی میخوره، اسمش چی بود؟ \n1- وسط کبوتر\n2- انتهای کبوتر\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1507,9,'answer-29','1|۱'),(1508,9,'question-30','دیل کارنگی: اگر میل دارید شما را هم صحبت مطبوعی بدانند گوش کردن را تمرین کنید! متقاضی خوانندگی قسمت اول سریال عطسه که سه نوع صدا داشت، صدای محزونش که به گفته خودش خیلی شله رو چه موقع ای استفاده میکرد؟ \n1- موقع حرف زدن با خانومها\n2- موقع مهمونی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1509,9,'answer-30','1|۱'),(1510,9,'question-31','اندرومیتوس: فقر نتیجه تفکر فقیرانه است اگر ثروت می خواهید نوع تفکر خود را عوض کنید! یادته پسر خانواده موکت پور سریال عطسه، برای چی نرفته بود دانشگاه؟ \n1- کار میکرد و ترک تحصیل کرده بود\n2- پول نداشت تمبر پستی بگیره دفترچه رو پست کنه\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1511,9,'answer-31','2|۲'),(1512,9,'question-32','بندلر:موفقیت جاده ای است که هرکس خودش باید آن را هموار سازد! آقای موکت پور سریال عطسه که افق نگاهی نداشت و به هیچی هم علاقه نداشت، تلفن خونه اش مال کی بود؟\n1- همسایه شون\n2- خودشون\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1513,9,'answer-32','1|۱'),(1514,9,'question-33','افلاطون:كسی كه پس از تربیت روحی به كار تربیت بدنی بپردازد، اگر بخواهد، می‌تواند خود را از رفتن به پزشك، بی‌نیاز سازد، مگر در موارد ضروری! تو بیمارستان سریال عطسه، مشکل پلاتین بیست هزار تومانی چی بود؟\n1- زنگ میزنه\n2- یک ماه بعد ساق پای بیمار رو جر میده\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1515,9,'answer-33','2|۲'),(1516,9,'question-34','گوته:کسي كه داراي عزمي راسخ است، جهان را مطابق ميل خويش عوض مي كند! قبل از اینکه متقاضی خوانندگی سریال عطسه بیاد برای تست، چی کار میکرد؟ به نظرت عزمش راسخه؟\n1- داشت فرش میشست\n2- تخمه جابونی میشکست\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1517,9,'answer-34','2|۲'),(1518,9,'question-35','افلاطون: فن پزشكی برای این هدف بنا شده كه آنچه برای بدن سودمند است، فراهم كند! اما نه تو بیمارستان عطسه! تو بیمارستان سریال عطسه آمپولی که برای درمان کبد از کامبوج اوردن چه مشکلی داشت؟\n1- گرون بود!\n2- بعد از 48 ساعت کل دستگاه گوارش رو دفع میکنه!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1519,9,'answer-35','2|۲'),(1520,9,'question-36','لئوناردو داوینچی: سرشت آدمهای خوب، گرایش به دانستن است! مشاور بنگاه صفحه مجازی فروش سریال عطسه گفت آخرین پست پیج \"با کمر بپر رو لایک \" چی بوده؟\n1- با تو که حرف میزنم، صدامو صاف میکنم!\n2- اگه واسه یک ساعت جای بادامکی بودی چی کار میکردی!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1521,9,'answer-36','2|۲'),(1522,9,'question-37','فرانسوا ولتر: خطاهای بشری اول رهگذر، بعد میهمان و چندی نمی گذرد كه صاحبخانه می شوند! اینم از راننده قسمت اول سریال عطسه که خطا کرده اما هزار تا دلیل اورد تا جریمه نشه! آخریش چی بود؟\n1- شامپانزه ست\n2- مادر بزرگش فوت کرده\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1523,9,'answer-37','1|۱'),(1524,9,'question-38',' دکتر درفشی سریال عطسه برای شکستن سنگ کیسه صفرای مریض استفاده از چه چیزی رو تجویز کرد؟ جدا ایندفعه شاعر میگه: طبیب ما یکی نامهربانست / که گویی هیچ رنجوری ندارد!\n1- کفش سوسن \n2- آب معدنی کامران\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1525,9,'answer-38','1|۱'),(1526,9,'question-39','پیج انتهای کبوتر تو بنگاه سریال عطسه، قیمت تموم شده اش چقدر بود؟ راستی دانشمندان به تازگی دریافته اند که هفته ای دو بار قطعی اینترنت در کنار خوردن ماهی برای سلامتی وجلوگیری از ابتلابه زخم بستر مفیده!!!\n1- 21 میلیون\n2- 11 میلیون\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1527,9,'answer-39','2|۲'),(1528,9,'question-40','فرانسوا ولتر: آنهایی كه در زبان بازی مهارت به خرج می دهند، بیشتر، نیت پلید را در قلب خود می پرورانند! اینم از دکتر قلابی قسمت اول سریال عطسه... دکتر امیر ارسلان درفشی، تخصص های خودش رو از کدوم کشور گرفته بود؟ \n1- مجارستان\n2- ایتالیا\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1529,9,'answer-40','1|۱'),(1530,9,'question-41','لئوناردو داوینچی: دشواری ها نمی توانند مرا شكست دهند. هر مشكلی در برابر اراده ی بی چون و چرای من تسلیم می شود! تو بیمارستان سریال عطسه، خون داخلی رو کیسه ای چند میفروشن؟\n1- هفتصد هزار تومن\n2- بیست میلیون تومان\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1531,9,'answer-41','1|۱'),(1532,9,'question-42','آناتول فرانس: خنده طبیعی، فریاد موتور نیرومند بدن است! تصویر ناصر نصیر تو پیج \"با کمر بپر رو لایک\" اگه کامنت بذاری چی کار میکنه؟ البته بازم خوبه که به غیر از اینکه یه صفحه باز کنه و هی بگه \"شما برنده شدید\" کار دیگه ای میکنه!\n1- گریه میکنه\n2- می خنده\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1533,9,'answer-42','2|۲'),(1534,9,'question-43','ابن سینا: کسی که به تمرینهای بدنی میپردازد به هیچپ دارویی نیاز ندارد ،درمان او در جنبش و حرکت است! صحبت از ورزش شد، راستی یادته نقش آقای مددی مربی فوتبال رو تو قسمت اول سریال عطسه کی بازی میکرد؟\n1- جواد رضویان\n2- مهران مدیری\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1535,9,'answer-43','2|۲'),(1536,9,'question-44','فردریش شیلر: امید با مرگ هم به گور نمی رود! توآیتم سلفی با مرحوم قسمت دوم سریال عطسه کدوم شاخصه ازکسی که فوت کرده بود برای یکی از آشناهاش که نقشش رو هدایتی بازی میکرد، خیلی مهم بود؟ این خصوصیت رو ساعد سه بار تکرار کرد!\n1-از بچه گی حرف میزده!\n2-گلزن بوده!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1537,9,'answer-44','1|۱'),(1538,9,'question-45','افلاطون: دانشی که همراه با اجبار کسب شود در ذهن نمی‌ماند! سخنران آیتم لوس بازی قسمت دوم سریال عطسه گفت چی باعث میشه که بچه ها بخوان با آژانس برن مدرسه؟\n1- فیلم های گروگانگیری در مدرسه\n2- فیلم های خارجی که بچه ها رو تو راه مدرسه می دزدن!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1539,9,'answer-45','2|۲'),(1540,9,'question-46','ويليام شکسپير:کودکان هديه خدا هستند! سخنران آیتم لوس بازی قسمت دوم سریال عطسه گفت که در جواب تنبیه پدر و مادر که به بچه های امروزی میگن:\" برو تو اتاقت تا یه ساعت دیگه بیرون نیا\"، بچه ها چی میگن؟\n1- ببخشید\n2- اول برام یه خونه دو خوابه بخر تا برم تو اتاق\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1541,9,'answer-46','2|۲'),(1542,9,'question-47','آنتونی رابینز: در زمانهای تصمیم گیری است که سرنوشت ما رقم زده می شود! یادته  تو آیتم سلفی با مرحوم قسمت دوم سریال عطسه کدوم کار بازیکن متوفی باعث فوت کردنش شده بود؟\n1- سرعت زیاد \n2- تو رانندگی برای کامیونی که از روبرو ش می اومده 50- 50 تصمیم گیری کرده!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1543,9,'answer-47','2|۲'),(1544,9,'question-48',' \nآلبرت انیشتین موقع مرگ گفته: من کارم را همین جا به پایان رساندم! یادته پیرمرد آیتم وصیت نامه مجازی قسمت دوم سریال عطسه به پسرش وصیت کرد به چه کسانی تو صفحه های مجازی اعتماد نکنه؟\n1-کسی که از خودش تمام قد عکس نذاشته!\n2-کسی که عکس نذاشته!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1545,9,'answer-48','1|۱'),(1546,9,'question-49','گابریل گارسیا مارکز: مرگ از پیری نمی آید، بلکه با فراموشی می آید! پیرمردی که داشت فوت میکرد تو آیتم وصیت مجازی قسمت دوم سریال عطسه، برای چی استاتوسش رو تو صفحه مجازیش هنوز نفرستاده بود؟\n1- فراموش کرده بود!\n2- میخواست زمانی بفرسته که لایک خورش خوب باشه!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1547,9,'answer-49','2|۲'),(1548,9,'question-50','آنتوان دوسنت اگزوپری: حتی اگر آدم دم مرگ هم باشد داشتن یک دوست، عالی است!\nیادته پیرمرد آیتم وصیت مجازی تو قسمت دوم سریال عطسه برای چی به پسرش گفت که تو صفحه مجازیش ننویسه که فوت کرده؟\n1- چون خودش رو جوون معرفی کرده بوده!\n2- چون باعث دلشکستگی بقیه میشه!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1549,9,'answer-50','1|۱'),(1550,9,'question-51','سقراط: درون خود را زیبا کنید، تا شخصیت درونی و بیرونی شما یکی شود! ورزشکاری که تو یکی از آیتمهای قسمت دوم سریال عطسه فوت کرده بود به گفته دوستش، موقع زدن پنالتی ها چه استراتژی ای داشت؟\n1- 50 - 50 میکرده!\n2- دروازه بان رو فریب میداده!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1551,9,'answer-51','1|۱'),(1552,9,'question-52','حضرت محمد (ص): حرمت همسایه بر عهده انسان مانند احترام مادرش می باشد! تو قسمت دوم سریال عطسه، نصرالله رادش که خودش رو همسایه معرفی کرده بود، برای گرفتن میخ و بقیه چیزها ساعت چند رفته بود دم خونه همسایه اش؟\n1- ساعت 4 صبح\n2- ساعت 8 شب\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1553,9,'answer-52','1|۱'),(1554,9,'question-53','دكارت: رقابت تا زماني پسنديده است كه كار را به حسادت نكشاند! تو آیتم وصیت نامه مجازی قسمت دوم سریال عطسه پیرمرد به پسرش گفت نصف دنبال کننده های نوشته های عموش تو صفحه مجازیش چه کسانی هستن؟\n1- دوستهاش\n2- کارمندهای عموش\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1555,9,'answer-53','2|۲'),(1556,9,'question-54','چارلی چاپلین: روزی که بدون خنده سپری شود، یک روز تلف شده است! پیرمرد آیتم وصیت نامه مجازی قسمت دوم سریال عطسه به پسرش سفارش کرد که اسم عکس سلفی ای که با پسرش گرفت رو چی بذاره؟\n1- بیچاره بابام\n2- من و آقام در حال مرگ\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1557,9,'answer-54','2|۲'),(1558,9,'question-55','فردوسي: به نيكي گراي و ميازار كس/ ره رستگاري همين است و بس! کارمند بانک آیتم \"بشمار کم نباشه\" قسمت دوم سریال عطسه به جای پول به مشتری پیشنهاد کرد چه چیزی ببره؟\n1- برنج دم سیاه\n2- دو نیسان برنج دونه بلند هندی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1559,9,'answer-55','2|۲'),(1560,9,'question-56','موريس مترلينگ: آدمي ساخته ي افكار خويش است، فردا همان خواهد شد كه امروز مي انديشيده است! آیتم \"یادش به خیر قدیما\" ی قسمت دوم سریال عطسه که دو تا پیرمردی داشتن روزگارشون رو با گذشته مقایسه میکردن، مربوط به چه سالی بود؟\n1- 1440\n2- 1410\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1561,9,'answer-56','2|۲'),(1562,9,'question-57','امام علی (ع): غصه نیمی از پیری است! محمود تو آیتم \" یادش به خیر قدیما\" ی قسمت دوم سریال عطسه از نوه اش چه گله ای داشت؟ امید که هیچ وقت صله رحم هامون مجازی نشه! \n1- صفحه مجازیش رو لایک نمیکنه!\n2- صفحه مجازیش رو مسدود کرده!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1563,9,'answer-57','1|۱'),(1564,9,'question-58','دکتر علی شریتی: نامم را پدرم انتخاب کرد و نام خانوادگیم را یکی از اجدام، دیگر بس است؛ راهم را خود انتخاب خواهم کرد! میتونی بگی ورزشکار فوت شده تو یکی از آیتمهای قسمت دوم سریال عطسه به نظر خانمی که مصاحبه کرد، زمین رو به چی تبدیل میکرد؟\n1-گلستان\n2-غوغا کده\nلطفا عددگزینه مورد نظر خود را ارسال نماییدمثال: ت1 یا t1'),(1565,9,'answer-58','2|۲'),(1566,9,'question-59','ارسطو: عاقل همه ي آنچه را كه مي داند نمي گويد، ولي آنچه را كه مي گويد مي داند! سخنران آیتم لوس بازی قسمت دوم سریال عطسه گفت تو بچگی هاش سرفه پدرش چه حکمی براش داشته؟\n1- حکم صبح به خیر و پول تو جیبی\n2- حکم شام و شب به خیر\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1567,9,'answer-59','1|۱'),(1568,9,'question-60','تاگور: آسمان برای گرفتن ماه تله نمی گذارد، آزادی خود ماه است که او را پایبند می کند! شاعر اینجا میگه: عشق پیری گر بجنبد سر به لایک زدن، زند! یادته پیرمرد آیتم وصیت نامه مجازی به پسرش وصیت کرد که صفحه مجازی کدوم آی دی رو لایک کنه؟\n1-شیطونک\n2-برادرش \nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1569,9,'answer-60','1|۱'),(1570,9,'question-61','روسو: در مقابل هر چیز می توان مقاومت کرد، جز در مقابل نیکی! وقتی کاکتوس میشه از محصولات فرهنگی، بانک هم میشه سوپر مارکت دیگه! تو قسمت دوم سریال عطسه متصدی بانک در ازای پول چک مشتری گفت غیر از برنج چی داره که میتونه به مشتری بده؟\n1-خیار شور\n2-ترشی لیته\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1571,9,'answer-61','1|۱'),(1572,9,'question-62','شوپنهاور: اولین درسی که والدین باید به فرزندان خود بیاموزند، صداقت است! سخنران تو آیتم لوس بازی سریال عطسه گفت با هر ماچ بچه امروزی حتی اگر با کمربند به جونش بیفتی، بچه میگه چی میخواد؟\n1- ایکس باکس\n2- آتاری\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1573,9,'answer-62','1|۱'),(1574,9,'question-63','دهخدا: مشورت با هزار کس کن و راز خود به يکي مگو! کلید صندوق اسرار مادر بزرگ و پدر بزرگها کجا و رمز ورورد به صفحه مجازی کجا! تو آیتم وصیت مجازی قسمت دوم سریال عطسه، پیرمردی که داشت فوت میکرد رمز ورود به صفحه مجازیش رو کجا گذاشته بود؟\n1-بالای کمد\n2-رو میز \nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1575,9,'answer-63','1|۱'),(1576,9,'question-64','استفان تسوایک: هیچ شهرتی پایدارتر از نیک نامی نیست! بعضی ها معروفن؛ بعضی ها هم وقتی فوت میکنن معروف میشن؛ مثل ونگوگ!! بزرگمرد ورزشکاری که تو یکی از آیتم های قسمت دوم سریال عطسه فوت کرده بود، به نظر مردم اسطوره چی بود؟\n1- اسطوره حرف زدن\n2- اسطوره اخلاق\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1577,9,'answer-64','2|۲'),(1578,9,'question-65','مارک تواین: بسیار چیزهای کوچک، به واسطه تبلیغات صحیح، بزرگ شدند! خب اینم یه نوع تبلیغاته دیگه که در کنارش فیلمی آموزشی هم پخش میشه! آشپز برنامه آموزش آشپزی قسمت دوم سریال عطسه آخر برنامه گفت به امید دیدار بیننده هاش در کجا؟\n1-بازار\n2-نمایشگاه اتومبیل\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1579,9,'answer-65','2|۲'),(1580,9,'question-66','فرانسیس بیکن: انسان دانا به جاي آنكه در انتظار يك فرصت خوب بنشيند، آنرا به وجود مي آورد! صف نفت و.. تو گذشته خیلی هامون خاطره های قشنگی داره! تو آیتم \"آخر صف کیه\" قسمت دوم سریال عطسه شایع شده بود که صف آخرش قراره چی بشه؟\n1-یارانه میدن\n2- میرسه به مجیدیه\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1581,9,'answer-66','2|۲'),(1582,9,'question-67','ابو علی سینا: اعتدال در غذا را نگه دارید تا سلامتی از شما دور نشود! مثلی هست که میگه نمیدونم چی چی هفت دست، شام و ناهار، املت! خانمی که تو آیتم تب اسپانسر سریال عطسه آموزش آشپزی میداد گفت اجاق گازش چه مارکیه؟\n1- اجاق پژمان\n2- اجاق گاز فر دار استیل پلان\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1583,9,'answer-67','2|۲'),(1584,9,'question-68','سنت اگزوپری: تنها بچه ها هستند كه مي دانند پي چه مي گردند! محقق ها میگن با ماساژدادن نوزاد ها، اونها احساس عشق و امنیت میکنن! سخنران آیتم لوس بازی گفت در گذشته بچه هاشون رو هر چند وقت یکبار ماچ میکردن؟\n1- فقط تو روز تولدشون\n2- سال تحویل به سال تحویل\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1585,9,'answer-68','2|۲'),(1586,9,'question-69','بوعلی سینا: نشان دوست نیکو آن است که خطای تو بپوشد و رازت را آشکار نکند! دوستهای فرد فوت شده برای شادی روحش در قسمت دوم سریال عطسه چی کار کردن؟\n1-دسته جمعی سلفی گرفتن\n2-یک دقیقه سکوت کردن\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1587,9,'answer-69','1|۱'),(1588,9,'question-70','هنری فورد: کسی که برای صرفه جویی در هزینه، تبلیغات خود را متوقف کند مانند کسیست که برای صرفه جویی در وقت ساعتش را متوقف کند! اینم از تبلیغات به سبک عطسه! اسم ماهیتابه آشپز قسمت دوم سریال عطسه چی بود؟\n1- ماهیتابه ناصرپور\n2- ماهیتابه پلاستیک\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1589,9,'answer-70','1|۱'),(1590,9,'question-71','الکساندر دوماس فیلس: نه پول را خیلی عزیز بدانید و نه بی ارزش؛ پول خدمتکار خوبی است ولی رئیس بسیار بدی است! تو آیتم \"بشمار کم نباشه\" قسمت دوم سریال عطسه مشتری بانک چک چند تومنی رو میخواست نقد کنه؟\n1- 60 میلیونی\n2- 10 میلیونی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1591,9,'answer-71','1|۱'),(1592,9,'question-72','ایزاک آسیموف: برای چرخاندن چرخ یک تجارت، به چیزی بیش از سرمایه نیاز است. شما به پخت (پ.خ.ت) نیاز دارید: پویایی، خلاقیت و تبلیغات! و حالا پ.خ.ت. به سبک عطسه! اسم تخته کار آشپزی تو آیتم تب اسپانسر سریال عطسه چی بود؟\n1- ارژنگ نما\n2- تخته آشپزخونه تخت\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1593,9,'answer-72','1|۱'),(1594,9,'question-73','رومن رولان: قهرمان آن کسی است که آن چیزی را که از دستش برمی‏آید انجام بدهد، زیرا دیگران همین کار را هم نمی‏کنند! پیرمرد آیتم وصیت مجازی قسمت دوم سریال عطسه چه کسی رو تو صفحه مجازیش بلاک کرده بود؟\n1-برادرش رو\n2-خواهرش رو\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1595,9,'answer-73','2|۲'),(1596,9,'question-74','کتاب مکارم الاخلاق: شستن دست قبل از غذا، فقر را و پس از غذا، غم و اندوه را برطرف مى‏ كند و به چشم سلامتى مى ‏بخشد! آشپز آیتم تب اسپانسر سریال عطسه گفت اگه پوست تخم مرغ تو املت افتاد با چی باید برش داشت؟\n1- کفگیر\n2- ناخن دست\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1597,9,'answer-74','2|۲'),(1598,9,'question-75','پل کافمن: کودکان، خبره های راستین‌اند. آنچه برای آنها گرانبهاست، بهایی ندارد، تنها ارزش دارد! یاد بازی های بچگی به خیر! سخنران آیتم لوس بازی قسمت دوم سریال عطسه گفت در بچگی تو راه مدرسه چه بازی ای میکرده؟\n1- خر پلیس\n2- قایم باشک\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1599,9,'answer-75','1|۱'),(1600,9,'question-76','کلوین کولیج: تبلیغات، جان یک تجارت است! اینم یه نوع دیگه از تبلیغات به سبک عطسه! خانم آشپز قسمت دوم سریال عطسه، گفت املتی که درست میکنه برای کدوم کشوره؟\n1- جنوب اسپانیا\n2- شمال استرالیا\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1601,9,'answer-76','1|۱'),(1602,9,'question-77','جان ای ریچاردز: خلاقیت بدون استراتژی را “هنر” مینامند. خلاقیت با استراتژی را “تبلیغات” گویند! اینم تبلیغات از نوع عطسه و اسپانسرهاش! آشپز قسمت دوم سریال عطسه گفت برنامه 5 دقیقه ای آشپزیش چند تا اسپانسر داره؟\n1- 85 اسپانسر\n2- 5 اسپانسر\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1603,9,'answer-77','1|۱'),(1604,9,'question-78','حضرت محمد(ص): پیش از خانه خریدن، همسایه را بجویید و پیش از سفر کردن، رفیق را بیابید! آخ امان از دست بعضی از این همسایه ها که با زمان استراحت آدم غریبه اند! نصرالله رادش تو قسمت دوم سریال عطسه، میخواست میخ رو با چی بکوبه به دیوار خونه؟\n1- گوشت کوب\n2- سنگ\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1605,9,'answer-78','2|۲'),(1606,9,'question-79','کلوین کولیج: تقاضای جمعی، تقریباً بطور تمام و کمال بخاطر توسعه تبلیغات به جود آمده است! اینم یه تبلیغات دیگه به سبک عطسه! اسم کفشهایی که آشپز قسمت دوم سریال عطسه تو آیتم تب اسپانسر تبلیغ میکرد، چی بود؟\n1- کتونی\n2- سورن\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1607,9,'answer-79','2|۲'),(1608,9,'question-80','ویل راجرز: تبلیغات هنر متقاعد کردن مردم برای خرج کردن پول هایشان برای چیزی که نیازی به آنها ندارند است! یادته سر آشپز قسمت دوم سریال عطسه گفت اسم گوجه فرنگی ای که مصرف میکنه چیه؟\n1- گوجه ربی\n2- گوجه برمک\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1609,9,'answer-80','2|۲'),(1610,9,'question-81','کتاب غرر الحکم: رسیدگى به همسایگان و سر و سامان دادن به حال و وضع آنان از جوانمردى است! یادته همسایه منصوره خانم تو قسمت سوم سریال عطسه چه مشکلی براش پیش اومده بود که اومده بود دم خونه اش؟\n1- غذاش سوخته بود!\n2- خونه اش آتیش گرفته بود!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1611,9,'answer-81','2|۲'),(1612,9,'question-82','جرج برنارد شاو: مراقب باشید چیزهایی را که دوست دارید بدست‌آورید وگرنه ناچار خواهید بود چیزهایی را که دارید دوست داشته ‌باشید! یادته آقای مددی مربی تیم فوتبال قسمت سوم عطسه گفت بازیکنهای تیم مقابل رو شب قبل چه غذایی بهشون داده بود؟\n1- سلطانی\n2- جوجه کباب\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1613,9,'answer-82','1|۱'),(1614,9,'question-83','جان ماكسول:اگر خود به خويشتن اعتماد نداريد، ديگران هم به شما اعتماد نخواهند كرد! تو آیتم کافه فال، فالگیر به خانومه گفت با بالا بردن چه چیزی میتونه تاثیر عمیقی تو زندگی بقیه بذاره؟ \n1- دستش\n2- اعتماد به نفسش\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1615,9,'answer-83','2|۲'),(1616,9,'question-84','آنتوني رابينز: به هيچ دسته كليدي اعتماد نكنيد بلكه كليد سازي را فرا بگيريد! امان از دست اینایی که نمک میخورن اما گل نمیخورن! یادته تو قسمت سوم سریال عطسه چه کسی تو بازی، با آجر دنبال دروازه بان تیم مقابل تیم آقای مددی میکرده؟\n1- دستیار آقای مددی\n2- داور\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1617,9,'answer-84','1|۱'),(1618,9,'question-85','سقراط: در دوستی درنگ کن، اما وقتی دوست شدی ثابت قدم و پایدار باش! خصوصا اگه دوستت منصوره خانم سریال عطسه باشه! مثلا همین یادته به همسایه اش گفت با ارسال عدد 6 به پنجاه هزار بدون صفر چه پیامکی رو دریافت میکنه؟\n1- 107 روش برای دوست یابی\n2- 50 نکات آشپزی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1619,9,'answer-85','1|۱'),(1620,9,'question-86','اسپارت: اگر زندگی با تو سر ناسازگاری دارد تو با او سازش کن! تو قسمت سوم سریال عطسه گردویی که به قیمت 47550 تومن بود  با چه چیز صاحب تلفن مشابه بود؟ \n1- شماره پلاک ماشینش\n2- شماره شناسنامه اش\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1621,9,'answer-86','1|۱'),(1622,9,'question-87','ابو علی سینا: نشان دوست نیکو آنست که خطای تو بپوشد و تو را پند دهد و رازت را آشکار نکند! وقتی بازیکن تیم مقابل، دروازه بان تیم آقای مددی رو تو قسمت سوم سریال عطسه دریبل کرده بود، چه کسی نذاشته توپ گل بشه؟ اینم یه جور دوستیه دیگه!\n1- خود آقای مددی\n2- داور\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1623,9,'answer-87','2|۲'),(1624,9,'question-88','برووس لی: از وقتتان حد اکثر استفاده را ببرید! البته نه مثل راننده عطسه! راستی راننده تاکسی تو قسمت سوم سریال عطسه گفت جریمه چراغ قرمز هایی که رد کرده بود چقدره؟\n1- چهل و پنج هزار تومان\n2- صد هزار تومن\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1625,9,'answer-88','2|۲'),(1626,9,'question-89','سن رست: خونسرد بمانید تا بر همه کس تسلط داشته باشید! یادته منصوره به همسایه اش گفت برای گرفتن پیامک 10 روش برای نجات دادن بچه ای که پشت در مونده چه کار کنه؟ چقدر خونسرد بود ها! نه!\n1- عدد 1 رو به 1500 ارسال کنه!\n2- عدد 9 رو به 6500 ارسال کنه!\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1627,9,'answer-89','2|۲'),(1628,9,'question-90','حسین بهزاد: برای رسیدن به هدف، اراده، توان و صبر نیاز است!\nمیگن یه زمانی مدرک داشتن 70 نمره مثبت تو خواستگاری به آدم میداد...تو قسمت سوم سریال عطسه مادر خانواده ای که مهران غفوریان به خواستگاری دخترشون رفته بود چه مدرکی داشت؟\n1- دکترای قدرت\n2- لیسانس \nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1629,9,'answer-90','1|۱'),(1630,9,'question-91','برایان تریسی: آدم های موفق، همیشه به دنبال فرصت هایی برای کمک به دیگران هستند! مثل این پسر همسایه که تو زندگی خیلی ها نقش مهمی داره! از صف نون ایستادن بگیر تا آچار فرانسه کل ساختمون اسم پسر منصوره تو قسمت سوم سریال عطسه، چی بود؟\n1- آرش\n2- البرز\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1631,9,'answer-91','1|۱'),(1632,9,'question-92','ژول رومن: سازگار بودن معنیش این است که با ناسازگاری دیگران سازگار باشیم! تو قسمت سوم سریال عطسه کسی که اومده بود بلیط تور مسافرتی بگیره گفت برای چی دوست نداره بره پاریس؟ با هر جایی سازگار بودها! \n1- چون فرهنگشون با ما همخونی نداره!\n2- چون هزینه اش گرونه\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1633,9,'answer-92','1|۱'),(1634,9,'question-93','امرسون: اگر استقامت داشته باشی و اراده کنی، بی شک موفق هستی!\nیادته مسافر چک رو برای کرایه اش با چه مبلغی کشید؟ الحق و الانصاف یه خسته نباشید به قشر با انصاف تاکسیران کشورمون که استقامتشون توی این ترافیک ستودنیه!\n1- 450 هزار تومان\n2-یک میلیون تومان\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1635,9,'answer-93','1|۱'),(1636,9,'question-94','جان ماکسول: در دل هر موفقیت، تحمل سختی و ناملایمات نیز وجود دارد! تو قسمت سوم سریال عطسه، نیمه دوم تیم آقای مددی بازی رو چند نفره شروع کرده بود؟ تو اون وانفسا که مربی نمیتونه تعداد بازیکنهاش رو بشمره! \n1- 16 نفره\n2- 18 نفره\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1637,9,'answer-94','1|۱'),(1638,9,'question-95','شکسپیر: صبر عبارت است از حفظ آرامش برای رسیدن به نتیجه! تو قسمت سوم سریال عطسه پدر خانواده ای که مهران غفوریان به خواستگاری دخترشون رفته بود، چه مدرکی داشت؟ من که میگم مهران باید یه خورده بیشتر صبر کنه!\n1- دکترای قدرت\n2- دکترای اورولوژی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1639,9,'answer-95','2|۲'),(1640,9,'question-96','ماندلا: موفقیت پیش رفتن است نه به یک نقطه پایان رسیدن! تو قسمت سوم سریال عطسه خونه هایی که سازمان دکتر جهان پیوند برای جوونهای اقشار کم درآمد در نظر گرفته بودن، چند سال ساخت بود؟\n1- نو ساز\n2- 23 سال ساخت\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1641,9,'answer-96','2|۲'),(1642,9,'question-97','ماندلا: مهم این نیست که زیبا باشی زیبایی در این است که مهم باشی حتی برای یکنفر! یادته تو آیتمی که زن و شوهریکه داشتن از هم طلاق میگرفتن تو قسمت سوم سریال عطسه، ماشین پورشه به کی رسید؟\n1- خانم\n2- آقا\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1643,9,'answer-97','2|۲'),(1644,9,'question-98','رابیندرانات تاگور: اگر انتظار و توقع نداشته باشی همه دوست تو اند! راستی یادته آپارتمان قیطریه که زن و شوهری که داشتن از هم طلاق میگرفتن تو قسمت سوم سریال عطسه به کی رسید؟\n1- به خانم\n2- به آقا\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1645,9,'answer-98','1|۱'),(1646,9,'question-99','گوته: زیبایی ناپایدار و فضیلت جاودانه است! معماری خونه هایی که سازمان دکتر جهان پیوند قسمت سوم سریال عطسه به جوونهای کم درآمد میده، به سبک کدوم کشور بوده؟\n1- اسپانیایی\n2- بنگلادشی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1647,9,'answer-99','1|۱'),(1648,9,'question-100','آنتوان چخوف: انسان همان چیزی است که باور دارد! یادته تو قسمت سوم سریال عطسه به نوه سه ساله خانواده ای که مهران غفوریان به خواستگاری دخترشون رفته بود، پدرکادو تولد چی داده بود؟\n1- خونه \n2- مدرک فوق لیسانس\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1649,9,'answer-100','2|۲'),(1650,9,'question-101','محمدعلی کلی: کسی که شهامت قبول خطر نداشته باشد در زندگی به مقصود نخواهد رسید! انواع شهامت های آقای مددی تو قسمت سوم سریال عطسه رو که یادته! به گفته آقای مددی، داور بازی مسابقه فوتبال زمین رو دوست داشته با چی مشخص کنه؟\n1- سکه طلا\n2- سکه پونصد تومنی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1651,9,'answer-101','1|۱'),(1652,9,'question-102','وين داير: آنچه هستيد نتيجه فكر شما است! مورد داشتیم که کودک درونش از همون اول پیر بوده الان تو هفتاد سالگی میره زنگ خونه همسایه رو میزنه فرار میکنه! راستی نقش کودک درون سیامک انصاری رو تو قسمت سوم سریال عطسه کی بازی میکرد؟\n1- جواد رضویان\n2- مهران غفوریان\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1653,9,'answer-102','2|۲'),(1654,9,'question-103','آلبرت اينشتين: تا زماني‌که حتي يک کودک ناخرسند روي زمين وجود دارد، هيچ کشف و پيشرفت جدي براي بشر وجود نخواهد داشت! یادته پسر گروگان گرفته شده صاحب تلفن رو در مقابل چه مبلغی میخواستن آزاد کنن؟ \n1- مبلغی معادل شماره تلفنش\n2- مبلغی معادل شماره کارت ملیش\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1655,9,'answer-103','2|۲'),(1656,9,'question-104','بیل کازبی: من واقعاً فرمول دقیقی برای موفقیت نمی شناسم ولی فرمول شکست را به خوبی می دانم سعی کنید همه را راضی نگه دارید! شلوار و کفشی که مسافر برای راضی نگه داشتن راننده قسمت سوم سریال بهش داد ساخت کجا بود؟\n1- ایتالیا\n2- ویتنام\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1657,9,'answer-104','1|۱'),(1658,9,'question-105','بتهوون: اگر می خواهی خوشبخت باشی برای خوشبختی دیگران بكوش زیرا آن شادی كه ما به دیگران می دهیم به دل ما بر می گردد! دکتر قسمت سوم سریال عطسه گفت قیمت مسکن هایی که برای جوونها در قیطریه و جردن و کامرانیه درست کردن چقدره؟\n1- متری 5 میلیون\n2- متری 20 میلیون\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1659,9,'answer-105','2|۲'),(1660,9,'question-106','آلان چارمر: هیجانات همیشه شادی برانگیز هستند، اما هیچ شادی نیست که بدون هیجان باشد! اساسا فوتبال تو سریال عطسه کاملا مهربانانه دنبال میشه! یادته آقای مددی مربی تیم فوتبال قسمت سوم سریال عطسه به ناظر بازی چی داده بود؟\n1- سکه طلا\n2- پول چایی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1661,9,'answer-106','2|۲'),(1662,9,'question-107','بالزاک: در دنیا دو تصویر برای من زیباست، تصویر گل و تصویر مادرم!  راننده تاکسی تو قسمت سوم سریال عطسه برای اینکه مسافر رو سریعتر به مادرش برسونه، چندتا چراغ قرمز رد کرده بود؟\n1- دو تا\n2- چهار تا\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1663,9,'answer-107','1|۱'),(1664,9,'question-108','رافائل: یک بوسه مادر من بود که مرا نقاش کرد! یادته راننده تاکسی قسمت سوم سریال عطسه گفت اگر مادرش زنده بود حاضر بود چند تا چراغ قرمز رو برای دیدن مادرش رد بکنه؟\n1- ده تا\n2- صد تا\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1665,9,'answer-108','2|۲'),(1666,9,'question-109','فرانسیس بیکن: دانش به تنهائی یک قدرت است! تو قسمت سوم سریال عطسه پسر خانواده ای که مهران غفوریان به خواستگاری دخترشون رفته بود، مدرک پی اچ دی گرد شناسیش رو از کدوم دانشگاه گرفته بود؟\n1- ماگنولیا کالج\n2- آکسفورد\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1667,9,'answer-109','1|۱'),(1668,9,'question-110','روسو: می توان حقیقتی را دوست نداشت، اما نمی توان منکر آن شد! دکتر جهان پیوند قسمت سوم سریال عطسه گفت بزرگترین مشکل ازدواج نکردن جوونها چیه؟\n1- مسکن\n2- کار\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1669,9,'answer-110','1|۱'),(1670,9,'question-111','موریس مترلینگ: آدمی ساخته افکار خویش است، فردا همان خواهد شد که امروز می اندیشیده است! تو قسمت سوم سریال عطسه اسم مدیر کل امور وصولات پیوندی اداره کل ازدواج و طلاق ورزش و جوانان چی بود؟\n1- سیامک انصاری\n2- دکتر مراد جهان پیوند\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1671,9,'answer-111','2|۲'),(1672,9,'question-112',' آنتونی رابینز: بخاطر داشته باشید که حواس خود را به هر چه متوجه کنیم همان را به دست می آوریم! سازمان دکتر جهان پیوند به جوونهایی که خونه های تو مناطق قیطریه و جردن و ... رو بخرن چی هدیه میده؟\n1- ساعت\n2- پیانو\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.مثال: ت1 یا t1'),(1673,9,'answer-112','1|۱'),(1674,1,'question-159','آنتوني رابينز: مهم نيست كه چه كار كرده‌ايد، مهم اين است كه خود را چگونه ساخته‌ايد! تو قسمت 5 سریال سیگنال سروش برای معرفی و کارهای تبلیغاتی به پرهام گفت چقدر باید پول جور کنه؟\n1- 200 هزار دلار\n2- 20 هزار یورو\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1675,1,'question-160','اسپنسر جانسون: انسانهاي واقعاً كامياب كساني هستند كه آنچه را كه به آن نياز دارند دنبال مي كنند! آرش به صبور گفت در چه صورت پرویز پول رو پرداخت میکنه؟\n1- پرهام رو ببینه\n2- پای جون یا خون پرهام وسط باشه\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1676,1,'question-161','سعدی: هر كس خود را نصيحت نكند، به نصيحت ديگران محتاج است! تو قسمت 5 سریال سیگنال موجود است، فرمان به صبور چند روز مهلت داد تا بدهیش رو بده؟\n1- 1 روز\n2- 4 روز\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1677,1,'question-162','ولتر: سخت است آزاد كردن نادان هايي كه در زنجیرهای نادانی خود گرفتارند! تو قسمت 5 سریال سیگنال آرش گفت پشت هر خواننده موفق چه چیزیه؟\n1- ایجنت خفن\n2- دوستهای با وفا\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1678,1,'question-163','واسوانی: ذهن، همچون ساعتي پيوسته در حال كار كردن است و بايد هر روز با انديشه هاي خوب آن را كوك كرد! دفعه اول که آرش صبور رو از خواب بیدار کرد، چی ازش میخواست؟\n1-بالش مناسب\n2- دی وی دی پلیر\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1679,1,'question-164','جك كانفيلد: اگر بخواهيد در قبال مردم ديگر كامروا شويد، بايد در هنر سپاسگزاري مهارت پيدا كنيد! تو قسمت 5 سریال سیگنال آرش به سروش گفت که چقدر پورسانت میخواست؟\n1- 10 هزار تا\n2- 5 هزار تا\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1680,1,'question-165','شوپنهاور: مردمان زیادی هستند که تلاش می کنند فقر اندیشه شان را زیر انبوهی از کلمات بی مصرف پنهان کنند! به گفته صبور تو واحد دوبلاژ شبکه چه چیزی تولید میکنن؟\n1- محصول فرهنگی\n2-آلبوم موسیقی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1681,1,'question-166','لیندا فیلد: هنگامی که عشق و قدر شناسی خود را به دیگران ابزار می کنیم اعتماد به نفس را در آن ها بالا برده و خودمان نیز احساس اعتماد به نفس بیشتری می کنیم! آرش چقدر سفارش آب هویج و شیر موز داد؟\n1- یک پارچ\n2- یک لیوان\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1682,1,'question-167','بنتام: هر چه انسان از سرمايه و خوشبختي خود به ديگران سهم برساند، بر ميزان اصلي آن مي افزايد يرا مهرباني مولد مهرباني است! غذای مهمونی خونه صبور رو کی درست کرده بود؟\n1- کیکاووس\n2- مجدی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1683,1,'question-168','گراندما موزس: زندگي چيزي است كه ما مي سازيم، هميشه چنين بوده و هميشه چنين خواهد بود! تو قسمت 5 سریال سیگنال موجود است، سروش به پدرش تلفنی گفت که پرهام چه موقعی رسیده پیشش؟\n1-نصف شب\n2- نزدیک ظهر\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1684,1,'question-169','فیلیپ سیدنی:کسانی که با افکار عالی و خوب دمسازند، هرگز تنها نیستند! همسر اول و دوم پدر موسیقی پاپ که سروش برای مهمونی دعوتشون کرده بود، چه القابی داشتن؟\n1- مادر و نامادری موسیقی پاپ\n2- الیزه و رهبر اکستر\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1685,1,'question-170','امرسون: رفتار و منش هر فرد، كتاب مصور انديشه ها و باورهاي اوست! آرش وقتی فهمید تو کافی شاپ مهمون آقای صبوره، چند تا نسکافه سفارش داد؟\n1- 4 تا\n2- 3 تا\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1686,1,'question-171','چاپلین: بهترین دوستم آینه است، چون وقتی گریه میکنم او نمی خندد! آرش که ظاهرا زبان انگلیسی رو خوب بلده، چه جور فیلم هایی رو دوست نداره؟\n1- فیلم های دوبله شده و زیر نویس دار\n2-فیلم های خارجی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1687,1,'question-172','وین دایر: كسي كه از آينه با شما مي نگرد، كسي است كه شما هر روز بايد پاسخي برايش داشته باشيد! تو قسمت 5 سریال سیگنال، آرش که بعد از دیدن چهار تا فیلم خوابش نبرده بود برای چی دوباره صبور رو از خواب بیدار کرد؟\n1- گرفتن مسواک\n2- گرفتن 4 تا فیلم\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1688,1,'question-173','روسو: زندگي، آنچه را كه بخواهيد به شما مي دهد به اين شرط كه خواسته هايتان مشخص و روشن باشد! سروش گفت دوبلر شبکه به غیر از صدای کلم بروکلی و آلوچه، چه صدای دیگه ای درمیاره؟\n1-هویج\n2- مربای شقاقل\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1689,1,'question-174','جيم رآن: شادماني، يك هنر است، نه يك رويداد! اسم پدر موسیقی پاپی که سروش برای مهمونی دعوتش کرده بود، چی بود؟\n1-فرگوسن\n2- سر وینچنزو\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1690,1,'question-175','آنتونی رابینز: به ياد داشته باشيد، پيش از آنكه بكوشيد با كسي ارتباط بهتري داشته باشيد، با خودتان بهتر ارتباط برقرار كنيد! صدای چه شخصیتی رو دوبلر نتونسته بود خوب از آب دربیاره که سروش عصبانی شده بود