تباهايتان را نگيرید، آنها جلوي شما را خواهند گرفت! پرویز به بازپرس گفت که پرهام کی باهاش تماس گرفته بود؟\n1- تارسیده به خارج\n2- وقتی همه دورهاش رو زده\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1699,1,'question-184','سنت اگزوپري: بالاترين خوشي ها در شور و شوقي است كه انسان را به ماجراجويي ها و پيروزيهاي بزرگ و فعاليتهاي نوآورانه وادار مي كند! تو قسمت 5 سریال سیگنال، صبور، پرهام رو به همسرش چی معرفی کرد؟\n1- آینده موسیقی پاپ\n2- رهبر ارکستر پاپ\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1700,1,'question-185','اسمايلز: عادت به هر چيزي، نخست از تار عنكبوت سست تر است، اما پس از مداومت بدان رفته رفته سخت تر از زنجير مي شود! سروش به صبور گفت که آرش برای باز شدن اشتهاش برای صبحانه چی میخواد؟\n1- پیاز\n2-ترشی لیته\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1701,1,'question-186','ارسطو: بدتر از همه آن است كه كسي آگاهي كامل داشته باشد و اراده كند عمل را انجام دهد و سپس آن را انجام ندهد! پرهام برای ساختن آلبومش چقدر پول از پرویز خواست؟\n1- 300 میلیون\n2- 50 میلیون\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1702,1,'question-187','آلفرد دوموسه: انسان خود را نمی شناسد، مگر در هنگام فقر و بدبختی! تو قسمت 5 سریال سیگنال، پرویز اعتقاد داشت دل گندگی های پرهام از کی بهش به ارث رسیده؟\n1- داییش\n2-مامانش\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1703,1,'question-188','روسو: بهترين وسيله براي جلب محبت ديگران، نيكي كردن به آنهاست! پرهام که به باباش زنگ زده بود ازش پول بگیره گفت اسم اولین آلبومش رو چی میخواد بذاره؟\n1-از تخم مرغ تا جوجو\n2- از پرویز تا پرواز\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1704,1,'question-189','آن لندرز: ميزان انسانيت يك فرد از نحوه برخورد او با ديگراني كه براي وي هيچ كاري نكرده اند، مشخص مي شود! تو قسمت 5 سریال سیگنال، صبور گفت که کافی شاپ شبکه چه قابلیتی داره؟\n1- اتاق استراحت داره\n2- وای فای مجانی داره\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1705,1,'answer-159','1|۱'),(1706,1,'answer-160','2|۲'),(1707,1,'answer-161','2|۲'),(1708,1,'answer-162','1|۱'),(1709,1,'answer-163','2|۲'),(1710,1,'answer-164','2|۲'),(1711,1,'an