خواست؟\n1-بالش مناسب\n2- دی وی دی پلیر\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1745,1,'answer-194','2|۲'),(1746,1,'question-195','جك كانفيلد: اگر بخواهيد در قبال مردم ديگر كامروا شويد، بايد در هنر سپاسگزاري مهارت پيدا كنيد! تو قسمت 5 سریال سیگنال آرش به سروش گفت که چقدر پورسانت میخواست؟\n1- 10 هزار تا\n2- 5 هزار تا\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1747,1,'answer-195','2|۲'),(1748,1,'question-196','شوپنهاور: مردمان زیادی هستند که تلاش می کنند فقر اندیشه شان را زیر انبوهی از کلمات بی مصرف پنهان کنند! به گفته صبور تو واحد دوبلاژ شبکه چه چیزی تولید میکنن؟\n1- محصول فرهنگی\n2-آلبوم موسیقی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1749,1,'answer-196','1|۱'),(1750,1,'question-197','لیندا فیلد: هنگامی که عشق و قدر شناسی خود را به دیگران ابزار می کنیم اعتماد به نفس را در آن ها بالا برده و خودمان نیز احساس اعتماد به نفس بیشتری می کنیم! آرش چقدر سفارش آب هویج و شیر موز داد؟\n1- یک پارچ\n2- یک لیوان\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1751,1,'answer-197','1|۱'),(1752,1,'question-198','بنتام: هر چه انسان از سرمايه و خوشبختي خود به ديگران سهم برساند، بر ميزان اصلي آن مي افزايد. مهرباني مولد مهرباني است! غذای مهمونی خونه صبور رو کی درست کرده بود؟\n1- کیکاووس\n2- مجدی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1753,1,'answer-198','2|۲'),(1754,1,'question-199','گراندما موزس: زندگي چيزي است كه ما مي سازيم، هميشه چنين بوده و هميشه چنين خواهد بود! تو قسمت 5 سریال سیگنال موجود است، سروش به پدرش تلفنی گفت که پرهام چه موقعی رسیده پیشش؟\n1-نصف شب\n2- نزدیک ظهر\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1755,1,'answer-199','2|۲'),(1756,1,'question-200','فیلیپ سیدنی:کسانی که با افکار عالی و خوب دمسازند، هرگز تنها نیستند! همسر اول و دوم پدر موسیقی پاپ که سروش برای مهمونی دعوتشون کرده بود، چه القابی داشتن؟\n1- مادر و نامادری موسیقی پاپ\n2- الیزه و رهبر اکستر\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1757,1,'answer-200','1|۱'),(1758,1,'question-201','امرسون: رفتار و منش هر فرد، كتاب مصور انديشه ها و باورهاي اوست! آرش وقتی فهمید تو کافی شاپ مهمون آقای صبوره، چند تا نسکافه سفارش داد؟\n1- 4 تا\n2- 3 تا\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1759,1,'answer-201','1|۱'),(1760,1,'question-202','چاپلین: بهترین دوستم آینه است، چون وقتی گریه میکنم او نمی خندد! آرش که ظاهرا زبان انگلیسی رو خوب بلده، چه جور فیلم هایی رو دوست نداره؟\n1- فیلم های دوبله شده و زیر نویس دار\n2-فیلم های خارجی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1761,1,'answer-202','1|۱'),(1762,1,'question-203','وین دایر: كسي كه از آينه به شما مي نگرد، كسي است كه شما هر روز بايد پاسخي برايش داشته باشيد! تو قسمت 5 سریال سیگنال، آرش که بعد از دیدن چهار تا فیلم خوابش نبرده بود برای چی دوباره صبور رو از خواب بیدار کرد؟\n1- گرفتن مسواک\n2- گرفتن 4 تا فیلم\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1763,1,'answer-203','1|۱'),(1764,1,'question-204','روسو: زندگي، آنچه را كه بخواهيد به شما مي دهد به اين شرط كه خواسته هايتان مشخص و روشن باشد! سروش گفت دوبلر شبکه به غیر از صدای کلم بروکلی و آلوچه، چه صدای دیگه ای درمیاره؟\n1-هویج\n2- مربای شقاقل\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1765,1,'answer-204','2|۲'),(1766,1,'question-205','جيم رآن: شادماني، يك هنر است، نه يك رويداد! اسم پدر موسیقی پاپی که سروش برای مهمونی دعوتش کرده بود، چی بود؟\n1-فرگوسن\n2- سر وینچنزو\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1767,1,'answer-205','2|۲'),(1768,1,'question-206','آنتونی رابینز: به ياد داشته باشيد، پيش از آنكه بكوشيد با كسي ارتباط بهتري داشته باشيد، با خودتان بهتر ارتباط برقرار كنيد! صدای چه شخصیتی رو دوبلر نتونسته بود خوب از آب دربیاره که سروش عصبانی شده بود؟\n1- کلم\n2- بلوندی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1769,1,'answer-206','1|۱'),(1770,1,'question-207','فيثاغورث: آدمي را امتحان به كردار بايد كرد، نه به گفتار. چه بسيارند مردمي كه زشت كردار و نيكو گفتارند! سر معتمدی قسمت 5 سریال سیگنال، چه سازی میزد؟\n1- ارگ\n2- گیتار\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1771,1,'answer-207','1|۱'),(1772,1,'question-208','دیل کارنگی: با اندکی شاد کردن دیگران، اندوه خود را از یاد ببریم! تو قسمت 5 سریال سیگنال، آرش برای درمان بی خوابیش از صبور چی میخواست؟\n1-قرص خواب\n2- دم کرده سنبل الطیب\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1773,1,'answer-208','2|۲'),(1774,1,'question-209','اويد: هر چقدر انسان والامقام باشد، به همان نسبت نيز دير خشم است! تو قسمت 5 سریال سیگنال موجود است، گزینه اولی که فرمان جلوی صبور گذاشته بود، چی بود؟\n1- پلیس و شکایت بازی\n2-وام گرفتن\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1775,1,'answer-209','1|۱'),(1776,1,'question-210','راكفلر: اگر با ثروتي اندك بخشنده و بزرگوار نباشيد، با ثروت زياد هم ناگهان بزرگوار و بخشنده نخواهيد شد! متخصص سازهای بادی و کوبه ای یا به قول سروش بادکوبه ای قسمت 5 سریال \"سیگنال موجود است\" اسمش چی بود؟\n1- سر پارکینسون\n2- سر معتمدی\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1777,1,'answer-210','2|۲'),(1778,1,'question-211','افلاطون: آنگاه كه جوش و خروش هوي و هوس فرو مي‌نشيند، مانند اين است كه انسان از دست شماري ستمگر ديوانه رسته باشد! آرش خواست که تو کافه گلاسه اش یا به قول خودش کاسه گلافه اش چی باشه؟\n1-هلو\n2- موز\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1779,1,'answer-211','2|۲'),(1780,1,'question-212','اریک نیوتن: هر فردي به سليقه ي خود، فهرست جداگانه اي از اشيا را زيبا مي داند و براي هر قلم آن نيز رقم شاخص يا ارزش هنري متفاوتي قائل مي شود! به گفته سروش فیلمی که تو شبکه داشتن صداگذاری میکردن روی چه چیزی تاثیر میذاره؟\n1- فرهنگ موسیقی\n2- فرهنگ تغذیه کودک\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1781,1,'answer-212','2|۲'),(1782,1,'question-213','جان راسكين: نخستين نشان انسان‌هاي به راستي بزرگ، فروتني است! تو قسمت 5 سریال سیگنال، سروش میخواست چند تا از آلبومهای اول پرهام رو برای معروف شدن رایگان پخش کنه؟\n1- 10 تا\n2- 3 تا\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1783,1,'answer-213','2|۲'),(1784,1,'question-214','دنيس ويتلي: اگر جلوي اشتباهايتان را نگيرید، آنها جلوي شما را خواهند گرفت! پرویز به بازپرس گفت که پرهام کی باهاش تماس گرفته بود؟\n1- تارسیده به خارج\n2- وقتی همه دورهاش رو زده\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1785,1,'answer-214','2|۲'),(1786,1,'question-215','سنت اگزوپري: بالاترين خوشي ها در شور و شوقي است كه انسان را به ماجراجويي ها و پيروزيهاي بزرگ و فعاليتهاي نوآورانه وادار مي كند! تو قسمت 5 سریال سیگنال، صبور، پرهام رو به همسرش چی معرفی کرد؟\n1- آینده موسیقی پاپ\n2- رهبر ارکستر پاپ\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1787,1,'answer-215','1|۱'),(1788,1,'question-216','اسمايلز: عادت به هر چيزي، نخست از تار عنكبوت سست تر است، اما پس از مداومت بدان رفته رفته سخت تر از زنجير مي شود! سروش به صبور گفت که آرش برای باز شدن اشتهاش برای صبحانه چی میخواد؟\n1- پیاز\n2-ترشی لیته\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1789,1,'answer-216','1|۱'),(1790,1,'question-217','ارسطو: بدتر از همه آن است كه كسي آگاهي كامل داشته باشد و اراده كند عمل را انجام دهد و سپس آن را انجام ندهد! پرهام برای ساختن آلبومش چقدر پول از پرویز خواست؟\n1- 300 میلیون\n2- 50 میلیون\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1791,1,'answer-217','1|۱'),(1792,1,'question-218','آلفرد دوموسه: انسان خود را نمی شناسد، مگر در هنگام فقر و بدبختی! تو قسمت 5 سریال سیگنال، پرویز اعتقاد داشت دل گندگی های پرهام از کی بهش به ارث رسیده؟\n1- داییش\n2-مامانش\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1793,1,'answer-218','1|۱'),(1794,1,'question-219','روسو: بهترين وسيله براي جلب محبت ديگران، نيكي كردن به آنهاست! پرهام که به باباش زنگ زده بود ازش پول بگیره گفت اسم اولین آلبومش رو چی میخواد بذاره؟\n1-از تخم مرغ تا جوجو\n2- از پرویز تا پرواز\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1795,1,'answer-219','2|۲'),(1796,1,'question-220','آن لندرز: ميزان انسانيت يك فرد از نحوه برخورد او با ديگراني كه براي وي هيچ كاري نكرده اند، مشخص مي شود! تو قسمت 5 سریال سیگنال، صبور گفت که کافی شاپ شبکه چه قابلیتی داره؟\n1- اتاق استراحت داره\n2- وای فای مجانی داره\nلطفا عددگزینه مورد نظر خود را ارسال نمایید.'),(1797,1,'answer-220','2|۲'),(1798,9,'question-113','بریان تریسی: یادگیری مداوم حداقل شرط لازم  برای موفقیت در هر زمینه ای است ،که در آن فعالیت می کنید، هر روز چیز جدیدی بیاموزید! صفحه کارمند قسمت چهار عطسه چند تا لایک خور داشت؟\n1- 80 تا\n2- 700 تا\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(1799,9,'answer-113','2|۲'),(1800,9,'question-114','آندرو متيوز: زندگي من مجموعه اي از درسهايي است كه به آن نياز دارم؛\nدرسهايي كه با نظم و ترتيب تمام در زندگي ام رخ مي دهد! یادته تو قسمت چهارم سریال عطسه کارمند ساعت چند استاتوس مدیر مالی شرکت رو لایک کرده بود؟\n1- ساعت 12:00\n2- ساعت 10:30\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(1801,9,'answer-114','2|۲'),(1802,9,'question-115','وین دایر: آنچه كه درست مي‌دانيد، تعيين كننده‌ي سطح كاميابي و خوشبختي شماست! متقاضی کار قسمت چهارم عطسه تو مدرسه چه تئاتری بازی کرده بود؟\n1- تئاتر شاد موزیکال برای کودک\n2- تئاتر هملت\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(1803,9,'answer-115','1|۱'),(1804,9,'question-116','چاپلین: شما زمانی به قدرت نیاز دارید که بخواهید به کاری مضر دست بزنید، وگرنه عشق برای انجام تمامی کارها کافی است! تو قسمت چهارم عطسه کسی که اومده بود فال بگیره گفت معرفش کی بوده؟\n1- سوسن خانم\n2- شهلا خانم\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(1805,9,'answer-116','2|۲'),(1806,9,'question-117','استیو جابز: بعضی وقتها زندگی مثل سنگ توی سر شما می کوبد ولی شما ایمانتان  را از دست ندهید! یادته فوت دکتر قسمت چهارم سریال عطسه چقدر هزینه برای بیمار داشت؟\n1- 5 میلیون\n2- 2 میلیون\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(1807,9,'answer-117','1|۱'),(1808,9,'question-118','دیو توماس: هوای کسب و کارتان را داشته باشین تا کسب و کارتان هوای شما را داشته باشد! مدیر شرکت چقدر بعد از عضو شدن کارمندش در شبکه های اجتماعی، اون رو به گروهش دعوت کرده بود؟\n1- چهار ماه\n2- دو ماه \nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(1809,9,'answer-118','2|۲'),(1810,9,'question-119','پاسکال: تمام گرفتاریهای انسان ناشی از آن است که قادر نیست، تنها در اتاقی بنشیند، آرام گیرد و سکوت اختیار کند! یادته پرستار اتاق عمل قسمت چهارم عطسه گفت اسم مریضی بیمار چیه؟\n1- آتروسکولوروزیس\n2- مننژیت\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(1811,9,'answer-119','1|۱'),(1812,9,'question-120','وین دایر: در درون شما فردي بزرگ‌‌تر كه قدر و اهميت او هرگز براي شما قابل تصور نيست، آشيان دارد! یادته توقسمت چهارم سریال عطسه متقاضی کار اینبار اومده بود چیکاره بشه؟\n1- بازیگر\n2- نور پرداز\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(1813,9,'answer-120','1|۱'),(1814,9,'question-121','اپرا وینفری: اگر به چیزهایی که ندارید نگاه کنید، هرگز سیر نخواهید شد! یادته متقاضی کار گفت که نقشش تو تئاتر مدرسه چی بوده؟\n1- پدر هملت\n2- گرمکن\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(1815,9,'answer-121','2|۲'),(1816,9,'question-122','يورسن: از هزاران راه مي توان به خوشبختي رسيد، اگر يكي بسته شد راه ديگر را پيش گير! دکتر قسمت چهارم سریال عطسه گفت که بعد از عمل، بیمار میتونه چه کار کنه؟\n1- والیبال بازی کنه\n2- شنا کنه\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(1817,9,'answer-122','1|۱'),(1818,9,'question-123','وين داير:كسي كه از آينه با شما مي نگرد، كسي است كه شما هر روز بايد پاسخي برايش داشته باشيد! روزی که مدیر مالی شرکت تو قسمت چهارم سریال عطسه استاتوس گذاشته بود، قرار بود چه اتفاقی بیفته؟\n1- حقوق ها رو زیاد کنن!\n2- به انتخاب مدیر دو نفر پاداش بگیرن!\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(1819,9,'answer-123','2|۲'),(1820,9,'question-124','انشتین: من ماه ها و سال ها فکر می کنم. در نود و نه مورد نتیجه مطلوب نیست ولی در بار صدم راه درست را می یابم! دکتر اتاق عمل قسمت چهارم سریال عطسه گفت که یک میلیون و هفتصد هزینه چیه؟\n1- ایاب و ذهاب\n2- بستری قبل از عمل\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(1821,9,'answer-124','2|۲'),(1822,9,'question-125','آلدوس هاكسلي: كمي مهربان‌تر نسبت به يكديگر، تنها چيزي‌ست كه همه‌ي ما به آن نيازمنديم! دکتر قسمت چهارم سریال عطسه گفت که هزینه عمل در صورتیکه فقط باز کنه و هیچ کاری نکنه و بخیه بزنه، چقدر میشه؟\n1- 11 میلیون\n2- 6 میلیون\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(1823,9,'answer-125','1|۱'),(1824,9,'question-126','جيمز اوپنهيم: نادان در دوردست ها 