'بدهکار بانکی قسمت چهارم عطسه وام میلیاردیش رو برای چی گرفته بود؟\n1- برای احداث کارخانه تولید کردن دارو\n2- برای خرید مسکن\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(1861,9,'answer-144','1|۱'),(1862,9,'question-145','مادر ترزا: عشق، ميوه تمام فصل هاست و دست همه كس به شاخسارش مي رسد! متقاضی کار قسمت چهارم عطسه چه بازیگرهایی رو دوست داشت؟\n1- نصرالله رادش و امیر نوری\n2- مهران مدیری و سیامک انصاری\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(1863,9,'answer-145','1|۱'),(1864,9,'question-146','آنتوني رابينز: شما ماموريت و مسئوليتي ويژه را در برابر خودتان و ديگران به دوش داريد و پيش از هر چيز و هر كس در برابر خودتان مسئول هستيد! کارمند قسمت چهارم عطسه ادعا کرد که چرا عکس مدیرش رو لایک نکرده؟\n1- اینترنت قطع شده بود\n2- فیلتر شکنش تموم شده بوده!\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(1865,9,'answer-146','2|۲'),(1866,9,'question-147','فیثاغورث: سکوت را بیاموز، بگذار، ذهن آرام تو گوش کند و بیاموزد! فالگیر قسمت چهارم سریال عطسه گفت که قیمت فال ده ساله تضمینی چقدره؟\n1- 95 هزار تومان\n2- 65 هزار تومان\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(1867,9,'answer-147','1|۱'),(1868,9,'question-148','هاگس مرنس: آنچه كه تفاوتها را در روابط انساني ايجاد مي كند، گفته هايتان نيست، بلكه چگونگي بيان شما است! دکتر قسمت چهارم سریال عطسه گفت که اگه بخیه زدن به عهده خود بیمار باشه، هزینه عمل چقدر میشه؟\n1- 5 میلیون\n2- 15 میلیون\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(1869,9,'answer-148','2|۲'),(1870,9,'question-149','ادیسون: انسان هرچه بالاتر برود، احتمال دیده شدن وصله شلوارش بیشتر می شود! تو قسمت چهارم سریال عطسه دکتر 18 میلیون رو برای عمل، از چه کسی دیگه گرفته بود؟\n1- برادرش\n2- خواهرش\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(1871,9,'answer-149','2|۲'),(1872,12,'welcome','دوست  عزیز به سرویس \"آخرین اختراعات\" خوش اومدی! برای اطلاع از تازه ترین اختراعات روز دنیا با ما همراه باش! برای غیر فعالسازی این سرویس میتونی خاموش رو به 305034 ارسال کنی! هر پیامک 100 تومان!'),(1873,12,'reactivation welcome','چقدر خوب که دوباره برگشتی! برای آشنایی با جدیدترین اختراعات آماده باش! جهت غیر فعالسازی این سرویس میتونی خاموش رو به 305034 ارسال کنی! '),(1874,12,'before activated','دوست عزیز شما در سرویس \" آخرین اختراعات\" عضو هستید. برای غیر فعالسازی این سرویس خاموش رو به 305034 ارسال کنید! '),(1876,12,'before de-activation','دوست عزیز شما قبلا سرویس\"آخرین اختراعات\" رو غیر فعال کردی! برای اشنایی با سرویس ها این سرشماره یک پیامک خالی به ۳۰۵۰۳۴ارسال کن'),(1877,12,'de-activation','دوست عزیز شما با موفقیت سرویس\"آخرین اختراعات\" رو غیر فعال کردی! برای اشنایی با سرویس ها این سرشماره یک پیامک خالی به ۳۰۵۰۳۴ارسال کن'),(1891,12,'help4subscribe','دوست عزیز شما در سرویس \" آخرین اختراعات\" عضو هستید. برای غیر فعالسازی این سرویس 20 خاموش رو به 305034 ارسال کنید! '),(1892,12,'content-1','مهندسان شرکتی در شیلی یک شارژر یو اس ‌بی تولید کرده‌اند که انرژی را از درون خاک جمع‌آوری کرده و با آن، تلفن همراه را شارژ می‌کند. یک گیاه می‌تواند تلفن همراه هوشمند را در 1.5 ساعت شارژ کرده یا برق لازم برای لامپ‌ها و سایر دستگاه‌ها را تأمین کند. نمونه پیش‌ساخت این فناوری که E-Kaia نام دارد، توسط اولین آراونا، کامیلا روپسیش و کارولینا گوئررو ساخته شده است. این سه نفر در سال 2009 زمانی که دانشجوی دانشگاه Duoc و دانشگاه ملی آندرس بلو بودند، این فناوری را ساختند.'),(1893,12,'content-2','دانشمندان مرکز تحقیقات سیلیکات مؤسسه فرانهوفر آلمان جوراب‌های مجهز به حسگر فشار ارائه داده‌اند که برای نجات پای دیابتی‌ها طراحی شده است. یکی از راه‌های جلوگیری از بروز زخم‌های دیابتی جلوگیری از تحت فشار قرارگرفتن نقاطی از پا است.جوراب ارائه‌شده می‌تواند کاربر را از وجود فشار بر روی ناحیه خاصی از پا آگاه کرده و در پیشگیری از بروز زخم دیابت کمک کند. هر یک از لنگه‌های نمونه اولیه این جوراب از دو لایه پارچه مصنوعی/کتان جاذب رطوبت تشکیل شده که بین آ‌ن‌ها یک فیلم سیلیکونی کش‌آمدنی فشرده شده است.'),(1894,12,'content-3','محققان آمریکایی یک بطری آب طراحی کرده‌اند که در زمان احساس تشنگی کاربر، می‌درخشد. بطری هوشمند HidrateMe با استفاده از یک حسگر و برنامه تلفن هوشمند، به جای یک دوست کوچک آبرسان عمل کرده که مراقب سلامت فرد است.\nیک برنامه رایگان که با بلوتوث همگام‌سازی می‌شود، میزان آب مصرفی کاربر را پیگیری کرده و میزان نوشیدنی لازم برای وی را بر اساس فیزیک بدن مانند قد و ون و همچنین موقعیت، ارتفاع و رطوبت تخمین می‌زند.'),(1895,12,'content-4','محققان پس از مطالعه بر روی بهترین روش نجات جان شناگران، اولین نسل دستبند‌های مجهز به بالشتک ‌هوا برای شناور نگه‌داشتن افراد حادثه دیده را به بازار عرضه کردند. این دستبند سبک وزن به یک کیسه هوا و کارتریج تولید کننده گاز دی‌اکسیدکربن مجهز است که در هنگام خطر، کیسه‌هوا در کمتر از یک ثانیه از گاز دی‌اکسیدکربن پر شده و به حفظ شناگر در سطح آب کمک می‌کند. این دستبند با قیمت بسیار مناسب و راحتی در هنگام شنا و موج‌سواری در مواقع خطر از غرق شدن شناگران جلوگیری می‌کند.'),(1896,12,'content-5','گروهی از دانشمندان در آلمان عینک منحصربفردی به نام ADAMAAS ویژه سالمندان ساخته اند که توانایی آنها را در انجام کارهای پیچیده مضاعف میکند. این عینک ضمن درک سطح سلامت جسمی و روحی کاربر و تشخیص کاری که در حال انجام آن است، کمکهای مشورتی لازم را در اختیار فرد سالمند قرار میدهد و از ارایه دستورالعمل پخت کیک تا کارهای پیچیده تری نظیر تعمیر دوچرخه و تمرینات یوگا کاربرد دارد.'),(1897,12,'content-6','محققان یک دستگاه ضبط صوت کوچک، خودکفا و با کیفیت بالا را طراحی کرده‌اند که می‌تواند به خبرنگاران و روزنامه‌نگاران برای ضبط راحت و با کیفیت صدا کمک کند. ضبط صوت Instamic با برخورداری از دو گیگا بایت حافظه داخلی، برای چهار ساعت ضبط صدا کاربرد دارد و از طریق USB شارژ می‌شود. این USB برای انتقال صدا نیز قابل استفاده است. ضبط صوت Instamic از طریق نرم‌افزار تلفن همراه نیز قابلیت استفاده و کنترل دارد و در دو نسخه Go و Pro ساخته شده و ضد آب است.'),(1898,12,'content-7','محققان امریکایی موفق به ساخت هدبند متفاوتی به نام Muse شده اند که به کنترل امواج مغزی کاربر پرداخته و واکنش های متفاوتی را در برابر استرس وارد شده به شخص بروز می دهد. گجت Muse با نرم افزاری که Calm نامیده می شود و باید روی اسمارت فون یا تبلت ها نصب شود، ارتباط برقرار می کند و به کاربرانش اجازه می دهد تا از وضعیت خود اطلاع پیدا کنند. این گجت می تواند در آرامش و همینطور تمرکز بیشتر کاربران نقش به سزایی را ایفا کند.'),(1899,12,'content-8','یک استاراپ در سانفرانسیسکو اجاقی هوشمند به نام June تولید کرده که به طور اتوماتیک غذایی که در آن قرار می‌گیرد را تشخیص می‌دهد و آن را کاملا می‌پزد. این اجاق که روی میز قرار می‌گیرد آنقدر بزرگ هست که بتوان یک پیتزا یا مرغ درسته را در آن قرار داد. اجاق هوشمند June یک صفحه نمایش 5 اینچی، ترازوی دیجیتالی و پردازنده Nvidia دارد. در شیشه‌ای آن عمل‌آوری شده تا داغ نشود و المنت‌های گرم‌کننده داخلی آن از فیبر کربنی ساخته شده و همچنین دارای قابلیت تنظیم وای‌فای را دارد.'),(1900,12,'content-9','کیبورد بلوتوثی جدیدی با نام Moky عرضه شده که به کاربران اجازه می دهد تا بدون هر گونه سختی به تایپ یا فعالیت هایی مانند کلیک، درگ، اسکرول و ... بپردازند. از دیگر قابلیت های این کیبورد بلوتوثی می توان کلیدهای پانتوگراف، بدنه آلومینیومی و همینطور صفحه تاشویی را نام برد که می تواند به عنوان پایه یک اسمارت فون مورد استفاده قرار گیرد. این کیبورد بلوتوثی با پلتفورم های اندروید، ویندوز و iOS سازگار است.'),(1901,12,'content-10','یکی از شرکت های تولید کننده تلفن همراه از عرضه تبلت های تاشویی خبر داده که همانند یک کاغذ تا می شوند تا نه تنها کاربران را در حمل یاری کنند بلکه بتوانند قابلیت های جدیدی را نیز پیش روی مخاطبان خود قرار دهند. این تبلت بدون اینکه آسیبی ببیند یا مشکلی پیدا کند به مراتب بیشتر از یک کاغذ تا می شود. این فناوری می تواند به سایر محصولات مانند تلویزیون ها یا اسمارت فون ها نیز وارد شود. برای مثال تلویزیونی با اندازه های بزرگ را تصور کنید که به سادگی می توان آن را تا و حمل کرد.'),(1923,12,'notification startup time','10:10'),(1927,14,'welcome','دوست عزیز به سرویس \"کودک در جاده موفقیت\" خوش اومدی! ما بهترین شیوه های کسب موفقیت فرزندان در مسیر رشد و شکوفایی اونها رو برای شما ارسال میکنیم! برای غیر فعالسازی این سرویس میتونی خاموش رو به 305034 بفرستی! هر پیامک 100 تومان!'),(1928,14,'reactivation welcome','از اینکه دوباره پیش ما برگشتی خوشحالیم! اینجا کلی اطلاعات مفید در زمینه موفقیت فرزندان براتون داریم! برای غیر فعالسازی این سرویس، میتونی خاموش رو به 305034 ارسال کنی! '),(1929,14,'before activated','دوست عزیز شما در سرویس \" کودک در جاده موفقیت\" عضو هستید. برای غیر فعالسازی این سرویس\"خاموش\" رو به 305034 ارسال کنید! '),(1930,14,'before de-activation','دوست عزیز شما قبلا سرویس ”کودک در جاده موفقیت\" رو غیر فعال کردی! برای اشنایی با سرویس ها این سرشماره یک پیامک خالی به ۳۰۵۰۳۴ارسال کن'),(1931,14,'de-activation','دوست عزیز شما با موفقیت سرویس\"کودک در جاده موفقیت\" رو غیر فعال کردی! برای اشنایی با سرویس ها این سرشماره یک پیامک خالی به ۳۰۵۰۳۴ارسال کن'),(1932,14,'content-1','به كودكان احترام بگذاريد! انسان‌ها ذاتاً علاقه‌مندند که دیگران به آن‌ها احترام بگذارند و این مسئله شامل همۀ طبقات، از بزرگسال تا خردسال می‌شود.به كودكان احترام بگذاريد آن ها هم سرمایه‌های عظیم و ارزندۀ جامعه‌اند، و هم از این قاعده مستثنا نیستند. به‌خصوص اگر این اکرام و اظهار محبت به آن‌ها در مقابل دیگران باشد. در روانشناسی همه رفتارهای انسان یک معنی و توجیه دارد و آن‌هم فرار از حقارت است. احترام به کودکان در شخصیت آنها تاثیر بسزایی دارد.'),(1933,14,'content-2','اگر فرزند نوجواني در خانه داريد، به احتمال زياد با اين موضوع مواجه شده ايد که فرزندتان درباره يک مسئله صحبت هاي دوستانش را بيشتر از نظريات شما قبول دارد و حتي اگر در ظاهر به شما «چشم» بگويد باز هم طبق نظر دوستانش رفتار مي کند. اگر قصد داريد نفوذ دوستان فرزندتان را کاهش دهيد بهتر است بي گدار به آب نزنيد، چون رفتارهاي اشتباه شما در اين باره فقط آن ها را نزد فرزندتان عزيزتر مي کند.'),(1934,14,'content-3','یکی از مهم‌ترین تدابیر والدین در سنین بلوغ فرزندانشان باید محکم ساختن حریم خصوصیشان باشد‌! فرزندانی که تا پیش از این متوجه خیلی از مسائل اطراف خود نبوده‌اند با قرار گرفتن در سن بلوغ حساس شده و کوچک‌ترین تغییرات رفتاری والدین خود را حس می‌کنند‌. محافظت کامل‌تر و بیشتر از روابط و حریم خصوصی والدین در زمان بلوغ فرزندان باعث می‌شود که آن‌ها با سلامت روحی این مرحله از رشد را پشت‌سر بگذارند و گرفتار بدآموزی‌ها و رفتارهای غلط و حساسیت‌های نابه‌جا نشوند‌.'),(1935,14,'content-4','به کودک خود آموزش دهید که با افرادی که نمی شناسد، به راحتی ارتباط برقرار نکند. از افراد غریبه خوراکی قبول نکند و در صورتی که فردی به او خوراکی تعارف کرد، از او بخواهید که این موضوع را به شما بگوید و با اجازه شما خوراکی را قبول کند. به او آموزش دهید که اگر غریبه ای دعوتش کرد تا سوار ماشین، دوچرخه یا موتور شود، قبول نکند، حتی اگر این غریبه وعده دهد که او را پیش والدینش می برد. به کودک یاد بدهید که اگر غریبه ای به زور قصد داشت او را با خود ببرد، سریع گریه کنند، فریاد بزنند و کمک بخواهند.'),(1936,14,'content-5','سعی کنید حتی المقدور کودک خود را تنها نگذارید، اما اگر مجبور هستید برای مدت خیلی کوتاهی او را در خانه تنها بگذارید در را کامل قفل کنید و به او یاد دهید که چگونه می تواند از تلفن استفاده کند و شماره های ضروری را آموزش دهید. بیشتر تلفن های امروزی قابلیت ذخیره کردن شماره را دارند که تنها با فشار یک دکمه می توان شماره فرد مورد نظر را گرفت، از این قابلیت استفاده کنید تا کودک شما اگر تنها بود و ترسید یا اتفاقی او را تهدید می کرد، بتواند به راحتی شماره بگیرد. '),(1937,14,'content-6','بعضی اوقات امکان دارد که در مکان های شلوغ مثلا مرکز خرید یا پارک، کودک دست والدین خود را رها کند و گم شود، به او یاد دهید که در این مواقع به هر فردی اعتماد نکند. به نزد پلیس یا مامور راهنمایی و رانندگی برود، یا حتما به مغازه ای در آن نزدیکی مراجعه کند. همیشه شماره تماسی در جیب یا کیف کودک خود قرار دهید و به او آموزش دهید تا در صورتی که گم شد این شماره را به پلیس یا مغازه دار بدهد.  '),(1938,14,'content-7','با کودک خود در مورد رد شدن از خیابان و حرکت در پیاده رو ها صحبت کنید. هیچ کودک زیر ۱۰ سالی نباید به تنهایی از خیابان رد شود. به کودک خود آموزش دهید که می تواند در پیاده رو خلوت به تنهایی در جلوی شما بدود، اما به شرط اینکه هر زمان به تقاطعی رسید بایستد تا شما به او برسید و با هم از خیابان رد شوید. همچنین به او رنگ های چراغ راهنمایی چهار راه ها را آموزش دهید و به او علامت را نشان دهید که زمانی که چراغ عابر پیاده سبز است می تواند در حالی که دست شما را گرفته از خیابان عبور کند.'),(1939,14,'content-8','زمانی که فرزند شما به سن چهار یا پنج سال می رسد، شاید شما آسوده تر شوید، زیرا کودک به سنی رسیده که قدرت تشخیص برخی از خطرها را دارد. کودکان در این سن می توانند به تنهایی راه بروند، بازی کنند و با افراد مختلف و غریبه ها صحبت کنند که هر کدام از این موارد می تواند خطراتی را به همراه داشته باشد. از این رو آگاه کردن کودکان از خطرات اطرافشان مساله ای ضروری است، اما این آگاه کردن و آموزش نباید به گونه ای باشد که بیشتر موجب ترس کودک شود، زیرا این ترس می تواند کودک را منزوی و پریشان کند.'),(1940,14,'content-9','آموزش صداقت به کودکان مستلزم صرف وقت و شکیبائی است. قطعا شما دوست دارید فرزندتان صادق باشد تا اینکه تقلب کند، دروغ بگوید، پنهان کاری یا دزدی کند. فراگیری هر مهارتی اگر از سال‌های دوران خردسالی و کودکی آغاز شود تأثیری دو چندان بر زندگی او خواهد گذاشت. والدین می‌توانند با تشویق کودک به راست گوئی و گفتن آن‌چه که واقعاً دیده‌، صداقت را در او پرورش دهند. هنگامی که کودکتان با همبازی هایش دعوا میکند و موضوعی او را میرنجاند از او بخواهید آنچه را که اتفاق افتاده در ذهنش تجسم و برایتان بازگو کند.'),(1941,14,'content-10','ممکن است بعضی از والدین تصور کنند که دروغ گفتن در ذات بچه است و این وظیفه والدین است که برای اینکه جلو عادت شدن آن را بگیرند، آنها را برای دروغگویی شان تنبیه کنند. واقعیت این است که خیلی وقت ها خود والدین زمینه را برای دروغگویی فرزندشان ایجاد می کنند. اگر با فرزندانتان خشن برخورد کرده و بخواهید تنبیه شان کنید، از اینکه واقعیت را به شما بگویند میترسند. اگر احساس امنیت کنند، صادق خواهند بود. پس با آنها با ملایمت رفتار کرده و بر صداقتشان تاکید کنید.'),(1942,14,'notification startup time','10:30'),(1943,14,'help4subscribe','دوست عزیز شما در سرویس \" آخرین اختراعات\" عضو هستید. برای غیر فعالسازی این سرویس 60 رو به 305034 ارسال کنید! '),(1944,16,'welcome','به سرویس \"غنچه های خلاق\" خوش اومدی! کاربردی ترین نکات در پرورش خلاقیت کودکان رو با ما دنبال کن! برای غیر فعالسازی این سرویس میتونی کلمه \"خاموش\" رو به 305034 ارسال کنی. هر پیامک 100 تومان!'),(1945,16,'reactivation welcome','ممنون که به جمع ما برگشتی! سرویس \"غنچه های خلاق\" پر از تکنیکهای مفید برای پرورش خلاقیت کودکانه! برای غیر فعالسازی این سرویس میتونی عدد \"خاموش\" رو به 305034 ارسال کنی! هر پیامک 100 تومان!'),(1946,16,'before activated','دوست عزیز شما در سرویس \"غنچه های خلاق\" عضو هستید. برای غیر فعالسازی این سرویس خاموش رو به 305034 ارسال کنید!'),(1947,16,'before de-activation','دوست عزیز شما قبلا ”غنچه های خلاق\" رو غیر فعال کردی! برای اشنایی با سرویس ها این سرشماره یک پیامک خالی به ۳۰۵۰۳۴ارسال کن'),(1948,16,'de-activation','دوست عزیز شما با موفقیت سرویس\"غنچه های خلاق\" رو غیر فعال کردی! برای اشنایی با سرویس ها این سرشماره یک پیامک خالی به ۳۰۵۰۳۴ارسال کن'),(1949,16,'help4subscribe','دوست عزیز شما در سرویس \" غنچه های خلاق\" عضو هستید. برای غیر فعالسازی این سرویس عدد 50 خاموش\" رو به 305034  ارسال کنید! '),(1950,16,'content-1','یکی از راههای ایجاد خلاقیت در کودک طرح سوال برای کودک است! براي ايجاد سؤالات تازه در ذهن کودکتان، او را راهنمايي کنيد. آموزش به کودک بايد طوري باشد که او را به طرف پرسشهاي تازه هدايت کند. معلم بايد هنگام جواب دادن به سؤالات کودک، او را به سمت مهارتهاي جديد سوق دهد و از به کار بردن کلماتي مانند بله، خير، هرگز و امثال آن دوري کند. اين نوع جوابها نمي تواند ارتباط کاملي بين سؤالات کودک و معلومات قبلي او برقرار کند.'),(1951,16,'content-2','به عقايد جديد و تازه کودکتان احترام بگذاريد. کودکاني که به نوعي خلاقيت آنها برانگيخته شده، روابط و مفاهيم را درک مي کنند. لذا والدين و مربيان آنها ممکن است به آنها توجه نداشته باشند و حتي گاهي او عقايد خود را چنان مطرح کند که بزرگسالان قادر به ارزشيابي و جايگزيني آنها نباشند. تشويق کودکان به ابرازعقايد جديد، مي تواند در رشد خلاقيت آنها موثر واقع شود .'),(1952,16,'content-3','محيط خانه را به صورتي درآوريد كه در آن فعاليت، بازي و خنده به مقدار زيادي وجود داشته باشد. شما و كودكانتان سعي کنید كارها را به روش هاي جديد و جالب انجام دهيد. با تشويق و تأييد رفتار كودك و فراهم آوردن زمينه هاي مساعد و تدارك بازي هاي دلخواه او، قدرت تخيل و خلاقيت كودك را تقويت كنيد. خيال پردازيهاي كودكان را سرزنش نكنيد زيرا خلاقيت او را محدود مي سازيد.'),(1953,16,'content-4','از مکان هاي جديد ديدن کنيد. همراه با کودک خود به نمايشگاهها و موزه هاي مختلف و طبيعت زيبا برويد، اجازه دهيد او از نزديک مکان هاي گوناگون را شناسايي کند. میتوانید برای تعطیلات آخر هفته او را به باغ وحش ببرید تا از نزدیک با گونه های مختلف جانوران و حیوانات آشنا شود و انواع آنها را بشناسد. بدون شک تماشای برقراری ارتباط حیوانات و غذا خوردن و شکل های گوناگون آنها نقش به سزایی در روحیه و ایجاد سوالات مختف در ذهن او خواهد داشت.'),(1954,16,'content-5','از مراقبتها و دخالتهاي بيش از حد در زندگي کودکان اجتناب کنيد. يکي از ويژگيهاي انسان خلاق اين است که تواناييش را خودش به کارمي اندازد. وظيفه والدين و مربيان اين است که اين قابليت را در او زنده نگاه دارند و به کودکان اجازه دهند بعضي اوقات مطابق سليقه خود اشياء را کشف کنند. یک کاغذ، پاک کن، مداد و قیچی روی میزش قرار دهید و از او بخواهید برای بریدن کاغذ یکی از آنها را انتخاب کند.'),(1955,16,'content-6','مراقبتها و دخالتهاي زياد از حد بزرگسالان در زندگي و رفتارهاي کودکان، قابليت يادگيري مبتکرانه آنها را تضعيف مي کند. اجازه ندهید کودک در همه حال وابسته به شما باشد. برای مثال او بارها و بارها دیده است که شما از کجا لیوان را آب میکنید. کافی است برایش یک لیوان مجزا تهیه کنید و هنگامی که درخواست آب میکند از او بخواهید همانند شما از همانجای همیشگی لیوانش را پر کند.'),(1956,16,'content-7','از کودکان بخواهيد که اشياء و امور نيمه تمام را تکميل کنند. آنها باید یاد بگیرند تا جملات نا تمام و داستانهاي نا کامل، تصاوير و نقاشي هاي نيمه تمام و حتي اشياء ناقص را کامل نمايند. براي کودکتان اسباب بازي هايي بخريد که خودش بتواند آنها را به يکديگر متصل کند و با آنها مدلهاي مختلف خلق کند. برایش داستانی تعریف کنید و بگذارید پایان آن را با خلاقیت خود تمام کند.'),(1957,16,'content-8','علاوه بر مشاهده اشيا لازم است کودک آنها را لمس کند زيرا مشاهده شيء به تنهايی کنجکاوي او را ارضا نمي کند. کودکاني که از لمس کردن اشيا محروم مي شوند توانايي لازم جهت کشف و اختراع را از دست مي دهند. مشاهده همراه با لمس اشيا، آنها را در بازي هاي خيالي، اختراعات و پاسخ گويي به آزمونهاي خلاقيت ياري مي دهد. به کودکان اجازه دهيد وسايل بي خطر خانه را لمس کنند. آنها بيرون کشيدن وسايل آشپزخانه از داخل کابينتها و بازي با کاسه و قابلمه و بشقابها را بسيار دوست دارند . '),(1958,16,'content-9','حسن کنجکاوي در کودکان را پرورش دهيد. براي اين امر، هيچ چيز مثل پاسخ هاي صحيح و مناسب به پرسشهاي او موثر نيست. سؤال، در واقع انعکاس از ذهن تشنه اي است که مي خواهد با دريافت جواب از فردي که بهتر از او مي داند خود را سيراب کند، اگر چه احتياج، بايد فورا برآورده شود اما کمي مکث بين سؤال و جواب، غالبا مي تواند افکار و ايده اي مفيد جهت مباحثه و گفت‌و‌گو به بار آورد. زمانیکه کودک از شما سوال میپرسد از او بخواهید خودش درباره جواب کمی فکر کند و چیزی که به ذهنش میرسد را بیان کند. سپس او را راهنمایی کنید.'),(1959,16,'content-10','زمينه رشد خلاقيت در خانه زماني فراهم مي شود كه به كودكانتان آزادي زيادي بدهيد و به آنها به عنوان يك فرد احترام بگذاريد، از نظر عاطفي در حد اعتدال به آنها نزديك شويد و بر روي ارزشهاي اخلاقي و نه قوانين خاص تأكيد کنید. اگر یک روز بعد از ورود به آشپزخانه با این صحنه مواجه شدید که کودک شما ظروف داخل کابینت را بیرون آورده و مشغول بازی با آنهاست، او را تنبیه نکنید. اجازه دهید تحت نظارت شما و با خیال راحت دنیای اطرافش را کشف کند.'),(1960,16,'notification startup time','10:20'),(1961,1,'how to off','سرویس سیگنال موجود است : 30off'),(1962,9,'how to off','سرویس عطسه : 10off'),(1963,12,'how to off','سرویس آخرین اختراعات : 20off'),(1964,16,'how to off','سرویس غنچه های خلاق : 60off'),(1965,14,'how to off','سرویس کودک در جاده موفقیت : 50off'),(1966,1,'help','سیگنال موجود است : 30'),(1967,9,'help','عطسه : 10'),(1968,12,'help','آخرین اختراعات : 20'),(1969,16,'help','کودک در جاده موفقیت : 50'),(1970,14,'help','غنچه های خلاق : 60'),(1971,9,'question-150','انوره دو بالزاك: سعادت، بسته به کار و جسارت است! جلال تو آیتم \"ظرفها رو شستی\" قسمت 6 عطسه برای چی افسردگی گرفته بود؟\n1- چاقی\n2-سفید شدن موهاش\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا 1|۱'),(1972,9,'question-151','کریستوفرمارلو: دیدن و حس کردن، وجود داشتن است، زندگی در اندیشه است! نویسنده آیتم صف نمایشگاه کتاب قسمت 6 عطسه گفت چه کتابی به بازار عرضه کرده؟\n1- فرهنگ استیکر های تلگرام\n2- استیکر شناسی فیس بوک\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا 1|۱'),(1973,9,'question-152',' بالزاك: سعادت، بسته به کار و جسارت است! اسفندیار هوشمند قسمت 6 عطسه گفت در گذشته برای تفریح چطوری میرفته شمال؟\n1- سه ترکه با سی جی 125\n2- با اتوبوس\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا 1|۱'),(1974,9,'