,'answer-158','1|۱'),(2020,9,'answer-159','1|۱'),(2021,9,'answer-160','1|۱'),(2022,9,'answer-161','1|۱'),(2023,9,'answer-162','2|۲'),(2024,9,'answer-163','2|۲'),(2025,9,'answer-164','1|۱'),(2026,9,'answer-165','1|۱'),(2027,9,'answer-166','2|۲'),(2028,9,'answer-167','2|۲'),(2029,9,'answer-168','2|۲'),(2030,9,'answer-169','2|۲'),(2031,9,'answer-170','1|۱'),(2032,9,'answer-171','2|۲'),(2033,9,'answer-172','1|۱'),(2034,9,'answer-173','2|۲'),(2035,9,'answer-174','1|۱'),(2036,9,'answer-175','2|۲'),(2037,9,'answer-176','2|۲'),(2038,9,'answer-177','1|۱'),(2039,9,'answer-178','1|۱'),(2040,9,'answer-179','1|۱'),(2041,9,'answer-180','2|۲'),(2042,9,'answer-181','1|۱'),(2043,9,'answer-182','2|۲'),(2044,9,'answer-183','2|۲'),(2045,9,'answer-184','1|۱'),(2046,9,'answer-185','2|۲'),(2047,9,'answer-186','1|۱'),(2048,9,'answer-187','1|۱'),(2049,9,'answer-188','1|۱'),(2050,9,'answer-189','1|۱'),(2051,12,'content-11','مهندسان شرکتی در شیلی یک شارژر یو اس ‌بی تولید کرده‌اند که انرژی را از درون خاک جمع‌آوری کرده و با آن، تلفن همراه را شارژ می‌کند. یک گیاه می‌تواند تلفن همراه هوشمند را در 1.5 ساعت شارژ کرده یا برق لازم برای لامپ‌ها و سایر دستگاه‌ها را تأمین کند. نمونه پیش‌ساخت این فناوری که E-Kaia نام دارد، توسط اولین آراونا، کامیلا روپسیش و کارولینا گوئررو ساخته شده است.'),(2052,12,'content-12','دانشمندان آلمانی جوراب‌های مجهز به حسگر فشار برای نجات پای دیابتی‌ها طراحی کرده اند. جوراب ارائه ‌شده می‌تواند کاربر را از وجود فشار بر روی ناحیه خاصی از پا آگاه کرده و در پیشگیری از بروز زخم دیابت کمک کند. هر یک از لنگه‌های نمونه اولیه این جوراب از دو لایه پارچه مصنوعی/کتان جاذب رطوبت تشکیل شده که بین آ‌ن‌ها یک فیلم سیلیکونی کش‌آمدنی فشرده شده است.'),(2053,12,'content-13','محققان آمریکایی یک بطری آب طراحی کرده‌اند که در زمان احساس تشنگی کاربر، می‌درخشد. بطری هوشمند HidrateMe با استفاده از یک حسگر و برنامه تلفن هوشمند، به جای یک دوست کوچک آبرسان عمل کرده که مراقب سلامت فرد است.\nیک برنامه رایگان که با بلوتوث همگام‌سازی می‌شود، میزان آب مصرفی کاربر را پیگیری کرده و میزان نوشیدنی لازم برای وی را بر اساس فیزیک بدن مانند قد و ون و همچنین موقعیت، ارتفاع و رطوبت تخمین می‌زند.'),(2054,12,'content-14','محققان پس از مطالعه بر روی بهترین روش نجات جان شناگران، اولین نسل دستبند‌های مجهز به بالشتک ‌هوا برای شناور نگه‌داشتن افراد حادثه دیده را به بازار عرضه کردند. این دستبند سبک وزن به یک کیسه هوا و کارتریج تولید کننده گاز دی‌اکسیدکربن مجهز است که در هنگام خطر، کیسه‌هوا در کمتر از یک ثانیه از گاز دی‌اکسیدکربن پر شده و به حفظ شناگر در سطح آب کمک می‌کند.'),(2055,12,'content-15','گروهی از دانشمندان در آلمان عینک منحصر به فردی به نام ADAMAAS ویژه سالمندان ساخته اند که توانایی آنها را در انجام کارهای پیچیده مضاعف میکند. این عینک ضمن درک سطح سلامت جسمی و روحی کاربر و تشخیص کاری که در حال انجام آن است، کمکهای مشورتی لازم را در اختیار فرد سالمند قرار میدهد و از ارایه دستورالعمل پخت کیک تا کارهای پیچیده تری نظیر تعمیر دوچرخه و تمرینات یوگا کاربرد دارد.'),(2056,12,'content-16','محققان یک دستگاه ضبط صوت کوچک، خودکفا و با کیفیت بالا را طراحی کرده‌اند که می‌تواند به خبرنگاران و روزنامه‌نگاران برای ضبط راحت و با کیفیت صدا کمک کند. ضبط صوت Instamic با برخورداری از دو گیگا بایت حافظه داخلی، برای چهار ساعت ضبط صدا کاربرد دارد و از طریق USB شارژ می‌شود. این USB برای انتقال صدا نیز قابل استفاده است. ضبط صوت Instamic از طریق نرم‌افزار تلفن همراه نیز قابلیت استفاده و کنترل شدن دارد.'),(2057,12,'content-17','محققان موفق به ساخت هدبند متفاوتی به نام Muse شده اند که به کنترل امواج مغزی کاربر پرداخته و واکنش های متفاوتی را در برابر استرس وارد شده به شخص بروز می دهد. گجت Muse با نرم افزاری که Calm نامیده می شود و باید روی اسمارت فون یا تبلت ها نصب شود، ارتباط برقرار می کند و به کاربرانش اجازه می دهد تا از وضعیت خود اطلاع پیدا کنند. این گجت می تواند در آرامش و همینطور تمرکز بیشتر کاربران نقش به سزایی را ایفا کند.'),(2058,12,'content-18','محققان اجاقی هوشمند تولید کرده که به طور اتوماتیک غذایی که در آن قرار می‌گیرد را تشخیص می‌دهد و آن را کاملا می‌پزد. این اجاق که روی میز قرار می‌گیرد آنقدر بزرگ هست که بتوان یک پیتزا یا مرغ درسته را در آن قرار داد. این اجاق هوشمند یک صفحه نمایش 5 اینچی، ترازوی دیجیتالی و پردازنده Nvidia دارد. المنت‌های گرم‌کننده داخلی آن از فیبر کربنی ساخته شده و همچنین دارای قابلیت تنظیم وای‌فای را دارد.'),(2059,12,'content-19','کیبورد بلوتوثی جدیدی عرضه شده که به کاربران اجازه می دهد تا بدون هر گونه سختی به تایپ یا فعالیت هایی مانند کلیک، درگ، اسکرول و ... بپردازند. از دیگر قابلیت های این کیبورد بلوتوثی می توان کلیدهای پانتوگراف، بدنه آلومینیومی و همینطور صفحه تاشویی را نام برد که می تواند به عنوان پایه یک اسمارت فون مورد استفاده قرار گیرد. این کیبورد بلوتوثی با پلتفورم های اندروید، ویندوز و iOS سازگار است.'),(2060,12,'content-20','یکی از شرکت های تولید کننده تلفن همراه از عرضه تبلت های تاشویی خبر داده که همانند یک کاغذ تا می شوند تا نه تنها کاربران را در حمل یاری کنند بلکه بتوانند قابلیت های جدیدی را نیز پیش روی مخاطبان خود قرار دهند. این تبلت بدون اینکه  مشکلی پیدا کند به مراتب بیشتر از یک کاغذ تا می شود. این فناوری می تواند به سایر محصولات مانند تلویزیون ها یا اسمارت فون ها نیز وارد شود. '),(2061,12,'content-21','از این پس تشخیص ابتلا به ویروس HIV با استفاده از قطعه ای ارزان قیمت که به تلفن همراه متصل می شود با سرعت و دقت قابل توجهی انجام پذیر است. دانشمندان دانشگاه کلمبیا این قطعه جدید را با هدف تشخیص HIV در مراحل اولیه و کمک به توسعه سلامت در جوامع انسانی ساخته اند. در این فرآیند ساده و سریع نانوذرات طلا و نقره نیز نقش دارند که در نهایت نتایج بررسی نمونه خون به صورت خودکار در حافظه تلفن همراه هوشمند ذخیره می شود.'),(2062,12,'content-22','مخترعان به تازگی خودکار هوشمندی اختراع کرده اند که به وسیله آن میتوانید مطالبی که بر روی هر سطحی مینویسید را درون حافظه ی خودکار ذخیره کنید و از طریق email یا به وسیله ی بلوتوث این مطالب را به موبایل منتقل کنید و یا به شکل sms  برای دوستانتان ارسال کنید. این خودکار قابلیت اتصال به کامپیوتر را دارد و میتوانید اطلاعات ذخیره شده در حافظه آن را  بر روی حافظه ی کامپیوتر ذخیره کنید.'),(2063,12,'content-23','محققان موس پدی اختراع کرده اندکه میتواند در نقش برگه یادداشت باشد. این موس پد متشکل از یک قاب ساده از جنس پلاستيک فشرده است و غشایی شفاف و نازک سطح آن را پوشانده. برای نوشتن روی آن کافی است از فشار انگشتتان استفاده کنید و برای پاک کردن هم کافی است که کمی آن را خم کنید تا نوشته های روی آن غیب شود.'),(2064,12,'content-24',' جالب است بدانید به تازگی کیبوردی ضد آب و قابل شست و شو ساخته شده که خاصیت ضد میکروبی دارد و میتوانید بدون نگرانی آن را در سطلی از آب و صابون بشوئید و از تمیزی آن لذت ببرید!'),(2065,12,'content-25',' محققان محصول شگفت انگیزی تولید کرده اند که میتواند هر سطح صافی را تبدیل به یک کیبورد لمسی کند. نور این پروجکشن که از قابلیت اتوفوکوس هم بهره می برد تصویری ۱۰ اینچی را با کیفیت و رزلوشنی معادل WVGA بر روی سطوح منعکس می کند. ارتباط این وسیله با سایر دستگاه ها توسط WiFi و بلوتوث انجام می شود و می توان از این قابلیت برای اجرای دموها، منوی رستوران ها و... بهره برد. همچنین حافظه آن از طریق ورودی microSD ، تا ۳۲ گیگابایت قابل ارتقا می باشد.'),(2066,12,'content-26','یک شرکت لباس خواب ویژه طراحی کرده که می تواند ضربان قلب، حرکات و وضعیت عاطفی کودک را تحت نظر داشته باشد. این گجت مخصوص مادرهای نگران است! ‏در نقاط مختلف این لباس سنسورهایی تعبیه شده که می تواند فعالیت های حیاتی کودک را بررسی کرده و برای والدین ارسال کند. این لباس خواب می تواند به شبکه موبایل هم وصل شده و روی گوشی تلفن همراه وضعیت فعلی کودک را نشان دهد.‏ \n‏ '),(2067,12,'content-27',' محققان خط کش هوشمندی ساخته اند که از دو قطعه تشکيل شده و انگشت دست همانند انگشتانه خیاطی به راحتی در آن فرو می رود. برای استفاده از اين خط کش کافی است که اين قطعات را پوشیده و فاصله مورد نظر را با دست اندازه گیری کرد. اندازه مورد نظر به طور اتوماتیک بین دو قطعه که در واقع فاصله بين دو انگشت دست است در مقیاس متريک و یا مقایس های دیگر محاسبه شود و بر روی یک صفحه نمایشگر OLED نمایش داده می شود.'),(2068,12,'content-28','محققان آینه ای تولید کرده اندکه قابلیت اتصال به وای فای دارد! این آینه در ابعاد ۵۰×۵۰۰×۸۰۰ میلی متر با شیشه ضد گرد و غبار و به همراه دو اسپیکر با قدرت خروجی ۱۰ وات ساخته شده است. همچنین احتمالا قابلیت اجرای آندروید را دارد و قادر به دریافت و نمایش اطلاعاتی همچون ایمیل های دریافتی، وضعیت هوا، تقویم و اجرای نرم افزارها نیز می باشد. جالب اینکه این آینه به نرم افزاری برای کنترل وزن نیز مجهز است.'),(2069,12,'content-29','محققان ژاپنی یک باطری کوچک ساخته اند که انرژی خودش را از طریق انرژی جنبشی تامین می کند. این باطری نسبت به تمام مدل های مشابه بهتر بوده و قادر است ۲۲ میلی وات انرژی تولید کند که نسبت به مدل های مشابه ۲۰ برابر بهتر عمل می کند.  برای تامین شارژ باطری، تنها کافی است باطری تکان بخورد تا انرژی تولید کند.\n‏'),(2070,12,'content-30','دانشجویی در استرالیا نوعی از الیاف را برای ساخت بانداژها ابداع کرده است که می توانند با تغییر دما رنگ خود را عوض کنند. این بانداژها که از فیبرهای ترموکروماتیک (رشته هایی که با تغییر دما، رنگ می گیرند) ساخته شده اند قادر هستند تغییرات دما در حد نیم درجه سانتی گراد را هم تشخیص داده و تغییر رنگ بدهند که می توان از آنها برای تشخیص تغییرات حرارت در زخم ها که ناشی از اختلال خون رسانی در محل زخم، یا ایجاد التهاب یا عفونت هستند استفاده کرد. ‏'),(2071,12,'content-31','مرکز تحقیقاتی نظامی ای در گوشه ای از جهان کمربندی لرزشی ساخته که به نظامیان کمک می کند تا در تاریکی راه خود را پیدا کنند. این کمربند از یک شتاب سنج و قطب نمای دیجیتال تشکیل شده و همین اجزا به نظامیان در تشخیص مسیر درست کمک می کنند. \n '),(2072,12,'content-32','یک دانشجو نوعی آینه پزشکی را طراحی کرده است که با استفاده از تجزیه و تحلیل اجزای صورت می تواند ضربان قلب را اندازه گیری کند. عملکرد این دستگاه به این ترتیب است که فرد با استفاده از یک وب کم که پشت شیشه آینه قرار گرفته، میزان نوری را که از صورتش تابانده می شود، اندازه گیری کرده و با استفاده از آن ضربان قلب را اندازه می گیرد.'),(2073,12,'content-33','عینکی توسط شرکت گوگل طراحی شده که برای یافتن مسیر صحیح حرکت بدون نیاز به استفاده از رایانه و گوشی به خوبی قابل بهره برداری است. این عینک دارای طراحی ساده‌ای است و به میکروفون و یک نمایشگر نیمه‌ شفاف کوچک که اطلاعات را در برابر چشم راست کاربران قرار می‌دهد، مجهز شده است. نمایش اطلاعات هواشناسی، استفاده از سرویس نقشه‌خوان گوگل، یادآوری برنامه روزانه و ... از قابلیت های این عینک هوشمند است.'),(2074,12,'content-34','دو دانشجوی ایتالیایی میز مدرسه مقاوم در برابر زلزله‌ طراحی كرده اند كه علاوه بر ایجاد سرپناه مناسب هنگام وقوع زلزله، می‌تواند به عنوان تونل نجات برای ورود نیروهای امدادی و كمك به دانش‌آموزان گرفتار در زیر آوار نیز استفاده شود. در هر چهار گوشه میز، بخش‌های تاشو در نظر گرفته شده كه فشار ناشی از ضربه را به جای بخش وسط میز، به اطراف منتقل می‌كند.'),(2075,12,'content-35','به تازگی کفش‌ هایی تولید شده که دیگر با آنها گم نخواهید شد! یک مسیریاب جی.پی.اس در نوک این کفش به‌کار رفته و آنتن آن نیز در انتهای کفش قرار گرفته است. ال.ئی.دی‌های تعیین مسیر و جهت‌دار نیز در قسمت جلو و بر روی قسمت بالایی انگشتان پا دیده می‌شوند. قبل از پوشیدن این کفش کافیست مقصد خود را در آن مشخص کنید!'),(2076,12,'content-36','پژوهشگران دانشگاه توکیو موفق شده‌اند تصاویری را بر روی یک حباب صابون پخش کنند. به گفته این دانشمندان در حالت معمولی سطح بیرونی حباب صابونی قادر به انعکاس نور‌ها و تصاویر نیست. آن‌ها برای حل این مشکل سطح بیرونی حباب‌های صابون را در معرض امواج مافوق صوتی قرار دادند که از چند بلندگو پخش می‌شد. امواج مافوق صوت، تنیدگی متراکم غشای بیرونی حباب را کاهش می‌دهد و بافت ماتی به آن می‌بخشد که قابلیت انعکاس نور و تصاویر را داراست. '),(2077,12,'content-37','محققان موفق به ابداع سیستمی شده‌اند که بر اساس ضربان قلب، موسیقی مناسب را هنگام ورزش کردن پخش می‌کند. این محققان میکروفونی را در هدفون‌های دستگاه نصب کرده‌اند که ضربان شریان موجود در گوش فرد را می‌سنجد. این داده‌ها در ترکیب با سطوح فعالیت، با استفاده از یک شتاب‌سنج، از طریق اینترنت، به یک موتور پیشنهادی ارسال شده و آهنگ بعدی را بر اساس ضربان قلب کنونی و حالت دلخواه انتخاب می‌کند.'),(2078,12,'content-38','مبتکران اجاقی طراحی کرده اند که با سوزاندن چوب روشن می شود و می تواند تلفن همراه را نیز شارژ کند. این اجاق را می توان با تکه های چوب، میوه کاج و زیست توده روشن کرد. این اجاق در حالی که می تواند غذا بپزد یا آب را گرم کند، گرما و انرژی کافی را نیز برای شارژ یک تلفن همراه، چراغ قوه و یا گجت هایی که پورت USB دارند تولید می کند.'),(2079,12,'content-39','محققان موفق به مشاهده حرکت افراد از پشت دیواری به ضخامت ۳۰‌ سانتی‌متر با استفاده از تکنولوژی وای فای شدند. برای دستیابی به این تکنولوژی از ترکیب سیگنال های رادیویی وای فای و یکی از قوانین فیزیک استفاده شده است. فرکانس موج فرستاده شده هنگام برخورد با مانع و بازتاب تغییر می‌کند. تغییر فرکانس به کمک دستگاه جدید خوانده شده و زمان حرکت، سرعت حرکت، محل و جهت فرد در حال حرکت در آن طرف دیوار محاسبه می‌شود.'),(2080,12,'content-40','پوشش جانبی منحصر به فردی برای گوشی عرضه شده که به راحتی قابل خوردن است! این پوشش هم از گوشی محافظت می‌کند و هم گرسنگی مالک گوشی را رفع می‌کند! پوشش یاد شده از نمک و برنج سبوس دار ساخته شده و در واقع نوعی کلوچه برنجی است که به گونه‌ای طراحی شده تا بتواند دور تا دور گوشی را بپوشاند. '),(2081,12,'content-41','محقق یک شرکت بازاریابی سیستمی را طراحی کرده که برای جمع‌آوری داده‌ها به شکل کتاب و به طور خودکار از یک الگوریتم استفاده می‌کند. سیستم جدید که فراتر از یک موتور جستجوی هوشمند است، فقط به چند دقیقه یا چند ساعت برای اسکن پایگاه داده‌های مرتبط با هر موضوع و سازماندهی آن‌ها به شکل یک گزارش تخصصی نیاز دارد. وی الگوریتم مزبور را برای دنبال کردن مسیری که یک متخصص در نوشتن گزارش خلاصه‌یی از یک موضوع مملو از داده طی می‌کند، طراحی کرده است.\n'),(2082,12,'content-42','نمایشگاه کالاهای مصرفی الکترونیکی، یک تلفن همراه کم قدرت اضطراری را معرفی کرده که با باتری قلمی که رایج‌ترین پیل در جهان است، شارژ می‌شود. بنا بر اعلام شرکت سازنده این تلفن همراه، کافیست کاربران یک پیل قلمی را در پشت تلفن همراه قرار داده و تا 10 ساعت با آن مکالمه کنند. به گفته شرکت سازنده، ایده ساخت این تلفن همراه جایگزین کردن آن با تلفن‌های هوشمند نبوده، بلکه به عنوان یک تلفن اضطراری و دوم برای کاربرد خارجی یا در سفر معرفی شده است.'),(2083,12,'content-43','مبتکران چنگالی اختراع کردند که از حسگرهای الکترونیکی برای بررسی میزان و سرعت غذا خوردن کاربر استفاده می‌کند. اگر فرد به سرعت غذا بخورد، این چنگال شروع به لرزش کرده و نورهای درخشان روی دسته آن روشن می‌شوند. این فناوری بطور بی‌سیم به تلفن کاربر متصل بوده و می‌تواند عادات غذایی وی را به یک برنامه خاص ارسال کند. '),(2084,12,'content-44','دانشمندان با کمک نیروی مغناطیسی موجود در آهنربا توانستند شیوه جدیدی برای شارژ کردن گوشی های هوشمند و تبلت ها ابداع کنند. شارژرها از طریق القا به کمک میدان های مغناطیسی  قدرت بسیار بالایی دارند، ولی در عین حال برد کمی نیز دارند و آهنرباها در شارژ کردن گوشی های موبایل بسیار کاربردی می باشند. '),(2085,12,'content-45','دانشمندان به تازگی موفق شده اند از متامواد(فرا ماده) برای ساخت یک سیستم تصویربرداری استفاده کنند که دیگر نیازی به لنز ندارد. این حسگر از نور فروسرخ و مایکروویو نمونه برداری می کند و تصاویر گرفته شده را فشرده می سازد. در حال حاضر این سیستم تصویربرداری می تواند ۱۰ تصویر در ثانیه بگیرد و اطلاعات را به محض دریافت فشرده سازی کند.'),(2086,12,'content-46','فانوس انرژی خورشیدی شبیه یک بالش استوانه ای است و زمانی که در آن را باز کرده و داخل آن هوا می دمید این بالش پر شده و باد می شود. داخل این فانوس تعدادی دیود جذب نور وجود دارد که نور روشن سفید- آبی از آن تابیده می شود. این دستگاه به سادگی با قرار گرفتن معکوس در مقابل آفتاب شارژ می شود. این فانوس به قدری روشن است که می تواند یک اتاق کوچک را درخشان جلوه دهد و یک چراغ مطالعه عالی قلمداد شود.'),(2087,12,'content-47',' یک شرکت کامپیوتری برنامه‌ای را معرفی کرده که به فرد اجازه می‌دهد از وجود مردم به عنوان دستگاه خودپرداز متحرک استفاده کند! کاربرد این برنامه به این صورت است که فرد به محض اینکه پول مورد نیاز خود را درخواست کند، این نرم‌افزار از جزئیات موقعیت مکانی او استفاده کرده و درخواستش را برای تمام افراد برخوردار از آن برنامه ارسال می‌کند تا افراد نزدیک به او نیاز فرد را برطرف کنند!'),(2088,12,'content-48','برنامه ای برای کاربران اسمارت فون ها عرضه شده که با استفاده از آن می توانند در حین صحبت کردن به یادداشت برداری نیز بپردازند. این اپلیکیشن قابلیت های جدیدی را در اختیار کاربرانش قرار می دهد که با استفاده از آن و در موقعیت های مختلف می توانند به یادداشت برداری پرداخته و نیاز به داشتن قلم و کاغذ برای همیشه فراموش شود. '),(2089,12,'content-49',' ابتکار جدید ژاپنی ها ساخت چراغ قوه ای است که در هنگام زلزله مردم را آگاه می کند. این امر از طریق امواج رادیویی انجام می گیرد و با صدایی مخصوص لرزشهای کوچک لایه های داخلی را هم اطلاع رسانی می کند. این چراغ قوه می تواند 14 ساعت درخود شارژ را نگه دارد و با رابط مخصوص با موبایل هم شارژ می شود.\n'),(2090,12,'content-50','صندلی ای در آلمان طراحی شده که با ارائه نصیحت‌هایی در خصوص سلامتی از افراد مسن مراقبت می‌کند و با حسگرهایی که دارد میزان ضربان قلب و اشباع اکسیژن را در کاربر اندازه می‌گیرد. همچنین ماشین پاروزنی در آن گنجانده شده که امکان تمرین کردن فرد را فراهم می‌کند. یک تبلت که به صورت بی‌سیم به صندلی متصل است، داده‌های لازم در مورد میزان نبض، اشباع اکسیژن خون، فشار خون و وزن فرد را به تلویزیون مخابره می‌کند.'),(2091,12,'content-51','پژوهشگران دستگاهی ساخته اند که تلفن همراه را با یک فنجان چای داغ یا یک لیوان نوشابه سرد شارژ می‌کند. شرکت سازنده این دستگاه مدعی است، این فناوری، گرمای چای داغ یا سرمای نوشابه خنک را به برق مورد نیاز برای تلفن همراه تبدیل می کند. این دستگاه سبک وزن دو طرفه، قابل حمل و نقل است و می توان به راحتی آن را داخل کیف گذاشت. همچنین این دستگاه دارای درگاه USB است و می توان از طریق اتصال وسایل الکترونیکی شارژ مورد نیاز آنها را تامین کرد.'),(2092,12,'content-52','شرکت اینتل دستگاه تلویزیونی اختراع کرده است که می تواند تشخیص دهد که مخاطب تلویزیون درحال حاضر مشغول انجام چه کاری است تا متناسب با کاری که انجام می دهد، یک آگهی تبلیغاتی پخش کند. مایکروسافت هم اخیرا یک درخواست ثبت اختراع فناوری برای حسگر حرکتی کینکت خود ارائه کرده که می تواند تشخیص دهد چند نقر در مقابل تلویزیون نشسته اند و اگر متوجه شود که تعداد افراد از آنچه که باید باشد بیشتر است، کار خود را متوقف می کند. '),(2093,12,'content-53','صدای تولید شده در کم صداترین رایانه جهان کمتر از 11 دسی بل معادل یک دسی بل بالاتر از آستانه شنوایی انسان است! در این رایانه از نسل سوم پردازنده چهار هسته ای استفاده شده که حتی در صورت استفاده از برنامه هایی سنگینی مانند Photoshop‌ و Adobe Premiere هیچ صدایی از فن های دستگاه شنیده نمی شود. برای فن سی پی یو از فن خنک کننده فوق آرام و بی صدای  استفاده شده است و تنها صدای تولید شده، یک بوق کوچک در هنگام بوت شدن سیستم است.'),(2094,12,'content-54','محققان آلمانی دستکش هوشمندی طراحی کرده‌اند که با کمک چندین حسگر، قادر به رهگیری حرکات دست و تشخیص حروف نوشته شده در هواست. سیستم دستکش تایپ airwriter با رهگیری وضعیت و حرکات دست کاربر، کلمه نوشته شده در هوا را تشخیص داده و می تواند برای تایپ متون در رایانه یا نوشتن پیام کوتاه یا ایمیل در تلفن همراه بدون نیاز به استفاده از صفحه کلید مورد استفاده قرار گیرد.'),(2095,12,'content-55','یک شرکت، تلفن همراهی با قیمت بسیار پایین معرفی کرده است که تنها یک ویژگی دارد و آن هم عمر یکماهه باطری این دستگاه است. این تلفن غیر هوشمند یک صفحه 1.45 اینچی با وضوح تصویر 128 در 128 و 8 مگابایت حافظه داخلی دارد و فاقد دوربین است! وقتی که این تلفن کامل شارژ داشته باشد می توانید 12.5 ساعت با آن مکالمه کنید و یا شارژ آن را 35 روز یا 842 ساعت نگاه دارید.'),(2096,12,'content-56','یک شرکت عصای هوشمندی برای پیشگیری از گم شدن افراد سالمند تولید کرده که قادر به رهگیری آنلاین موقعیت و بررسی علائم حیاتی آنان است. بر روی این عصا که امکان برنامه ریزی حرکت در یک مسیر مشخص برای سالمند را فراهم می کند؛  حسگرهای تعبیه شده که ضربان قلب را اندازه گیری می کنند و در صورت بروز هرگونه مشکل برای سالمند، دستگاه به طور خودکار با مراکز اورژانس و امدادی تماس گرفته و موقعیت دقیق کاربر را مشخص می کند.'),(2097,12,'content-57','یک مبتکر کلاهی مجهز به هدست ضد آب ساخته که به وسیله آن هم می توانید آهنگ گوش کنید و هم هنگام زنگ خوردن گوشی خود، مکالمه تلفنی داشته باشید. کاربر از طریق اتصال بلوتوث می تواند بعنوان هدست از طریق این کلاه برای صحبت کردن با گوشی تلفن همراه خود استفاده کند و همچنین از طریق بی سیم یا بلوتوث به موسیقی مورد علاقه خود گوش کند.'),(2098,12,'content-58','شخصی خلاق یک موس بی سیم به همراه پد آن را طراحی کرده که روی یک حلقه مغناطیسی به صورت معلق روی هوا می ایستد! یکی از دلایل طراحی این نوع موس جلوگیری از سندرم Median nerve palsy  است که برخی کاربران به آن دچار شده و این نوع موس می تواند جلوی چنین بیماری را بگیرد. (یکی از علائم این بیماری فشار روی عصب میانی دست است که درد به مچ دست هنگام کار با کامپیوتر منتقل می کند و منجر به کرختی احساس سوزن سوزن شدن دست و آسیب عضلانی به انگشتان دست می شود)'),(2099,12,'content-59',' یک شرکت بزرگ تولید کننده گوشی موبایل، گوشی جدیدی با قابلیت شناسایی مسیر حرکت چشم روی نمایشگر تولید کرده است. این گوشی می‌تواند مسیر حرکت چشم‌ شما را دنبال کند تا زمانی که در حال مطالعه یک صفحه هستید و به پایین صفحه می‌رسید، به‌طور خودکار صفحه را به سمت بالا حرکت دهد و به شما امکان می‌دهد که بدون استفاده از انگشت یا بخش حرکت دهنده صفحه با حرکت چشم به پاراگراف بعدی بروید.'),(2100,12,'content-60','یک شرکت اروپایی، ایستگاه شارژ تلفن همراه خورشیدی را معرفی کرده که با پیامک برای کمک به ساکنان مناطق روستایی که برق بطور نامنظم وجود داشته، فعال می‌شود. مهمترین بخش این دستگاه، شیوه‌ای است که برق ذخیره شده برای شارژ یک تلفن همراه را آزاد میکند. به این صورت که مصرف‌کننده یک پیامک ارسال می‌کند سپس با دریافت این پیام، یک چراغ ال‌ای‌دی بر روی یک پریز در پیل روشن شده و آمادگی خود برای شارژ تلفن را نشان می‌دهد. '),(2101,12,'content-61','یک شرکت دستگاهی برای خودرو تولید کرده که در صورت نصب روی خودرو دیگر نمی توان هنگام رانندگی پیامک ارسال کرد! کاربر برای راه اندازی و حرکت خودرو نیاز دارد تا ابتدا تلفن همراه خود را درون این دستگاه قرار داده و سپس اقدام به روشن کردن خودرو نماید. این دستگاه می تواند تلفن همراه را شارژ کرده و از طریق ارتباط بلوتوث با سیستم صوتی خودرو مکالمات صوتی برقرار کند.'),(2102,12,'content-62','یک سازنده بزرگ لوازم الکترونیکی از نمایشگر جدیدی رونمایی کرده که به ادعای سازندگان، شناسایی آن در اتاق‌های پذیرایی مشکل خواهد بود. تلویزیون جدید  به شکلی طراحی شده که در زمان عدم استفاده ناپدید می‌شود! این تلویزیون از یک ورق شیشه بدون درز ساخته شده و در زمان خاموش بودن شبیه یک پنجره سیاه است. این تلویزیون از گردن، پایه و چارچوب قابل مشاهده بی‌بهره است و تنها یک ورق شیشه بدون درز است که به دیوار تکیه داده می‌شود.'),(2103,12,'content-63','بعضی وقت ها نیاز دارید از نوشته های خود یک کپی تهیه کنید! با ساخت خودکاری که قابلیت ذخیره اطلاعات را داراست دیگر برای کپی گرفتن از مطالب نوشته شده خود نیاز به دستگاه کپی یا اسکنر ندارید!  این خودکار به وسیله لیزر تعبیه شده در نوک آن کل مطالب نوشته شده را ذخیره می کند و با بلوتوث یا  USB به کامپیوتر منتقل می نماید!'),(2104,12,'content-64','محققان ژاپنی یک نمایشگر قابل بوییدن ابداع کرده اند که کاربر نه تنها امکان تماشای آن را دارد بلکه می تواند قهوه یا غذای نمایش داده شده بر روی آن را ببوید! این فناوری با تغذیه مداوم بو از گلوله های ژل تبخیر شونده به چهار جریان هوایی که هر یک در گوشه ای از نمایشگر قرار دارند، کار می کند.'),(2105,12,'content-65','محققان متر هوشمند بی‌سیمی طراحی کرده اند که میزان مصرف برق دستگاه های مختلف را اندازه گیری کرده و به کاهش هزینه برق مصرفی کمک می کند. این دستگاه هوشمند ارزان قیمت مجهز به حسگرهای EMF‌ است که با استفاده از یک شبکه بی سیم، اطلاعات روشن و خاموش شدن وسایل برقی مختلف را به سیستم مانیتورینگ مرکزی برق خانه ارسال می کند. دقت عملکرد متر هوشمند مجهز به حسگرهای EMF حدود 98 درصد اعلام شده است.'),(2106,12,'content-66','یک تیم دانشجویی عینکی منحصر به فرد طراحی کرده‌ که نابینایان را قادر می‌سازد در کتابخانه قدم بزنند، یک کتاب را بردارند و آن را بخوانند! این عینک به راحتی قابل حمل بوده و می‌تواند بدون اتصال به اینترنت عمل کند و جوهر چاپ شده را تشخیص دهد. پیش بینی شده نسخه‌های آتی این عینک به کاربران امکان شنیدن اطلاعات به یکی از چندین زبان موجود را خواهد داد.'),(2107,12,'content-67',' شرکتهای فناوری نوعي فلش مموری فوري ساخته اند که در اندازه يک کارت تلفن طراحي شده و 4 عدد حافظه فلش در آن تعبيه شده است که کاربر در هنگام نياز فوري مي‌ تواند يکي از آن‌ها را از بقيه جدا کرده و استفاده کند. جنس اين محصول 4 گيگابايتي 100 درصد قابل بازيافت بوده و از خمير کاغذ است!'),(2108,12,'content-68','دانشمندان ابزار جدیدی طراحی کرده‌اند که آتش را به یک منبع نیرو برای تلفن‌های همراه تبدیل می‌کند! کلید اصلی فعالیت این ابزار یک سلول سوختی است که توسط آتش فعال می‌شود. تلفن همراه از طریق یک سیم واقع در انتهای این سلول شارژ می‌شود. با استفاده از اکسیژن موجود در هوا، سلول سوختی به کربن سوزان و زیست توده هیدروژن به الکتریسیته تبدیل می‌شوند. '),(2109,14,'content-11','حتما شما هم وسایلی دارید که برایتان بسیار با ارزش است و دوست ندارید که آنها را در اختیار دوستانتان قرار دهید، پس چرا از کودک توقع دارید اسباب بازی ها یا سایر وسایل مورد علاقه اش را با دیگران قسمت کند؟!  اگر کودک به اسباب بازی یا کتاب خاصی علاقه زیادی دارد، او را مجبور نکنید که آن را به دیگران بدهد. اما در عین حال او را متوجه کنید که نباید وسایل مورد علاقه اش را در حضور دوستانش بیرون بیاورد.'),(2110,14,'content-12','جبران کردن را به کودک خود بیاموزید. به کودکتان کمک کنید احساس پشیمانی خود را فراتر از کلمات نیز بیان کند. برای مثال اگر یکی از اسباب بازی های برادرش را شکسته است، اجازه دهید از پول تو جیبی خودش استفاده کند و برای او اسباب بازی جدیدی بخرد. و یا اگر خواهر خود را ناراحت کرده است، به او بگویید اسباب بازی مورد علاقه اش را یک روز برای بازی در اختیار او قرار دهد. این نوع جبران ها، به کودک می‌آموزد که چطور باید مسئولیت رفتارش را برعهده بگیرد.'),(2111,14,'content-13','کودکان به آنچه که والدین انجام می دهند، توجه ویژه ای دارند، پس اجازه بدهید کودک شما را در حال مشارکت ببیند. مثلا اگر در حال خوردن ساندویچ هستید، از کودک سوال کنید که آیا تکه ای از آن را می خواهد؟ شما و همسرتان حتی باید توجه کودک را به اینکه چگونه می توان با دیگران مشارکت کرد نیز جلب کنید. مثلا  انتخاب نوبتی فیلمی که قرار است در سینما ببینید یا تقسیم فضا برای وسایل شخصی در حمام می تواند چگونگی مشارکت و تقسیم کردن را به کودک بیاموزد.'),(2112,14,'content-14','ممکن است بعضی از والدین تصور کنند که دروغ گفتن در ذات بچه است و این وظیفه والدین است که برای اینکه جلو عادت شدن آن را بگیرند، آنها را برای دروغگویی شان تنبیه کنند. واقعیت این است که خیلی وقت ها خود والدین زمینه را برای دروغگویی فرزندشان ایجاد می کنند. اگر با فرزندانتان خشن برخورد کرده و بخواهید تنبیه شان کنید، از اینکه واقعیت را به شما بگویند میترسند. اگر احساس امنیت کنند، صادق خواهند بود.'),(2113,14,'content-15','سعی کنید به جای امر و نهی و آموزش چگونگی انجام یک کار، از راه های غیر مستقیم وارد عمل شوید. یکی از ساده ترین راه ها برای کمک به پرورش قدرت تصمیم گیری در کودکان خردسال این است که شما برای امور مختلف همواره چند گزینه که از نظرتان درست است به کودک پیشنهاد دهید و بگذارید خودش هر چه را صلاح می داند انتخاب کند. این روش باعث می شود هم نظر شما تامین شده باشد و هم کودک بداند می تواند تصمیم گیر و از آن مهم تر تصمیم ساز باشد.'),(2114,14,'content-16','در روزهای تعطیلی سال نو، رفت و آمدها بسیار زیاد می شود. خانواده ها و دوستان دور هم جمع می شوند، افراد در مهمانی ها شرکت می کنند، یا ممکن است چند مهمان در خانه داشته باشند. رو به رو شدن با اینها می تواند برای کودکان خجالتی بسیار دشوار باشد. برای آنچه به نظر برای کودکتان مناسب می رسد برنامه ریزی کنید و پیش از هر برنامه راهکارهایی را برای کنار آمدن با مشکلات در نظر بگیرید.'),(2115,14,'content-17','کودک باید بداند مرزها و فاصله ها را رعایت کند. هر کسی باید در تخت خودش بخوابد، هرکسی باید کمد و کشو لباس و کیف خودش را داشته باشد، هر کسی باید منتظر باشد تا دیگران از حمام بیرون بیایند تا بتواند از حمام استفاده کند، وقتی کنار کسی روی مبل می‌نشینیم نباید خیلی به او بچسبیم، وقتی نقاشی می‌کشی از خط بیرون نزن یا میز و فرش را خط‌خطی نکن! این ها قوانینی هستند که به کودک کمک می‌کند جدایی امور و اشیا از هم را درک کند.'),(2116,14,'content-18','برای کودکتان مقرر نمایید که کارهای لازم روزانه باید قبل از بازی کردن انجام شوند! شما با لطیف برخورد کردن با کودکتان در حق کودک خود لطف نمی کنید. پژوهش ها نشان میدهد جدی بودن برای انجام کارهای روزمره و مسئولیت ها در کودک به بر عهده آمدن بر مشکلات منجر می شود. انجام کارهای ساده ای در خانه مثل گذاشتن اسباب بازیهای در جای خودش و یا کمک به تمیز کردن نامرتبی هایی که کودک ایجاد کرده را به خودش بسپارید.'),(2117,14,'content-19','به کودک خود اجازه دهید برای چیزی که می خواهد تلاش کند!\nبسیاری از متخصصین بر این باورند که اگر کودکان چیزهایی که می خواهند را به آسانی بدست آورند لوس می شوند. اگر کودک شما یک اسباب بازی جدید می خواهد، یک سیستم جایزه دهی در برابر رفتار خوب برای او در نظر بگیرید و کم کم و در قالب جایزه رفتار خوب، آن اسباب بازی را برای او تهیه نمایید.'),(2118,14,'content-20','به فرزند خود بیاموزید که حرف‌های خانه مال خانه است، حتی در خانه مادربزرگ و خاله نباید گفته شوند. اما اتفاقاتی که در مهدکودک یا مدرسه افتاده، بهتر است در خانه گفته شوند. حرف‌هایی در دلمان یا سرمان داریم که به کسی نمی‌گوییم یا درباره‌اش با \"همه\" حرف نمی‌زنیم، چون ممکن است کسی \"ناراحت و دلخور\" شود.  بعضی وقت‌ها هم رازهایمان برای خوشحال کردن بقیه است.'),(2119,14,'content-21','آموزش صداقت به کودکان مستلزم صرف وقت و شکیبائی است. قطعا شما دوست دارید فرزندتان صادق باشد تا اینکه تقلب کند، دروغ بگوید، پنهان کاری یا دزدی کند. والدین می‌توانند با تشویق کودک به راست گوئی و گفتن آن‌چه که واقعاً دیده‌، صداقت را در او پرورش دهند. هنگامی که کودکتان با همبازی هایش دعوا میکند و موضوعی او را میرنجاند از او بخواهید آنچه را که اتفاق افتاده در ذهنش تجسم و برایتان بازگو کند.'),(2120,14,'content-22','دیگر وقت آن رسیده تا مسئولیت انجام برخی کارها را به فرزندتان بسپارید! مثلا از او بخواهید خودش لباس‌هایش را که برای شستشو کنار گذاشته بررسی کند و جیب‌ها و پاکت‌ها را بگردد. قبل از نظافت میز و زیر میز اتاقش از او بخواهید خودش کاغذهای باطله را کنترل کند و دورریختنی‌ها را داخل سطل زباله بیندازد. به او یادآور شوید تا هربار لیوان یا ظرفی از خوراکی را به اتاقش برد، خودش آنها را به آشپزخانه برگرداند و منتظر نشود که شما این کار را برایش انجام دهید!'),(2121,14,'content-23','یاد دادن به فرزند برای این که پولش را جمع کند، کار سختی نیست. آنچه سخت است آموزش برقراری تعادل میان خرج و ذخیره کردن آن است. اگر شما تمام پول‌تان را ذخیره کنید، لذت زندگی را از یاد خواهید برد. شما باید به کودکتان یاد دهید که پول‌اش را ذخیره و به همان نسبت از خرج کردن آن لذت ببرد. تنها قانونی که هر کسی باید درباره پول بداند این است که برای پولدار شدن باید از آنچه در می‌آوریم، کمتر خرج کنیم.'),(2122,14,'content-24','به فرزندتان نشان دهید که تاکیدتان بیشتر بر صداقت اوست تا بر تنبیه به خاطر بی صداقتیش! میتوانید برای دروغ فرزندتان عواقبی در نظر بگیرید اما لازم است که برایش توضیح دهید که راستگویی هم فوایدی برای او خواهد داشت. اگر بخواهید به زور تهدید و تنبیه حرف راست را از دهان او بیرون بکشید، مطمئن باشید که دفعه بعدی حقیقت را نخواهد گفت. '),(2123,14,'content-25','زندگی آسان‌تر می‌شد اگر کودکان‌مان همیشه با شادی از درخواست‌های ما پیروی می‌کردند، اما این ذات انسان نیست. به یاد داشته باشید که وقتی کودک‌تان با خواسته شما مخالفت می‌کند، نمی‌خواهد بی‌احترامی کند، تنها عقیده دیگری دارد. به او یاد بدهید که خیلی بهتر است احساساتش را محترمانه بروز دهد. برای نمونه به جای این که بگوید \"تو مامان بدی هستی، هیچ وقت مرا پارک نمی‌بری، بگوید می‌شود بعد از فروشگاه به پارک برویم؟\"'),(2124,14,'content-26','زمانی که فرزند شما به سن چهار یا پنج سال می رسد، شاید شما آسوده تر شوید، زیرا کودک به سنی رسیده که قدرت تشخیص برخی از خطرها را دارد. کودکان در این سن می توانند به تنهایی راه بروند، بازی کنند. از این رو آگاه کردن کودکان از خطرات اطرافشان مساله ای ضروری است، اما این آگاه کردن و آموزش نباید به گونه ای باشد که بیشتر موجب ترس کودک شود، زیرا این ترس می تواند کودک را منزوی و پریشان کند.'),(2125,14,'content-27','این یک واقعیت است که بچه ها هر چقدر هم اسباب بازی و وسایل مختلف برای بازی داشته باشند باز هم با دیدن یک جارو به ذوق می آیند و آن را به تمام اسباب بازی های شان ترجیح می دهند. ​پس چرا شما از این ویژگی کودکان استفاده نمی کنید؟ البته مسلما بچه ها نه می توانند و نه باید در تمیز کردن خانه و جارو کشیدن، کار خیلی خاصی انجام دهند ولی می توان آنها را در انجام چنین کارهایی سهیم کرد.'),(2126,14,'content-28','هنگام انداختن عکس یا گرفتن فیلم از کودکمان از او اجازه بگیریم! چنانچه می‌خواهیم در محیط‌های مجازی منتشرش کنیم، به او نشان دهیم و با موافقت او این کار را انجام دهیم. (آیا اطمینان دارید فرزندتان چند سال دیگر از این‌که تعداد پوشک‌های مصرفی نوزادی‌اش را، در وبلاگی که از بدو تولدش ساخته‌اید، به اطلاع سایرین رسانده‌اید از شما تشکر می‌کند؟) مهم‌تر این‌که در مقابل کودک بدون اجازه، از دیگران هم عکس و فیلم تهیه نکنیم!'),(2127,14,'content-29','یکی از مهم‌ترین تدابیر والدین در سنین بلوغ فرزندانشان باید محکم ساختن حریم خصوصیشان باشد‌! فرزندان با قرار گرفتن در سن بلوغ حساس شده و کوچک‌ترین تغییرات رفتاری والدین خود را حس می‌کنند‌. محافظت کامل‌تر و بیشتر از روابط و حریم خصوصی والدین در زمان بلوغ فرزندان باعث می‌شود که آن‌ها با سلامت روحی این مرحله از رشد را پشت‌سر بگذارند و گرفتار بدآموزی‌ها و رفتارهای غلط و حساسیت‌های نابه‌جا نشوند‌.'),(2128,14,'content-30','نوجوان بدون توجه، تصور می کند بر روی گنج نشسته است و چیزی به نام اسراف و صرفه جویی وجود ندارد که این طرز فکر او منجر به مصرف بی رویه میشود. آشنا کردن وی با وضعیت اقتصادی خانواده و مشورت با او و مسئولیت دادن به نوجوان در رابطه با صرف برخی هزینه های خانواده، می تواند کمک کننده باشد.'),(2129,14,'content-31','بهترین راه برای اینكه امكان تمرین برای تصمیم گیری را در محدوده انتخابهای مطمئن و ایمن برای كودك خود فراهم كنید این است كه به نحوی زندگی خود را برنامه ریزی كنید كه كودك برای انتخاب كاملا آزاد باشد اما گزینه های در دسترس او به دقت انتخاب و محدود شده باشند. او می تواند انتخاب كند كه دندانهایش را قبل از داستان شب یا پس از آن بشوید یا اینكه یكی از دو بشقابی را كه برای شام به او پیشنهاد می دهید انتخاب كند.'),(2130,14,'content-32','به کودک خود آموزش دهید که با افرادی که نمی شناسد، به راحتی ارتباط برقرار نکند. از افراد غریبه خوراکی قبول نکند و در صورتی که فردی به او خوراکی تعارف کرد، از او بخواهید که این موضوع را به شما بگوید و با اجازه شما خوراکی را قبول کند. به او آموزش دهید که اگر غریبه ای دعوتش کرد تا سوار ماشین، دوچرخه یا موتور شود، قبول نکند، حتی اگر این غریبه وعده دهد که او را پیش والدینش می برد.'),(2131,14,'content-33','از ابتدای نوجوانی، با فرزندانتان درمورد ارزش صداقت در خانواده تان صحبت کنید. به آنها بگویید که این برای همه شما خیلی مهم است که بتوانید همیشه روی همدیگر برای شنیدن حقیقت، حتی اگر سخت باشد، حساب کنید. اگر بین والدین و بچه ها صداقت نباشد، اعتماد و نزدیکی در خانواده وجود نخواهد داشت.  به فرزندانتان بگویید مادامی که صداقت بینتان باشد برای حمایت و دفاع از آنها هر کاری از دستتان برآید انجام میدهید.'),(2132,14,'content-34','اجازه دهید خود کودک شما  انتخاب کند که چگونه بپوشد! در هر زمان سعی كنید دو یا سه دست لباس كه برای موقعیت فعلی مناسب بوده و برای شما نیز قابل قبول باشند به او پیشنهاد بدهید و به او اجازه بدهید كه با آزادی كامل از بین آنها انتخاب كند. سعی كنید او را واقعا آزاد بگذارید. اگر هر دو دست لباس واقعا مناسب هستند نباید انتخاب او (مثلا پیراهن مخملی قرمزرنگ با شلوار نارنجی) را رد كنید.'),(2133,14,'content-35','به یاد داشته باشید در تصمیم‌گیری و انتخاب و برنامه‌ریزی برای زندگی، فقط «بهتر» بودن مهم نیست. هزینه‌ی مناسب کردن هم مهم‌ است. اگر پنج ساعت درس خواندن در هفته به نمره‌ی ۱۵ و ده ساعت درس خواندن به نمره‌ی ۱۸ منتهی شود. شاید برای ۱۹ گرفتن بیست ساعت وقت لازم باشد و برای ۲۰ گرفتن چهل ساعت. وقتی که فرزند خود را وادار می‌کنیم که برای ۲۰ تلاش کند و توضیح می‌دهیم که ۱۹ برای تو خوب نیست، به او می‌آموزیم که نصف عمر مفید خود را «صرف بازی رقابت» کند.'),(2134,14,'content-36','کمک کردن به دیگران را به فرزندتان بیاموزید. مناسبت ها و تعطیلات فرصت مناسبی است تا با کودک در مورد قسمت کردن وسایل با کودکانی که ممکن است وضعیت مناسبی نداشته باشند، صحبت کنید. به همراه کودک در برنامه های خیریه که برای بچه های اسباب بازی جمع آوری می کنند، شرکت کنید تا کودک بتواند بعضی از اسباب بازی ها یا لباس هایی که دیگر از آنها استفاده نمی کند را به خیریه اهدا کند.'),(2135,14,'content-37','والدینی که به طور متعادل از تقویت و تنبیه استفاده می کنند به فرزند خود \"خودگردانی\" را می آموزند. والدینی که نوپایان را محدود و نکوهش می کنند باعث رشد عدم اعتماد به نفس و خودشکوفایی در آنها می شود. توجه کافی و تادیب متعادل و به موقع فرزندان فعالیتهایی هستند که برای رشد شناختی فرزندان بسیار مفید خواهند بود. هیچ وقت کودک خود را برای لیوان آبی که از دستش رها شده و روی زمین ریخته تنبیه نکنید. '),(2136,14,'content-38','والدین برای کمک به کودکان خردسال وقتی در شرایط گوناگون گرفتار شده‌اند از آنها سوالات مختلفی می‌کنند. کودک معنای این پرسشگری برای کمک را به‌خوبی از کنجکاوی و مداخله‌گری برای سرزنش تشخیص می‌دهد. لازم است بدانید نظارتی که شفاف و همراه با استدلال است برای او اعتماد و امنیت به‌همراه دارد، درحالی‌که دخالت و القای مالکیت، که با نوعی تجسس بدون توضیح همراه است، او را دچار اضطراب و استرس می‌کند.'),(2137,14,'content-39',' بسیاری از بچه ها به یک برنامه از پیش تعیین شده عادت کرده اند، در حالی که بیشتر برنامه های روزمره در تعطیلات به هم می خورد. تا اندازه ای حفظ کردن برنامه های روزمره کمک خواهدکرد که ساعتی را که بدن به آن عادت کرده تا حدی پابرجا نگه داریم. گاهی برخی از بچه ها وقتی ساختاری وجود ندارد تا به آنها کمک کند که بدانند در طی روز چه اتفاقی خواهدافتاد، دچار مشکل می شوند پس هنگام مسافرت برنامه های روزانه خود را از پیش برای کودکتان توضیح دهید.'),(2138,14,'content-40','شکی نیست که هر تصمیمی دو سویه درست و غلط دارد. چه بزرگسال باشیم و چه کودک! پس با دقت نظر به تصمیم کودک گوش فرا دهید، روی انتخاب هایش تامل داشته باشید و بگذارید او نیز حس کند که نظرات و تصمیماتش برای شما حائز اهمیت است. به این ترتیب شما قدرت تصمیم گیری کودک را در اعتماد به نفس او پیوند داده و نهالی از توانایی اتخاذ تصمیم درست در وجود او می نشانید که حاصلش در بزرگسالی تصیمات هوشمندانه و دقیق خواهد بود.'),(2139,14,'content-41','با کودک خود در مورد رد شدن از خیابان و حرکت در پیاده رو ها صحبت کنید. هیچ کودک زیر ۱۰ سالی نباید به تنهایی از خیابان رد شود. به کودک خود آموزش دهید که می تواند در پیاده رو خلوت به تنهایی در جلوی شما بدود، اما به شرط اینکه هر زمان به تقاطعی رسید بایستد تا شما به او برسید و با هم از خیابان رد شوید. همچنین به او رنگ های چراغ راهنمایی چهار راه ها را آموزش دهید.'),(2140,14,'content-42','تا حد امکان رفتار مؤدبانه کودک‌تان را تقویت کنید. اما این کار را به طور جزئی و خاص انجام دهید. تشویق باید رفتار خوب را به صورت جزئی توصیف کند؛ \"دختر خوب\"، \"پسر خوب\" و \"بچه خوب\" مناسب نیست! به جای این جمله‌های کلی برای نمونه بگویید: \"ممنونم که وقتی بیسکوئیت می‌خواستی جمله \"لطف کنید\" را به کار بردی! واضح و روشن صحبت کنید و اجازه دهید کودک‌ مودب شما بداند رفتار او را دیده‌اید و از او قدردانی کرده‌اید.'),(2141,14,'content-43','برای رفتن به مسافرت، بچه ها را در برنامه ریزی برای وسایلی که قرار است همراه خود ببریم دخیل کنیم و از آنها بپرسیم چه چیزهایی را دوست دارند همراه خود بیاورند. با این کار، هم عملکردهای اجرایی مناسب را به آنها آموزش داده ایم و هم باعث شده ایم احساس کنند در این فعالیت سهیم هستند. ممکن است آنها از بازی با وسیله ای که خودشان برداشته اند احساس رضایت بیشتری بکنند.'),(2142,14,'content-44',' یک روان شناس و روانکاو رشد، شرح داده است که اطفال به مرحله ای به نام اعتماد در برابر عدم اعتماد وارد می شوند که به معنای این است که کودکی که از طرف والدین خود پذیرفته نشود (پس زده شود) و یا مورد آسیب قرار گیرد احتمالا دچار افسردگی می شود و شخصی بی اعتماد می گردد در حالی که اگر کودک از جانب والدین مورد پذیرش قرار بگیرد توانایی اعتماد کردن به اطرافیان را در آینده خواهد یافت.'),(2143,14,'content-45','اگر بیرون هوا سرد است و برف و باران اجازه نمی دهد از خانه بیرون بروید و فرزندتان هم بعد از پشت سرگذاشتن یک روز سخت در مدرسه خسته و بی حوصله است، او را به حال خودش رها نکنید. خوب است در این روزها از او بخواهید در پخت غذا و آماده کردن آن به شما کمک کند. شاید این کار از نظر بزرگترها تفریح و سرگرمی نباشد اما بچه ها از انجام دادن آن لذت می برند و حس خوبی خواهند داشت. '),(2144,14,'content-46','به كودكان احترام بگذاريد! انسان‌ها ذاتاً علاقه‌مندند که دیگران به آن‌ها احترام بگذارند و این مسئله شامل همۀ طبقات، از بزرگسال تا خردسال می‌شود.به كودكان احترام بگذاريد آن ها هم سرمایه‌های عظیم و ارزندۀ جامعه‌اند، و هم از این قاعده مستثنا نیستند. به‌خصوص اگر این اکرام و اظهار محبت به آن‌ها در مقابل دیگران باشد. احترام گذاشتن به کودکان باعث افزایش اعتماد به نفس در آنان میشود.'),(2145,14,'content-47','نوجوانان از انجام کارهایی که مورد علاقه شان نیست ( خصوصا کارهای منزل) سر باز میزنند و در مقابل تا دلتان بخواهد می توانند به گردش بروند، ساعت ها پشت کامپیوتر بنشینند، یا با دوستان دائما در مکالمه تلفنی باشند و ... تهیه و اجرای یک جدول زمان بندی و همچنین برنامه ریزی با همکاری خود نوجوان می تواند بسیاری از این مشکلات را مرتفع کند.'),(2146,14,'content-48','مدام به کودک یادآوری نکنیم که \"من پدر یا مادر تو هستم، موظفی به حرفم گوش بدهی و به من پاسخگو باشی!\" این نگاه بزرگ به کوچک یا اصطلاحا بالا به پایین باعث تضعیف فهم حوزه شخصی و از دست رفتن اعتماد به ‌نفس کودکان می‌شود. اگر کودک رنگ آبی را دوست دارد، هنگام خرید نظرش را بپرسید، مدام تکرار نکنید که رنگ آبی به صورتت نمی‌آید، چقدر بی‌سلیقه‌ای! '),(2147,14,'content-49','اگر در زمان کودکی برای آموزش مهارت های زندگی انرژی گذاشته نشود، باید خانواده و مدرسه به خصوص در زمان نوجوانی و بلوغ، برای آموزش این مهارت ها و افزایش ظرفیت روان شناختی نوجوان تلاش کنند چون بعداز 18 سالگی که شخصیت فرد و هوش هیجانی اش تقریبا به وضعیت ثبات نسبی رسید، ایجاد و شکل دهی رفتار، مشکل تر و زمانبر خواهد شد. البته حتی اگر دوره نوجوانی هم از دست برود، آموزش در دوران جوانی زمان سربازی یا دانشگاه باید انجام شود.'),(2148,14,'content-50','گاهی اوقات اجازه دهید کودکتان شما را متقاعد کند! اگر کودک شما چیزی می خواهد که شما در مورد آن مطمئن نیستید، از او بخواهید برای درخواست خود دلیل آورد. آیا او می خواهد برنامه تلویزیونی مورد علاقه اش را ببیند؟ اگر توضیح دهد که اسباب بازیهایش را جمع کرده و یا اول یک چرت می زند بعد به تماشای برنامه مورد علاقه اش می پردازد شما با خیال راحت تری به درخواست او جواب مثبت خواهید داد.'),(2149,14,'content-51','برای آموزش مشارکت و رعایت نوبت به فرزندتان میتوانید از زمانسنج استفاده کنید. به کودک بگویید که برای مدتی محدود، مثلا 10 دقیقه می تواند با اسباب بازیهایش بازی کند و بعد با اتمام زمان، نوبت خواهرش است که 10 دقیقه با آنها بازی کند. این شیوه به کودک نشان می دهد که چگونه نوبت را رعایت کند و او را متوجه این مسئله می کند که اسباب بازی اش را برای همیشه به کسی نمی دهد و فقط شخص دیگری را در لذت بردن بوسیله آنها سهیم میکند.'),(2150,14,'content-52','معمولا در سنین بلوغ نوجوان دچار افت تحصیلی می شود و یکی از علل اصلی آن ورود به فعالیت ها و موقعیت های جدید به زندگی اوست. ایجاد جذابیت تحصیل و صحبت کردن در مورد اهداف آینده کودک، تغییر سیستم آموزشی به یک روش کارآمد و پویا و مشخص کردن آینده ای روشن برای ادامه تحصیل آنها، مهمترین راه حل این مسئله است.'),(2151,14,'content-53','اگر کودکتان اتاق مستقلی ندارد، از همان نوپایی (حدود دو سالگی) به او بیاموزید کدام قسمت اتاق خواب یا فرش هال برای اوست. می‌تواند آنجا اسباب‌بازی‌هایش را بریزد و بازی کند. برایش اتاقک پارچه‌ای یا چیزی مشابه بسازید تا فهمی از حجم خصوصی و شخصی در مکان داشته باشد. کمد و کشو اختصاصی به او بدهید و بدون اجازه‌اش در کمد یا کشویش را باز نکنید.'),(2152,14,'content-54','سن استفاده از تلفن همراه هوشمند زمانی است که شما به عنوان والدین تشخیص دهید فرزندتان می تواند تا حدی خوب را از بد تشخیص دهد. می توانید مجموعه ای از قوانین را برای فرزندان خود تعیین کنید که شامل زمان و چگونگی استفاده از تلفن همراه می شوند. این قوانین باید شامل محدودیت هایی درباره استفاده از تلفن همراه هوشمند باشند. به عنوان مثال، هنگام صرف غذا نباید از تلفن همراه استفاده کرد یا بعد از ساعت 9 شب امکان استفاده از تلفن همراه هوشمند وجود ندارد.'),(2153,14,'content-55','بعضی اوقات امکان دارد که در مکان های شلوغ مثلا مرکز خرید یا پارک، کودک دست والدین خود را رها کند و گم شود، به او یاد دهید که در این مواقع به هر فردی اعتماد نکند. به نزد پلیس یا مامور راهنمایی و رانندگی برود، یا حتما به مغازه ای در آن نزدیکی مراجعه کند. همیشه شماره تماسی در جیب یا کیف کودک خود قرار دهید و به او آموزش دهید تا در صورتی که گم شد این شماره را به پلیس یا مغازه دار بدهد.  '),(2154,14,'content-56','به‌یاد داشته باشیم تفریحات هرکس مبتنی بر علایق اوست. اوقات فراغت کودک را تنها به انتخاب خود از کلاس‌های آموزشی زبان و موسیقی و ورزش لبریز نکنیم و اجازه بدهیم خودش برای اوقات فراغتش تصمیم بگیرد. اگر بنا بر نیاز فرزند و صلاحدید شما او را در یک کلاس آموزشی ثبت نام کردید حتما در کنارش اجازه حضور در برنامه های ورزشی و هنری را هم به او بدهید.'),(2155,14,'content-57','نوجوان دوست دارد همانند بزرگسالان با آنها رفتار شود( هرچند که ممکن است رفتار بچه گانه داشته باشد). برای اینکه بدانید چه نوع رفتاری با این خواسته آنها مغایرت دارد، کافی است این چنین تصور نمایید که شما و فرزندتان به عنوان دو همکار بسیار صمیمی در یک اداره مهم کار می کنید و در عین حال مدیر آن اداره شما هستید. در ضمن بایستی هزینه های نوجوان را به صورت هفته ای یا ماهانه قبل از اینکه او درخواست کند در اختیار وی قرار دهید.'),(2156,14,'content-58','پخش بی‌وقفه کارتون و فیلم و انیمیشن را پایان دهید! برای ساکت نگه داشتن کودک بهتر است زمان و ذهن او را با نشاندن بی‌وقفه مقابل تلویزیون پر نکنیم. به او بیاموزیم رسانه‌ها و تلویزیون عضوی از خانواده نیستند و بهتر است هر چیزی را قابل دیدن و شنیدن نداند. یکی از شیوه های آموزش فرهنگ این است که حتی‌الامکان وقتی از وسایل حمل ‌و نقل عمومی مثل تاکسی و اتوبوس و مترو استفاده می‌کنید، فرزندتان را هم با خود همسفر کنید و برای او صندلی مستقل بگیرید.'),(2157,14,'content-59','استراتژی های جایگزین را اجرا کنید. زمانی که کودک شما شخصی را اذیت یا ناراحت کرده است (لفظی یا فیزیکی) به او بیاموزید که دفعه بعد چطور باید به گونه دیگری رفتار کند تا مورد مشابه تکرار نشود. با این روش دفعه های بعد می‌تواند رفتار های خود را بهتر کنترل کند. نقش بازی کردن به کودک شما کمک می‌کند راه های جایگزین برای داشتن رفتارهای بهتر در آینده را بیاموزد.'),(2158,14,'content-60',' صمیمیت والدین با کودک بدون مرز است، اما نمی‌تواند دلیلی برای افشای جزئیات باشد. به کودک بیاموزیم خبرچینی و چغلی کردن نوعی آسیب رساندن است به کسانی که دوستشان داریم. وقتی کودک همراه پدر از پارک و بازی به خانه برمی‌گردد، سوال درباره خوش گذشتن را در بدو امر با \"خب بگو ببینم چه کارا کردی؟ بابا چه کار کرد؟ کجا رفت؟ تلفنی با کی حرف زد؟ فقط پارک رفتید یا جای دیگه‌ای هم رفتید؟ کیا رو دیدی؟\" همراه نکنیم!'),(2159,14,'content-61','کودکتان می‌تواند رفتار خوب خود را از طریق احترام گذاشتن به دیگران نشان دهد. از‌‌ همان زمان که او توانست از طریق کلامی ارتباط برقرار کند، می‌تواند \"بفرمایید\" و \"متشکرم\" را نیز یاد بگیرد. این که خود‌تان رفتاری محترمانه داشته باشید، از این که سخنرانی کنید مؤثر‌تر واقع خواهد شد. خود‌تان واژه‌های بفرمایید و متشکرم را به طور مکرر به فرزندتان و دیگران بگویید. در این صورت او این واژه‌ها را به عنوان واژه‌هایی رایج در مکالمات روزمره خواهد آموخت.'),(2160,14,'content-62','سعی کنید حتی المقدور کودک خود را تنها نگذارید، اما اگر مجبور هستید برای مدت خیلی کوتاهی او را در خانه تنها بگذارید در را کامل قفل کنید. نحوه استفاده از تلفن رو به کودک آموزش دهید تا کودک شما اگر تنها بود و ترسید یا اتفاقی او را تهدید می کرد، بتواند به راحتی با شما ارتباط برقرار کند.'),(2161,14,'content-63','نوجوانان بسیار تحت تاثیر گروه های هم سن و سال خود هستند و به همین دلیل به سرعت در میان آنان مد لباس، مو، و حتی رفتارهای خاصی همه گیر و رایج می شود. هسته اولیه این امر، تغییرات و الگوهایی بسیار پیچیده می باشد و با زور و محدودیت نمی توان مانع این تغییرات شد، مگر اینکه زمینه و امکانات کافی برای فعالیت های اجتماعی و پیشرفت برای نوجوانان فراهم شود.'),(2162,14,'content-64',' وقتی کودک قوانین خانه و سایر مکان‌ها در زمان‌های مختلف را درک می‌کند، به مرتبه بالاتری از فهم ارزش‌ها می‌رسد، این‌که برخی امور ارزشمندترند، باید برای حفاظت از آنها بیشتر تلاش کند و نسبت به آنها مسوول است. مثلا اگر هر جایی عنوان کند که پدرش در خانه جوراب‌هایش را نمی‌شوید و مادرش از این امر دلخور است، باید منتظر ناراحتی و واکنش پدر و مادر باشد. با او در این مورد صحبت کنید که هر سخن جایی و هر نکته مکانی دارد!'),(2163,14,'content-65','کاش هرگز از هوش خوب فرزندمان در حضورش نگوییم. از تلاش زیادش بگوییم. اگر از هوشش گفتیم،‌ دیر یا زود، با هر شکست یا اشتباه، باور خود را به هوش بالایش و به حرف‌های ما از دست خواهد داد. اما وقتی از تلاش زیادش گفتیم، اگر هم شکست یا اشتباه کرد، باورش را به خودش از دست نمی‌دهد. بلکه تصمیم می‌گیرد که بهتر و بیشتر تلاش کند. هر شکستی او را محکم‌تر و پرتلاش‌تر خواهد کرد و به تدریج خواهد آموخت، که چیزی باعث افتخار است که برای تلاشش،‌ زحمت کشیده باشد. '),(2164,14,'content-66','اگر فرزند نوجواني در خانه داريد، به احتمال زياد با اين موضوع مواجه شده ايد که فرزندتان درباره يک مسئله صحبت هاي دوستانش را بيشتر از نظريات شما قبول دارد و حتي اگر در ظاهر به شما «چشم» بگويد باز هم طبق نظر دوستانش رفتار مي کند. اگر قصد داريد نفوذ دوستان فرزندتان را کاهش دهيد بهتر است بي گدار به آب نزنيد و با دوستانش مبارزه کنید، چون رفتارهاي اشتباه شما در اين باره فقط آن ها را نزد فرزندتان عزيزتر مي کند.'),(2165,14,'content-67','دادن تلفن همراه هوشمند به فرزندتان می تواند فرصتی خوب برای فراگیری مسئولیت مالی باشد. به عنوان مثال، او می تواند برای دریافت برنامه های مورد نیاز خود از پول توجیبی هفتگی اش خرج کند. تا سقف معینی ماهیانه برای این منظور به او بدهید و بخواهید مازادش را خودش از پس اندازش پرداخت کند. در هر دو صورت او درک بهتری از مدیریت هزینه ها و مسئولیت مالی ایجاد شده پیدا خواهد کرد.'),(2166,14,'content-68','نوجوانان تمایل دارند بیشتر وقت خود را در اتاقشان به تنهایی بگذرانند. اگر امکانات خانواده اجازه بدهد، نوجوان بایستی اتاق مستقل داشته باشد. هیچگاه سرزده وارد اطاق او نشوید مگر اینکه دلیل منطقی و محکمی داشته باشید. شما میتوانید دورادور رفتار او را زیر نظر داشته باشید و به بهانه صرف عصرانه یا میوه و چای از او بخواهید لحظاتی اتاقش را ترک کند.'),(2167,14,'content-69','بعضی بچه ها وقتی خود را با همسالان خود مقایسه می کنند، از کمبود اعتماد به نفس رنج می برند. به هر حال ممکن است مثلا دخترعمویی در فامیل وجود داشته باشد که به خاطر گرفتن مدال یا قبول شدن در مدرسه ای بهتر، به شدت از سوی دیگران تحسین شود. مطمئن شوید که قابلیت های فرزند شما نیز ارائه شده باشد. ممکن است فرزند شما روابط اجتماعی خوب یا مهارت خاصی داشته باشد. میتوانید اگر عکاسی اش خوب است به او نقش خاصی مثلا عنوان \"عکاس خانواده\" را بدهید.'),(2168,14,'content-70','تصمیم گیری بخشی از فرآیند رشد است. كودك شما باید یاد بگیرد كه در مورد كارهایی كه باید انجام دهد فكر كند نه اینكه صرفا كارهایی را كه به او می گویید انجام دهد یا در برخی موارد از انجام دادن آنها طفره برود! اما با این حال شما در این دوران نمی توانید دست كودك خود را برای انتخاب كاملا باز بگذارید زیرا او ممكن است تصمیمهایی بگیرد كه یا برای سلامتی او مضر باشند .مثلا تصمیم بگیرد كه فقط یك بار در هفته دندانهایش را مسواك كند!'),(2169,16,'content-11','یکی از راههای ایجاد خلاقیت در کودک طرح سوال برای کودک است! براي ايجاد سؤالات تازه در ذهن کودکتان، او را راهنمايي کنيد. آموزش به کودک بايد طوري باشد که او را به طرف پرسشهاي تازه هدايت کند. معلم بايد هنگام جواب دادن به سؤالات کودک، او را به سمت مهارتهاي جديد سوق دهد و از به کار بردن کلماتي مانند بله، خير، هرگز و امثال آن دوري کند. اين نوع جوابها نمي تواند ارتباط کاملي بين سؤالات کودک و معلومات قبلي او برقرار کند.'),(2170,16,'content-12','به عقايد جديد و تازه کودکتان احترام بگذاريد. کودکاني که به نوعي خلاقيت آنها برانگيخته شده، روابط و مفاهيم را درک مي کنند. لذا والدين و مربيان آنها ممکن است به آنها توجه نداشته باشند و حتي گاهي او عقايد خود را چنان مطرح کند که بزرگسالان قادر به ارزشيابي و جايگزيني آنها نباشند. تشويق کودکان به ابرازعقايد جديد، مي تواند در رشد خلاقيت آنها موثر واقع شود .'),(2171,16,'content-13','محيط خانه را به صورتي درآوريد كه در آن فعاليت، بازي و خنده به مقدار زيادي وجود داشته باشد. شما و كودكانتان سعي کنید كارها را به روش هاي جديد و جالب انجام دهيد. با تشويق و تأييد رفتار كودك و فراهم آوردن زمينه هاي مساعد و تدارك بازي هاي دلخواه او، قدرت تخيل و خلاقيت كودك را تقويت كنيد. خيال پردازيهاي كودكان را سرزنش نكنيد زيرا خلاقيت او را محدود مي سازيد.'),(2172,16,'content-14','از مکان هاي جديد ديدن کنيد. همراه با کودک خود به نمايشگاهها و موزه هاي مختلف و طبيعت زيبا برويد، اجازه دهيد او از نزديک مکان هاي گوناگون را شناسايي کند. میتوانید برای تعطیلات آخر هفته او را به باغ وحش ببرید تا از نزدیک با گونه های مختلف جانوران و حیوانات آشنا شود و انواع آنها را بشناسد. مثلا از کارهایی که یک فیل با خرطومش میتواند انجام دهد و یا منقار دارکوب برای کودک خود سوال طرح کنید!'),(2173,16,'content-15','از مراقبتها و دخالتهاي بيش از حد در زندگي کودکان اجتناب کنيد. يکي از ويژگيهاي انسان خلاق اين است که تواناييش را خودش به کارمي اندازد. وظيفه والدين و مربيان اين است که اين قابليت را در او زنده نگاه دارند و به کودکان اجازه دهند بعضي اوقات مطابق سليقه خود اشياء را کشف کنند. مثلا برای شروع یک کاغذ، پاک کن، مداد و قیچی روی میزش قرار دهید و از او بخواهید برای بریدن کاغذ یکی از آنها را انتخاب کند.'),(2174,16,'content-16','مراقبتها و دخالتهاي زياد از حد بزرگسالان در زندگي و رفتارهاي کودکان، قابليت يادگيري مبتکرانه آنها را تضعيف مي کند. اجازه ندهید کودک در همه حال وابسته به شما باشد. برای مثال او بارها و بارها دیده است که شما از کجا لیوان را آب میکنید. کافی است برایش یک لیوان مجزا تهیه کنید و هنگامی که درخواست آب میکند از او بخواهید همانند شما از همانجای همیشگی لیوانش را پر کند.'),(2175,16,'content-17','از کودکان بخواهيد که اشياء و امور نيمه تمامشان را تکميل کنند. آنها باید یاد بگیرند تا جملات نا تمام و داستانهاي نا کامل، تصاوير و نقاشي هاي نيمه تمام و حتي اشياء ناقص را کامل نمايند. براي کودکتان اسباب بازي هايي تهیه کنیدکه خودش بتواند آنها را به يکديگر متصل کند و با آنها مدلهاي مختلف خلق کند. برایش داستانی تعریف کنید و بگذارید پایان آن را با خلاقیت خود تمام کند.'),(2176,16,'content-18','علاوه بر مشاهده اشيا لازم است کودک آنها را لمس کند زيرا مشاهده شيء به تنهايی کنجکاوي او را ارضا نمي کند. مشاهده همراه با لمس اشيا، آنها را در بازي هاي خيالي، اختراعات و پاسخ گويي به آزمونهاي خلاقيت ياري مي دهد. به کودکان اجازه دهيد وسايل بي خطر خانه را لمس کنند. آنها بيرون کشيدن وسايل آشپزخانه از داخل کابينتها و بازي با کاسه و قابلمه و بشقابها را بسيار دوست دارند . '),(2177,16,'content-19','حسن کنجکاوي در کودکان را پرورش دهيد. براي اين امر، هيچ چيز مثل پاسخ هاي صحيح و مناسب به پرسشهاي او موثر نيست. اگر چه احتياج، بايد فورا برآورده شود اما کمي مکث بين سؤال و جواب، غالبا مي تواند افکار و ايده اي مفيد جهت مباحثه و گفت‌و‌گو به بار آورد. زمانیکه کودک از شما سوال میپرسد سوال را به خودش برگردانید و از او بخواهید خودش درباره جواب کمی فکر کند و چیزی که به ذهنش میرسد را بیان کند. سپس او را راهنمایی کنید.'),(2178,16,'content-20','زمينه رشد خلاقيت در خانه زماني فراهم مي شود كه به كودكانتان آزادي زيادي بدهيد و به آنها به عنوان يك فرد احترام بگذاريد، از نظر عاطفي در حد اعتدال به آنها نزديك شويد و بر روي ارزشهاي اخلاقي و نه قوانين خاص تأكيد کنید. اگر یک روز بعد از ورود به آشپزخانه با این صحنه مواجه شدید که کودک شما ظروف داخل کابینت را بیرون آورده و مشغول بازی با آنهاست، او را تنبیه نکنید. اجازه دهید تحت نظارت شما و با خیال راحت دنیای اطرافش را کشف کند.'),(2179,16,'content-21','کودک را هميشه از يک مسير خاص به خانه نبريد! زماني که با او بيرون مي رويد، هنگام برگشتن به خانه به او توضيح دهيد که مي خواهيد از يک راه جديد به خانه برويد. او از اين طريق در مي يابد براي رسيدن به يک هدف راه هاي مختلفي وجود دارد و همواره به دنبال راه حل های جدید میگردد! بنابر این هنگام مواجه شدن با مسائل، سوالات بیشتری در ذهن او مطرح میشود.'),(2180,16,'content-22','در مورد کاربردهاي مختلف يک وسيله خاص از کودکان سؤال کنيد. کاربرد ابزارها و وسايل مختلفي را که در خانه داريد، براي کودک شرح دهيد و از او بپرسيد: به نظر تو اين وسيله چه کاربردهاي ديگري مي تواند داشته باشد؟ به اين طريق شما ذهن کودک را مستعد مي کنيد تا نسبت به کاربرد اشیاء تصاویر مختلفی را در ذهن خود خلق کند.'),(2181,16,'content-23','بهترين زمان براي اطلاع از خلاقيت كودكان، تماشاي آنها به هنگام بازي است. كودك را در حالي كه آزادانه و با آرامش خاطر با اسباب بازيهايش سرگرم بازي است تماشا كنيد. كودكان خلاق اغلب براي هر يك از وسايل بازي خود موارد استفاده متفاوتي پيدا مي كنند و قبل از اينكه از وسيله اي به سراغ وسيله ديگر بروند از آن به انواع مختلف استفاده مي نمايند. در هنگام بازی آنها شما هم با او بازی کرده و به نقشها و کارایی خیالی اسباب بازیهایش پر و بال دهید.'),(2182,16,'content-24','كودك خلاق اغلب از منابع و وسایل بازی خود به انواع و اشكال مختلف و گاه حيرت انگيز استفاده ميكند.کودکان خلاق مي توانند با توجه به موقعيت خود، مکان بازي را تغيير دهند، بازيهاي جديد ابداع کنند، مقررات خاصي وضع کنند، رهبري بازي را در دست گرفته و با سازمان بندي منسجم به صورت فردي و گروهي بازي کنند. اگر یک جعبه برای کودک حکم تلویزیون را دارد شما هم در بازی با او جعبه را به شکل تلویزیون ببینید!'),(2183,16,'content-25','کودکاني که از خلاقيت بي بهره بوده و يا خلاقيت کمي دارند در بازي ها نقش پيرو را به عهده گرفته، خود را ملزم به رعايت کامل مقررات بازي مي دانند، تخطي از قوانين را جايز نشمرده و بازي را بيشتر به عنوان وظيفه و کار تلقي مي کنند تا وسيله اي براي رشد، بنابراين سهم آنها از لذت بازي کمتر از کودکان خلاق است. در بازی با کودکان گاهی قوانین و دید را تغییر دهید. مثلا یک طناب میتواند جای یک مار هم باشد!'),(2184,16,'content-26','گروهی از اشیا یا چیزهای دیگر را انتخاب کنید که شباهتهای اساسی به یکدیگر دارند. در میان این گروه شی را قرار دهید که در آن ویژگی مشترک با بقیه نیست و از کودک بخواهید آن شی را که با بقیه تفاوت دارد در بین گروه انتخاب کند. مثلا چند شی دایره‌ای شکل انتخاب کنید و در بین آنها یک مکعب مربع قرار دهید. برای این آزمایش نیز می‌توانید از خود اشیا ، تصاویر آنها یا نام بردن اسامی ، آنها استفاده کنید.'),(2185,16,'content-27','پازل ساده‌ای تهیه کنید و اجزایی از این تصاویر را حذف کنید. از کودک خود بخواهید بگوید تصویر مورد نظر چه اشکالی دارد. تصاویری که انتخاب می‌کنید معمولا تصاویر ساده‌ای خواهد بود که کودک با آنها آشنایی داشته باشد. مثل چهره یک آدمک که دهان و لبها حذف شده است یا ساعتی که عقربه ندارد یا میزی که پایه ندارد. کودکان به موازات رشد شناختی خود به تدریج این توانایی را بدست می‌آورند که بتوانند اجزای حذف شده در تصاویر پیچیده را شناسایی کنند.'),(2186,16,'content-28',' تشویق کودک به حرف زدن به او اعتماد و اطمینان می بخشد. کتابها بخش مهمی از رشد کودکان هستند زیرا به آنها کمک می کند کلمات جدیدی را یادگرفته و خواندن را به آنها می آموزد. به والدین توصیه می گردد که داستانهایی برای کودک انتخاب کنید و با تغییراتی که در آنها ایجاد می‌کنید منتظر پاسخ و واکنش کودک بمانید. توجه کنید این تغییرات متناسب با سطح سنی کودک  و بیان کننده مسائل غیر عادی و غیر طبیعی باشد.'),(2187,16,'content-29','از مراحل طفولیت، بچه ها شروع به تشخیص این امر می کنند که برای کنش های آنها یک سری دلایل و نتایج وجود دارد. برای مثال اگر کودک دکمه روی اسباب بازی را فشار دهد آنگاه صدایی شنیده می شود و یا اگر یک شی را بردارد و در محل صحیحی قرار دهد مهارتهای حرکتی ظریف و درشت خود را توسعه خواهد داد. لذا اسباب بازی ای برای کودک فراهم کنید که به حرکات کودک پاسخ دهد و یا کودک در بازی با آن بتواند صحیح و غلط بودن را تشخیص دهد.'),(2188,16,'content-30','یک روش برای افزایش خلاقیت کودک! همه جوراب‏ها را از کشوی کودک‌تان خارج کنید. از او بخواهید رنگ‏ها را جدا جدا بگذارد. برای این‏که کودک، حسابی سرگرم شود، سبد رخت‏های شستنی را به او بدهید و از او بخواهید همه جوراب‏ها را از کشوهای خانه خارج کند. تا مدتی طولانی، سرگرم جمع کردن جوراب‏ها و بعد هم جدا کردن آن‏ها طبق رنگ، اندازه یا صاحب جوراب‏ها می‏شود. '),(2189,16,'content-31','وسایل موسیقی از جمله اسباب‌بازی هایی هستند که در افزایش خلاقیت در ذهن کودکان نقش بسیار مهمی ایفا می کنند. هنگامی که کودک با سازهای اسباب بازی خود صدا تولید می کند، آواز می خواند و شاد است، در واقع در حال بروز استعدادهای ذاتی خود است. شما با تحسین و تشویق او می توانید این ابتکارات را در ذهن او پرورش دهید. برای پرورش خلاقیت کودک خود از طریق ابزار موسیقی میتوانید یک ساز دهنی به او هدیه بدهید!'),(2190,16,'content-32','برای اینکه ذهن کودک باز باشد و بتواند خیال‌پردازی کند، باید تا حد امکان استفاده از وسایل الکترونیک را کاهش دهید. شاید وقتی موبایل خود را دست او می دهید، سرگرم باشد و دیگر سروصدا و شیطنت نکند اما با این کار موجب کاهش خلاقیت ذهنی فرزندتان می شوید. تماشای برنامه های تلویزیونی اجازه نمی دهند فرزند دلبندتان خیال‌پردازی کند. با تماشای تلویزیون بیش از 30 دقیقه  قوه تخیل کودک کمرنگ می شود.'),(2191,16,'content-33','نمایش و ایفای نقش های مختلف به کودک کمک می کند تا خود را جای شخصیت های مختلف قرار دهد. برای موفقیت در این مسیر باید قدرت خلاقیت و قوه تخیل قوی داشته باشد. برای این منظور شما باید به تخیل او کمک کنید و برایش امکانات و فضای مناسب را فراهم کنید. به طور مثال، اگر دوست دارد نقش معلم را ایفا کند، برایش مثلا عینک و خودکار و دفتر تهیه کنید تا نقشش را بازی کند. '),(2192,16,'content-34','یکی از ضروری ترین کارها برای رشد فکر و هوش و خلاقیت کودک، کتاب است. شما با خواندن کتاب برای فرزند خود می توانید تخیل و تصورپردازی های ذهنی او را پرورش دهید. برای این منظور بهتر است کتاب هایی انتخاب کنید که بزرگ هستند و تصاویر رنگی بسیاری در خود دارند. هنگام خواندن کتاب یک طرح کلی در ذهن خود برای موضوع داستان در نظر بگیرید و با صداهای متفاوت برای شخصیت های مختلف، داستان را برای فرزند خود بخوانید.'),(2193,16,'content-35','با بعضی از عادت های عجیب کودک خود کنار بیایید! به طور مثال، دخترک شما دوست دارد برای بازی در کوچه دامن کوتاه خود را بپوشد و این از نظر شما قابل قبول نیست. اما این را بدانید که کودک این وسواس را درک نمی کند. بنابراین پیش از اینکه با فرزند خود وارد بحث بشوید که هر مکانی لباس مخصوص خود را دارد، به این فکر کنید آیا اشکالی پیش می آید مثلا با دامن چین‌دارش کوچه برود؟ در واقع اجازه دهید انتخاب کردن را یاد بگیرد!'),(2194,16,'content-36','در مراحل رشد کودک بسیار طبیعی و نرمال است که دوستان خیالی داشته باشد. وجود دوستان خیالی نشانه قوه تخیل بسیار قوی در کودکان است. اینگونه کودکان اصولا رفتار اجتماعی بهتر و هراس اجتماعی کمتری دارند. در همین راستا، می توانید هنگامی که فرزند شما در حال بازی با دوستان خیالی خود است در جمع آنها حضور داشته باشید و تا زمانی که رفتار بد یا اشتباهی از فرزند سر نزده است، او را همراهی کنید!'),(2195,16,'content-37','اینکه برای بازی و سرگرمی های کودک محدودیت تعیین کنید، بد نیست. به طور مثال، اگر کودک دوست دارد نقش دزد دریایی را بازی کند و اطراف خانه بگردد، اشکالی ندارد اما باید بداند مثلا هنگام شام باید به دنیای واقعی بازگردد و سرمیز بنشیند و غذایش را میل کند. کودک باید بداند در کنار تخیل، دنیای واقعی نیز وجود دارد.'),(2196,16,'content-38','واقعیت این است که کودکانی که اجازه پیدا می‌کنند از قدرت و توانایی ویژه‌ی خود در هر زمینه‌ای کمک گرفته و از دیدگاه شخصی خود (و نه والدین) زندگی را تجربه کنند و به جنگ مشکلات رفته و برای مسائلشان راه‌حل پیدا کنند، در آینده رفتاری ابتکار آمیز و سازنده خواهند داشت. برای شکوفایی چنین فرزندانی بهتر است در کنار مراقبت و نظارت بر اعمال آنها اجازه دهید گاهی به تنهایی توانایی های خود را در عرصه های مختلف محک بزنند.'),(2197,16,'content-39','لازم است بدانیم والدین زمانی روحیه خلاقیت را در کودکانشان تضعیف می‌کنند که از آن‌ها می‌خواهند آن طور که همه رفتار می‌کنند، رفتار کنند. بدین معنی که چارچوب مشخصی را برایشان تعریف کرده و به آن‌ها توصیه می‌کنند پا از آن فراتر نگذارند و به جای آن که راه و روش ویژه‌ی خود را دنبال کنند از افراد بزرگتر از خود تقلید کرده و کلیشه‌ای عمل کنند. توجه داشته باشید تقلید همواره مانع شکوفایی و پرورش خلاقیت فرزند میشود.'),(2198,16,'content-40','خلاقیت و موفقیت از آن کودکانی است که تشویق می‌شوند، از قدرت خلاقانه‌ی ذاتی خود استفاده کرده و زندگی را از زاویه‌ی نگاه خودشان تجربه میکنند. کودکان خلاق اجازه دارند همواره خودشان باشند نه آن که طوطی‌وار از رفتار کودکان دیگر و یا بزرگترها تقلید کنند. هر کودکی که متولد می‌شود اگر در چارچوب قوانین خانواده اجازه آزادی فکر و عمل داشته باشد می‌تواند کودکی خلاق باشد. '),(2199,16,'content-41','بهترین زمان برای پرروش خلاقیت در کودک‌تان از ۵ سالگی به بعد است که باید روش‌های مختلفی را برای پرورش فکر کودک‌تان به کار بگیرید. خیلی از خانواده ها هستند که فکر می‌کنند برای اینکه کودکی خلاق داشته باشند، باید هزینه‌های زیادی انجام بدهند و از توجه کافی به خلاقیت کودک خود صرف‌نظر می‌کنند. اما بهتر است این والدین بدانند که نیازی به سرمایه‌گذاری نیست و فقط لازم است کودک‌تان را با دنیای اطرافش آشنا کنید.'),(2200,16,'content-42','کودک باید درباره وسایل و اجسام موجود در محیط پیرامون خود اطلاعات کافی داشته باشد. برای پرورش فکر و خلاقیت کودکتان  اجازه دهید او با رعایت نکات ایمنی با وسایلی که کنجکاوی‌اش را تحریک کرده است، سر و کله بزند. بهتر است وقتی وسیله‌ای را در اختیار او قرار می‌دهید، روش کار با آن را هم برایش توضیح دهید. مثلا دکمه روشن و خاموش تلوزیون و بالا و پایین آوردن صدای آن را روی کنترل دستگاه نشانش دهید و از او بخواهید این کار را انجام دهد.'),(2201,16,'content-43','برای کمک به رشد خلاقيت فرزندانتان صبور باشید! درصورتي‌ كه كودك با مسائل متفاوت مواجه ‌شود به او اجازه دهید كه راه حل‌هاي احتمالي ديگري را هم مورد بررسي قرار دهد و به دنبال اين نباشد كه خيلي سريع به نتيجه برسد. از طرفي ديگر خانواده بايد به رفتارهاي خلاقانه كودك امتياز دهند و درصورت امكان اين رفتارها را تقويت كنند. ساده‌ترين آن استفاده از عبارات كلامي مثل \"آفرين\" است و همچنين درنظرگرفتن جوايز و ارزش دادن به فرزندشان در جمع است.'),(2202,16,'content-44','هیچ گاه روی اثر هنری کودک طرحی نکشید،‌ نقاشی نکنید و چیزی ننویسید. هنر کودک بسیار مهم تر از گونه مداخله شماست و این کار می تواند مانع خلق آثاری متناسب با رشد سنی کودک شود. اجازه بدهید کودک نقاشی یا کاردستی نیمه تمام خود را خودش کامل کند. میتوانید قبل از شروع یک کاردستی الگویی از آن تهیه کنید و از او بخواهید خودش از بین لوازمی که در اختیارش گذاشتید انتخاب کند و کارش را به اتمام برساند.'),(2203,16,'content-45','وقتی کودک روی سطح نا مناسبی نقاشی می کشد،‌ او را سرزنش نکنید. به او کاغذ بدهید و بگویید: \" چه خوب! می بینم که نقاشی کردن را دوست داری!\" از او بخواهید آنچه در ذهن خود دارد را روی کاغذ نقاشی کند و ابزار متنوع و مورد نیاز نقاشی مثل مدادرنگی، آبرنگ، پاستل و ... را برایش تهیه کنید. اجازه دهید خودش به رنگ آمیزی آنچه کشیده است بپردازد. '),(2204,16,'content-46','گاهی تفکر خلاق به نوآوری منجر می شود. به عبارتی از داده ها و مصالح موجود استفاده جدیدی می شود. برای داشتن تفکر خلاق به زمینه هایی نیاز است. طبیعی است که هر کودکی با سطحی از هوش، توانمندی، استعداد و علاقه به دنیا می آید و شیوه پرورش تفکر خلاق در کودکان متفاوت است اما می توان زمینه های بروز تفکر خلاق را در کودکان فراهم کرد. برای شروع کافی است او را با لوازم خانه و محیط اطرافش آشنا کنید.'),(2205,16,'content-47','کودک باید بتواند از یک اسباب بازی به اشکال مختلف استفاده کند و با یک فکر رها شده و آزاد با اسباب بازی های خود بازی کند، گاهی لازم است والدین چگونگی کار با اشیا را به کودک نشان دهند و از او سوالاتی درباره سایر کاربردهای آن بپرسند. هنگام ورود به منزل از او بپرسید که تا به حال فکر کرده درب را چطور باز میکنید؟ سپس کلید رانشانش دهید و اجازه دهید برخی زمانها که با شماست او قفل در را باز کند. '),(2206,16,'content-48','والدین می توانند در ساخت اشکال هندسی به کودک کمک کنند یا از او بخواهند درباره آن چه ساخته است یک داستان بگوید یا یک داستان برای او تعریف کنند و بخواهند آن را طبق علاقه خود تغییر دهد. نقاشی کردن هم یکی از بهترین راه های افزایش خلاقیت کودکان است. تشویق کودکان به نقاشی کردن، در شکل گیری نوع جدیدی از طرز تفکر درباره محیط پیرامون و ترسیم آنچه در ذهن دارند، بسیار موثر است. استفاده از هنرهای تجسمی، پازل، جداول ترسیمی هم بسیار سودمند است.'),(2207,16,'content-49','خوب است بدانید کودکان از ۳ تا ۵ سالگی خیال پرداز می شوند و قوه تخیل خود را به کار می گیرند. بعضی از والدین در مواجهه با خیال پردازی کودکان نگران می شوند در صورتی که این امر در فرآیند رشد و تکامل کودک کاملا طبیعی است. بنابراین بهتر است تخیلاتی را که کودک به زبان می آورد، گوش کنید و با طرح سوالاتی تفکر و عمل کودک را تقویت کنید.'),(2208,16,'content-50','کودکی که قوه تخیل فعالی دارد همیشه یک مدل بازی نمی کند، نقاشی نمی کشد و شکل درست نمی کند! در موارد بسیاری والدینی که از بی حوصلگی، کسالت و بی انگیزه بودن کودکان خود گلایه می کنند، در واقع نتیجه بی توجهی خود را نسبت به تخیلات کودک می بینند. اگر والدین درباره تخیلات کودک به موقع وارد عمل شوند و او را تشویق به اجرای کارهای خلاقانه و ایده هایی که دارد بکنند، کودک خود راه حل هایی برای پر کردن وقتش پیدا می کند.'),(2209,16,'content-51','در موارد بسیاری حل تعارضات کودک در درون خانواده با تفکر خلاق امکان پذیر است. تکمیل نقاشی و گفتن داستان درباره آن توسط کودک، به تفکر خلاق در وی می انجامد و کودک می تواند آن چه را باعث رنجش وی شده است به طور غیرمستقیم بیان کند. این شیوه یکی از بهترین شیوه های درمانی کودکان آسیب دیده و دچار تعارض است. در واقع کارشناسان با رشد تفکر خلاق در کودک، تلاش می کنند کودک خلاقانه با تعارض هایی که با آن مواجه بوده است، روبه رو شود و آن را پشت سر بگذارد.'),(2210,16,'content-52','همه کودکان با توانمندی، هوش و قریحه به دنیا می آیند و قابلیت خلاق بودن را دارند اما این والدین هستند که گاه با غفلت و جدی نگرفتن موضوع مانع از بروز آن می شوند. رشد اعتماد به نفس کودک، تشویق به داشتن پشتکار و اراده، افزایش انگیزه کودک، بروز ثبات هیجانی، تعیین اهداف، ریسک پذیری مناسب، قابلیت انعطاف پذیری و تلاش برای افزایش توجه، تمرکز و هوش کودک از جمله راهکارهایی است که کودک برای افزایش خلاقیت به آن نیاز دارد.'),(2211,16,'content-53',' یکی از بهترین راه ها برای افزایش خلاقیت کودک این است که او بتواند برای حل یک مشکل با روبه رو شدن با یک وضعیت خاص، ایده جدیدی را مطرح کند، بتواند راه های متفاوتی را نام ببرد و بداند هر راه به کجا منتهی می شود و پیامد هر یک چیست. چنین کودکی با رو به رو شدن با یک وضعیت بغرنج، موضوع را تمام شده تلقی نمی کند و می تواند راهکارهای متفاوتی ارائه کند.'),(2212,16,'content-54','یک روانشناس برخنداندن روزانه حداقل 10 دقیقه کودک برای پرورش خلاقیت تاکید کرد. ریشه شکل‎گیری خلاقیت، در تربیت فرزند است. کودکان اگر عزت نفس داشته باشند خلاقیت دارند و یکی از راه‎های افزایش عزت نفس وقت گذاشتن برای کودک است. برای پرورش گل‎های یک باغچه باید به آن رسیدگی کرد و وقت گذاشت. یک کودک خلاق حتی در شکست ها، خلاقانه رفتار می کند و می داند چگونه با آن کنار بیاید.'),(2213,16,'content-55','اگر می خواهید تفکر خلاق در کودکتان پرورش یابد، از ۲ تا ۵ سالگی پاسخ سوالات کودک را به تمامی ارائه نکنید و اجازه بدهید خودش درباره پاسخ ها فکر کند. این کار باعث می شود کودک فکر کند و به یک پاسخ واحد قانع نشود. نکته اینجاست که در بیشتر موارد کودکان راه حل ها و پاسخ های بسیار خوب و مناسبی ارائه می دهند. بنابراین سعی نکنید جواب سوالات کودک را بلافاصله و با شرح جزئیات ارائه دهید.'),(2214,16,'content-56','گاهی اجازه دهید دخترتان بانوی خانه باشد. او را مامان خانه کنید و کارهای کوچکی را که از پس‌شان برمی‌آید به او بسپاريد. پسرتان هم می‌تواند نقش پدر را داشته باشد. آنها را با کارهای بچگانه‌ای که می‌کنید غافلگیر کنید. حتی می‌توانید لباس‌های‌ خودتان یا پدرشان را به آنها بپوشانید! مطمئنا از نحوه رفتارشان غافلگیر خواهید شد!'),(2215,16,'content-57','برای یک روز به صورت روستایی زندگی کنید و تمام وسایل الکترونیک خانه را خاموش کنید. لپ‌تاپ، موبایل و دستگاه ویدئوی‌تان را خاموش کنید و با کودکتان بازی‌هایی که نیازی به این وسایل ندارند، انجام دهید. کتاب‌های رنگی کودک را از قفسه بردارید و با آنها کار کنید. حتی می‌توانید به اتفاق هم یک آهنگ بامزه بخوانید. معما طرح کنید و کاردستی بسازید!'),(2216,16,'content-58','یک برنامه کشف گنج راه بیندازید! پول خردهایی را در بعضي جاهای خانه پنهان کنید. زیر مبل، پشت پشتی یا داخل جیب پدر. بعد به فرزندتان بگویید اگر می‌خواهد بستنی بخورد باید این پول‌ها را از جاهای مختلف خانه پیدا کرده و جمع کند. حواس‌تان باشد این بازی را با بچه‌های زیر 3سال که امکان دارد سکه پول را ببلعند انجام ندهید. وقتی پول ها را پیدا کرد او را تشویق کنید و با یک کیک خانگی خوشمزه خوشحالش کنید!'),(2217,16,'content-59','وقتش است قلم مو‌ها و رنگ‌های‌تان را بیرون بیاورید و یک تی‌شرت مادر و فرزندی منحصر به فرد برای خودتان طراحی کنید. تی شرت های تک رنگی تهیه کنید و به همراه کودک خود روی آن نقاشی کنید! از کودک بخواهید رنگهای شاد را برای این کار انتخاب کند. اجازه دهید خودش چیزی را که در ذهن دارد نقاشی کند و برای رنگ آمیزی تی شرت خودتان هم نظر او را بپرسید. '),(2218,16,'content-60',' به كودكان اعتماد به نفس بدهید تا بتوانند، توانایی های خود را بروز دهند. اگر از شما خواستند كه ( با هم كار كنیم ) به آنها بگویید كه دوست دارید ببینید كه خودشان چه كار می كنند. اما انتظار نداشته باشید كاری كه كودكان خلق می كنند شبیه به كار بزرگسالان باشد. از کودکتان بخواهید بعد از بازی با عروسک ها و اسباب بازی هایش خودش آنها را مرتب کند و به جای اولیه خود باز گرداند.'),(2219,16,'content-61','كودكان را به خلق آثاری كه به روش های جدید و ابتكاری به وجود می آیند، تشویق كنید. و انتظار نداشته باشید كارهای هنری آنها شبیه نمونه هایی باشد كه دیگران انجام داده اند. آنها را تشویق كنید تا به روشهای جدید خودشان این مهارتها را به دست آورند. به آنها بگویید (من منتظرم ببینم، چه اتفاقی می افتد اگر ... ) این جمله را آنها با توجه به تخیلاتشان می سازند. در لذت بردن و پردازش بر روی خلاقیتهای هنری کودک بیشتر تاكید كنید.'),(2220,16,'content-62','هنگامی که ظروف را از داخل ماشین ظرف‌شویی یا آب‌چکان، جابه‌جا می‌کنید، کودک می‏تواند در جمع کردن قاشق‌ها و چنگال‌ها، به شما کمک کند. آب‌چکان یا سبد ظرف‏ها را روی میز بگذارید و جای قاشق و چنگال را هم کنار آن قرار دهید. کودک می‌تواند آن‏ها را جور کند، بشمارد و در جایشان بچیند. برای پرورش خلاقیت کودکتان میتوانید از بازیهای شنیداری هم استفاده کنید. از کودک‌تان بخواهید چشمانش را ببندد و صداهایی را که شما درمی‏آورید، حدس بزند.'),(2221,16,'content-63','ایجاد فضای مناسب برای فعالیت ذوقی كودكان، صرف نظر از محدودیت‏های رایج، یک اصل ضروری برای پرورش خلاقیت کودک است. امر و نهی فراوان و محدودیت والدین برای كارهای كودكان، به‌ خصوص كارهای هنری آن‌ها باعث می‏شود آنها نتوانند تمایلات درونی خود را بروز دهند. همین مساله، به‌ مرور زمان، موجب انفعال، عدم تحرك و ضعف در قدرت بیان آن‌ها می‏شود. بهتر است تا جایی كه ضرر زیادی به والدین وارد نمی‏شود، از شور و شوق کودکان در كارهای هنری حمایت كنیم.'),(2222,16,'content-64','همان‌طور كه مواد غذایی مختلف مانند لبنیات، پروتئین‏ها و... ، باید در اختیار كودك قرار بگیرند و برای رشد جسمی كودك لازم هستند، مواد دیگری نیز وجود دارند كه موجب رشد خلاقیت می‏شوند، مانند خمیر بازی، كاغذ، مداد رنگی و... در واقع، این مواد، غذای ذهن كودك به حساب می‏آیند. با دسترس بودن این مواد كودك می‏تواند در تمام لحظات، به كشف دنیای درون و بیرون خود بپردازد و شخصیت خویش را كامل کند.'),(2223,16,'content-65','مهم نیست كه نقاشی كودكان زیباست یا نه، مهم نیست آن‌ها چقدر از رنگ استفاده می‏كنند و مهم نیست كه انتظارات ما در نقاشی‏ها و كارهای هنری كودكان برآورده شود. مهم آن است كه كودك، از كار هنری خود لذت ببرد. هرگز نباید از آن‌ها بخواهیم چیزی را كه ما دوست داریم، بسازند. هم‌چنین دست بردن و اضافه كردن بعضی چیزها به آثار كودكان، موجب رنجش آن‌ها می‏شود. ما فقط باید آن‌ها را تشویق کنیم، حتی اگر كار آن‌ها زیبا نباشد.'),(2224,16,'content-66','تشریفات و استفاده از وسایل گران‌قیمت، مورد پسند والدین است، نه كودكان. آن‌ها دوست دارند آزادانه و با احساس راحتی، به كار هنری خود بپردازند. این راحتی، شاید به قیمت تمام كردن رنگ‏ها و كثیف كردن لباس‌شان تمام شود، اما در نهایت، احساس خوبی خواهند داشت. احتیاط و مواظبت از وسایل و ابزار هنری، روح آنان را درگیر مسایل حاشیه‌ای می‌كند و این مساله، مانع خلاقیت است.'),(2225,16,'content-67','در واقع والدین از طریق درگیر شدن در فعالیت های خلاق کودک در رشد خلاقیت او سهیم هستند. خانواده ها باید فرصت های لازم را برای سوال کردن، کنجکاوی و کشف محیط به کودکان بدهند و هرگز آنان را تنبیه و تهدید نکنند. زمینه رشد خلاقیت در خانه زمانی فراهم می شود که به کودکانتان آزادی بدهید و به آنها به عنوان یک فرد احترام بگذارید. از نظر عاطفی در حد اعتدال به آنها نزدیک شوید و بر روی ارزش های اخلاقی و نه قوانین خاص تاکید نمایید.'),(2226,9,'answer-190','1|۱'),(2227,9,'answer-191','2|۲'),(2228,9,'answer-192','2|۲'),(2229,9,'answer-193','2|۲'),(2230,9,'answer-194','2|۲'),(2231,9,'answer-195','1|۱'),(2232,9,'answer-196','2|۲'),(2233,9,'answer-197','1|۱'),(2234,9,'answer-198','2|۲'),(2235,9,'answer-199','1|۱'),(2236,9,'answer-200','1|۱'),(2237,9,'answer-201','1|۱'),(2238,9,'answer-202','1|۱'),(2239,9,'answer-203','2|۲'),(2240,9,'answer-204','1|۱'),(2241,9,'answer-205','2|۲'),(2242,9,'answer-206','1|۱'),(2243,9,'answer-207','1|۱'),(2244,9,'answer-208','2|۲'),(2245,9,'answer-209','2|۲'),(2246,9,'answer-210','2|۲'),(2247,9,'answer-211','2|۲'),(2248,9,'answer-212','1|۱'),(2249,9,'answer-213','2|۲'),(2250,9,'answer-214','1|۱'),(2251,9,'answer-215','1|۱'),(2252,9,'answer-216','1|۱'),(2253,9,'question-190','ماري آمپر: مورخ براي گذشته زندگی می کند، شاعر براي حال، و فیلسوف براي آینده! تو قسمت هفتم عطسه بهرام با فروش چه چیزی میخواست تخت و کالسکه و اسباب بازی بخره؟\n1- دو تخته فرش\n2- دلار\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2254,9,'question-191','جان گالزوش: اگر درباره آینده نیندیشید، یقینا آینده اي هم نخواهید داشت! تو آیتم سال 1410 قسمت هفتم عطسه دوست محمودی گفت آمار چه چیزی بالا رفته؟\n1- نفوس و مسکن\n2- اعتیاد\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2255,9,'question-192','بقراط: زندگی کوتاه است و راه کار دراز و فرصت ها زود از دست می روند! پیشگو قسمت هفتم عطسه گفت که مشکل بچه کسی که تماس گرفته بود چند وعده دیگه برطرف میشه؟\n1- 7 وعده\n2- 3 وعده\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2256,9,'question-193','آگوست کنت: از کسی که حقیقت ندیده، انتظار حقیقت گویی نداشته باشید! سخنران چند شغله قسمت هفتم عطسه گفت انفجار ماشینهای تولیدی بر اثر وجود نشتی باک در کجاست؟\n1- موتور ماشین\n2-اتاق ماشین\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2257,9,'question-194','ساموئل آدامز: قبول وظیفه، قولی است که شخص به شخص دیگر یا جامعه می دهد! به نظر دکتر قسمت هفتم عطسه مشکل بنزین های غیر استاندارد چطوری حل میشه؟\n1- با پالایش صحیح\n2- با سه چهار برابر شدن قیمت اون\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2258,9,'question-195','توماس مان: آینده، در بسته اي است که پشت آن یا سعادت است یا شقاوت! محمودی گفت که قدیمها به غیر از خودش و دوستش چه کسی دیگه تو محلشون اعتیاد داشته؟\n1- جمشید\n2- ساسان\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2259,9,'question-196','برایان تریسی: کلید آینده، رشد مداوم شخصی و حرفه اي شماست! بهرام تو قسمت هفتم عطسه هزینه ویزیت و زایمان همسرش رو میخواست چجوری پرداخت کنه؟\n1- با وام گرفتن\n2- با فروختن طلاهای همسرش\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2260,9,'question-197','ناپلئون: زندگی انسان، آیینه اي است که می توان در آن درس هاي سودمندي را منعکس یافت! خانواده ساسان که تو قسمت هفتم عطسه از سفر برگشته بود در اثر چی فوت کرده بودن؟\n1- تصادف\n2- گازگرفتگی\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2261,9,'question-198','جولیا کامرون: من امروز آغاز زندگی بهتررا با آغوش باز میپذیرم. چنگ زدن به گذشته را رها میکنم. من بذرهاي آینده را میپذیرم! همسر بهرام تو قسمت هفتم عطسه برای چی میخواست پادری جلو حمام و سرویس بهداشتی رو بفروشه؟\n1- هزینه جشن تولد\n2- هزینه شیر خشک و پوشک\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2262,9,'question-199','مترلینگ: آینده ها، به نظر بزرگ جلوه می کنند، ولی وقتی گذشتند می فهمیم که ناچیز بوده اند! همسر بهرام تصمیم داشت برای هزینه عروسی بچه چه چیزی رو بفروشند؟\n1-کلیه هاشون رو\n2- خونه رو\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2263,9,'question-200',' امرسون: موقعی ما قادر به درك حقیقت می شویم که، بهترین فرصت ها را از دست داده ایم! سخنران چند شغله گفت بازیکنان واترپلو در چه جایی عادت ندارند بازی کنند؟\n1- آب کلر دار\n2- آبهای خروشان\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2264,9,'question-201','دانته آلیگیري: روبرو شدن با حقیقت دل شیر می خواهد! سخنران چند شغله دلیل توقف واردات کلم بروکلی رو چی اعلام کرد؟\n1- انبار شدن کلم های داخلی\n2- نداشتن مهر بهداشت\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2265,9,'question-202','روسینی: همه تلاش بزرگان علم و دین این است که آینده را به نحو احسن، به حال مبدل کنند! بهرام تو قسمت هفتم عطسه ماشین رو برای چی میخواست بفروشه؟\n1-خرج مدرسه بچه\n2- مریضی همسرش\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2266,9,'question-203','بالزاك: هر کسی شجاعت ابراز حقیقت را ندارد! به نظر سخنران چند شغله قسمت هفتم عطسه مشکل اصلی مقام نیاوردن در واترپلو نسبت به ورزش های دیگه چیه؟\n1- کلر آب استخر\n2- خیس بودن توپ\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2267,9,'question-204','آنتونی رابینز: براي این که درك بهتري از زندگی داشته باشید، خود را از جلساتی که در آن غیبت و به رخ کشیدن اخلاق است دور کنید! پیشگوی قسمت هفتم عطسه نتیجه بازی استقلال -پرسپولیس رو چند چند تن پیش بینی کرد؟\n1- برد یک هیچ استقلال\n2- برد یک هیچ پرسپولیس\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2268,9,'question-205','وین دایر: نگرانی شما از آینده، کوچکترین تغییري در رویدادهاي آینده ندارد! اسم پیش بین و پیش گو و پیش شنو قسمت هفتم سریال عطسه رو یادته؟\n1- شوشو\n2- سودی\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2269,9,'question-206','ناپلئون: زندگی، قلعه اي است که ما از اسرارش اطلاعی نداریم، پس چرا براي دفاع از آن موانعی فرا راهش اندازیم! به نظر پیشگو مشکل بچه ای که مادرش با برنامه تماس گرفته بود، به خاطر چی بود؟\n1- ترس از پدرش\n2- ترس از تاریکی\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2270,9,'question-207','مادام استاهل: یگانه عملی که در زندگانی، انسان را به هدفش می رساند، انجام وظیفه است! به نظر دکتر کاوه بذرپاش قسمت هفتم عطسه برنامه های بهداشتی چه تاثیری رو مردم گذاشته؟\n1- شنواییشون رو بهتر کرده\n2- شیوع سرطان رو کم کرده\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2271,9,'question-208',' دیوید ثورو: تصور حقیقت، چیزي جز تجسس شباهت ها نیست! سخنران قسمت هفتم عطسه که چند شغله بود، عضو کمیته فنی فدراسیون چه ورزشی هم بود؟\n1- تنیس\n2- واترپلو\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2272,9,'question-209','کانت: بزرگترین کمال براي مرد آن است که وظیفه را براي خاطر وظیفه به جا بیاورد! دکتر کاوه بذرپاش قسمت هفتم عطسه گفت آمار شیوع سرطان چطور بوده؟\n1-رشد و شیوع داشته\n2-کاهش و کسری داشته\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2273,9,'question-210','بتهوون: تا می توانیم نیکی کنیم، آزادي را از هر چیز گرامی تر بدانیم و هرگز مرتکب جنایت نسبت به راستی و حقیقت نشویم! راستی اسم نامزد ساسان که تو قسمت هفتم عطسه ، غیابی ازش طلاق گرفته بود، چی بود؟\n1- کاملیا\n2- نسترن\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2274,9,'question-211','دیوژن: بنده و اسیر نگرانی هاي آینده و غم هاي گذشته خویش مباش! تو قسمت هفتم عطسه بهرام و همسرش میخواستن از کجا سرمایه کار بچه شون در آینده رو تامین کنند؟\n1- با فروختن خونه\n2- با فروختن قبرهاشون\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2275,9,'question-212','لرد بایرون : حقیقت همیشه عجیب تر از تخیل است! سخنران قسمت هفتم عطسه حدس میزد که درگیریها و مشکلات به وجود اومده در اروپا چند روز دیگه حل بشه؟\n1- 7 تا 10 روز دیگه\n2- یک سال دیگه\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2276,9,'question-213','وین دایر: آنانی که به رویدادهاي آینده ي خود گرفتارند، آنچه به اکنون وابسته است رضایت شان را فراهم نمی کند! بهرام تو قسمت هفتم عطسه خونه رو برای چی میخواست بفروشه؟\n1- هزینه عروسی\n2- هزینه دانشگاه\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2277,9,'question-214',' آویبوري: شناختن وظیفه کار مشکلی نیست ولی، انجام وظیفه مشکل است! دکتر کاوه بذرپاش قسمت هفتم سریال عطسه رئیس کجا بود؟\n1- مرکز پیشگیری و درمان سرطان کشور\n2- شرکت خودرو سازان تلاشگر\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2278,9,'question-215',' نهرو: وقتی که دروغ کار خود را به پایان رساند، خواهد پوسید و حقیقت با عظمت خود پیروز خواهد شد! سخنران چند شغله عضو هیئت مدیره چه شرکتی هم بود؟\n1- خودروسازان تلاشگر\n2- خودروسازی راه جو\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1'),(2279,9,'question-216','امانوئل کانت: خواب دیدم زندگانی جمال و زیبایی است، بیدار شدم دانستم زندگی عبارت از وظیفه شناسی است! دکتر اتاق عمل قسمت هفتم عطسه گفت چقدر صرف عمل پیوند سر تا حالا شده؟\n1- 32 میلیون دلار\n2- 10 میلیون دلار\nلطفا گزینه مورد نظر خود را بعد از ت ارسال نمایید. مثال: ت1 یا t1');
